INSERT INTO `AboutRust` VALUES (1,'INTRO','## 초기 목표\n\nRust의 목표는 동시성이 높고 안전하며 성능이 뛰어난 시스템을 만들기 위한 좋은 프로그래밍 언어입니다.\n\n```text\n “Rust is a systems programming language focused on three goals: \nsafety, speed, and concurrency.”\n__ Rust Documentation\n```\n\nRust는 매우 젊고 매우 현대적인 언어입니다. **[컴파일된 프로그래밍 언어](https://en.wikipedia.org/wiki/Compiled_language)** 이며 백엔드에서 [LLVM](https://en.wikipedia.org/wiki/LLVM) 을 사용 합니다. 또한, Rust는 명령형 절차, 동시 행위자, 객체 지향 및 순수 기능 스타일을 지원 하는 **[다중 패러다임 프로그래밍 언어 입니다.](https://en.wikipedia.org/wiki/Comparison_of_multi-paradigm_programming_languages)** 또한 정적 및 동적 스타일 모두에서 일반 프로그래밍 및 메타 프로그래밍을 지원합니다.\n\n```text\n ? Rust의 가장 독특하고 매력적인 기능 중 하나는 \n메모리 안전을 달성하는 데 사용되는 Ownership 입니다.\nRust는 낙관적으로 메모리 포인터를 생성 하고 \nReferences 및 Borrowing을 사용하여 컴파일 타임에 \n메모리 포인터의 제한된 액세스를 확인합니다 . \n그리고 Lifetimes를 확인하여 자동 컴파일 타임 메모리 관리를 수행합니다.\n```\n\n![img](data:image/png;base64,)\n\n## ****영향****\n\nRust는 기존의 다양한 언어에 영향을 받아 만들어졌습니다.\n\n- [ ] 추상 기계 모델: **C**\n- [ ] 데이터 유형: **C, SML, OCaml, Lisp, Limbo**\n- [ ] 선택적 바인딩: **Swift**\n- [ ] 위생 매크로: **Scheme**\n- [ ] 함수형 프로그래밍: **Haskell, OCaml, F#**\n- [ ] 속성: **ECMA**335\n- [ ] 메모리 모델 및 메모리 관리: **C++, MLKit, Cyclone**\n- [ ] 유형 클래스: **Haskell**\n- [ ] Crate: Assembly in the **ECMA**335 CLI model\n- [ ] 채널 및 동시성: **Newsqueak, Alef, Limbo**\n- [ ] 메시지 전달 및 스레드 실패: **Erlang**\n\n등\n\n![img](data:image/png;base64,)\n\nRust 는 기본적으로 자동화된 가비지 수집 시스템(GC)을 **사용하지 않습니다 .**\n\nRust 컴파일러 **는 컴파일 시간에 코드를** 관찰하고 프로그래밍 언어와 같은 C, C++로 작성할 수 있는 **[여러 유형의 오류](https://doc.rust-lang.org/error-index.html)** 를 방지하는 데 도움이 됩니다.','Rust는 안전하며 성능이 뛰어난 시스템을 위한 언어!'),(2,'RUST','use std::fs;\nuse std::time::Instant;\n\nfn main(){\n    let data = fs::read_to_string(\"in.in\").expect(\"Unable to read file\");\n    \n    let temp_data: Vec<&str> = data\n       .split(|c| c == \',\')\n        .collect();\n\n    let numbers: Result<Vec<i32>, _> = temp_data\n        .iter()\n        .map(|x| x.parse())\n        .collect();\n\n    let mut tmp = &mut numbers.unwrap();\n    \n    let now = Instant::now();\n    tmp.clone().sort();\n    let after = Instant::now();\n    println!(\"Rust 기본 Sort: {:?}\", after - now);\n    \n    let now = Instant::now();\n    merge_sort(&mut tmp);\n    let after = Instant::now();\n    println!(\"Merge Sort: {:?}\", after - now);\n\n    let now = Instant::now();\n    quick_sort(tmp.to_vec());\n    let after = Instant::now();\n    println!(\"Quick Sort: {:?}\", after - now);\n\n}\n\n\n\nfn merge(left: &mut Vec<i32>,right: &mut Vec<i32>) -> Vec<i32>{\n    let mut sort = Vec::new();\n    let mut i: usize = 0;\n    let mut j: usize = 0;\n    let left_size = left.len();\n    let right_size = right.len();\n    while left_size > i && right_size > j{\n        if left[i] > right[j]{\n            sort.push(right[j]);\n            j += 1;\n        }\n        else{\n            sort.push(left[i]);\n            i += 1;\n        }\n    }\n    if left_size > i{\n        for k in i..left_size{\n            sort.push(left[k]);\n        }\n    }\n    else if right_size > j{\n        for k in j..right_size{\n            sort.push(right[k]);\n        }\n    }\n    return sort\n}\n\nfn merge_sort(unsort:&mut Vec<i32>) -> Vec<i32>{\n    let size = unsort.len();\n    if size > 1{\n        let mid = size / 2;\n        return merge(&mut merge_sort(&mut unsort[0..mid].to_vec()),&mut merge_sort(&mut unsort[mid..size].to_vec()))\n    }\n    else{\n        return unsort.to_vec()\n    }\n}\n\nfn quick_sort(unsort:Vec<i32>) -> Vec<i32>{\n    let size = unsort.len();\n    let mut sort = Vec::new();\n    if size > 1{\n        let mid = size / 2;\n        let pivot = unsort[mid];\n        let mut left = Vec::new();\n        let mut pivot_list = Vec::new();\n        let mut right = Vec::new();\n        for i in unsort{\n            if i < pivot{\n                left.push(i);\n            }\n            else if i > pivot{\n                right.push(i);\n            }\n            else{\n                pivot_list.push(i);\n            }\n        }\n        sort.append(&mut quick_sort(left));\n        sort.append(&mut pivot_list);\n        sort.append(&mut quick_sort(right));\n        return sort\n    }\n    else{\n        return unsort\n    }\n}',NULL),(3,'ADVANTAGES','# <Rust 장점>\n\nRust는 언어에서 **속도**와 **안정성**을 원하는 사람들을 위한 것입니다. 여기서 속도란, Rust를 가지고 만들 수 있는 **프로그램의 속도**와 Rust가 여러분들로 하여금 이를 **작성하게 하는 속도** 두가지 전부 다를 의미합니다. Rust 컴파일러의 검사들은, 이런 검사들을 가지고 있지 않은 언어라서 개발자들이 고치기를 꺼려하는 불안정한 레거시 코드들과는 반대로 **기능 추가** 및 **리팩토링**을 통해 **안정성을 보장**해줍니다. 비용 없는 추상화, 더 낮은 수준의 코드를 수동으로 작성한 코드만큼 빠르게 컴파일해주는 더 높은 수준의 기능을 위해 고군분투함으로서, Rust는 안정적인 코드가 또한 빠른 코드가 되도록 노력합니다.\n\n- [ ] 메모리 세이프\n- [ ] 유형 안전\n- [ ] 데이터 레이스 프리\n- [ ] 미리 컴파일된\n- [ ] 제로 비용 추상화를 기반으로 구축 및 권장\n- [ ] 최소 런타임(세계 정지 가비지 수집 없음, JIT 컴파일러 없음, VM 없음)\n- [ ] 낮은 메모리 풋프린트(프로그램은 소형 마이크로컨트롤러와 같이 리소스가 제한된 환경에서 실행됨)\n- [ ] 베어 메탈을 대상으로 합니다(예: OS 커널 또는 장치 드라이버 작성, Rust를 \'고수준 어셈블러\'로 사용)\n\n## **C와 C++의 대체 언어로 각광 받고 있다.**\n\n다른 언어와 비교하여 최고 수준으로 편리한 컴파일러와 소유권 개념 도입으로 보장되는 강력한 안전성과 빠른 속도 덕분에 C와 C++을 대체하는 언어로 각광 받고 있다.\n\n예시로 아마존, 클라우드플레어, 마이크로소프트 같은 회사들이 C와 C++로 된 코드들을 Rust로 대체하고 있다.\n\n## **Row level language , System programming**\n\nRUST는 row level language로서 system programming에 가깝다.assembly language 바로 그 다음의 단계에 있는 저수준 언어이다.java 그리고 특히 js와 python와 비교하면 아주 저수준 언어인 것이다.rust의 강점은 fast와 safe이다.\n\n## **fast**\n\n##### **중간단계가 없다**\n\njava는 class파일로 변환 후 컴퓨터가 기계어로 읽을 수 있게 된다.(더 많은 단계가 있겠지만 아주 간단하게 설명하자면 말이다.)python언어는 C언어로 이해된 후에 컴퓨터가 기계어로 읽을 수 있게 되는 것이다.**Rust는 java, python, js와 같이 컴퓨터가 기계어로 읽기 전에 거치게 되는 중간 단계가 없기 때문에 속도가 빠른 것이다.**\n\n##### **garbage collector가 없다**\n\n그리고 또한 garbage collector가 없기 때문에 빠르다.c언어와 같은 저수준 언어는 변수를 만들 때 메모리 할당을 요청하고 더이상 쓰이지 않을 때는 메모리 공간 해제를 해야한다.그러나 java, js, python같은 고수준 언어에서는 이렇게 할 필요가 없는 데 이는 garbage collector가 있기 때문이다. **garbage collector는 쓰이지 않는 데이터가 메모리 공간에 있는지 늘 탐색하고 있다. 그리고 해당 공간을 발견하면 삭제한다.** garbage collector가 이러한 일을 하기 때문에 개발자에게는 편리함을 주는 반면 프로그램의 성능은 느려지게 만드는 것이다.**그래서 garbage collector가 없는 언어들이 있는 언어들보다 빠른 것이다.**\n\n## **safe**\n\n##### ❗`Ownership` 개념 덕분에 `Memory Access Bug`로부터 안전하다!\n\n**보안 문제의 70%가 메모리 엑세스와 관련이 있다**. ➡️ 그렇게 때문에 Rust가 안전하다는 것이다.**Memory Access Bug는 할당되지 않은 메모리 장소에 접근하거나, 이미 해제된 메모리 부분에 접근하려고 하거나, 또는 할당된 변수를 두 번 해제할려고 할 때 발생한다. 이는 곧 Runtime Error로 이어질 수 있다.**이 문제 때문에 Rust가 인기가 많은 것이다.Rust는 C와 C++보다 느리더라도 거의 비슷한 퍼포먼스를 제공할 뿐만 아니라 더욱 안전하다.그 이유는 Rust는 프로그램의 데이타에 대한 관념이 다르기 때문이다.그것이 바로 소유권 `Ownership`이라는 개념이다.**소유권 [ Ownership ] 이라는 개념에서는 프로그램의 데이터는 변수에 의해 소유된다. 그리고 데이터는 한번에 한 owner에게만 소유된다. Owner가 더이상 사용되지 않는다면, 데이터는 메모리에서 제거된다.**\n\n# <Rust 특징>\n\n### 빠르고, 안전한 언어\n\nC와 C++ 만큼 **빠릅**니다. Rust는 C 및 C++ 같은 기존 시스템 소프트웨어 언어를 안전하게 대체할 수 있고, C와 C++에서 기대할 수 없었던 **메모리 안전성까지도 보장**합니다. Rust는 C 및 C++에서 발생할 수 있는 잘못된 메모리 사용과 관련된 수많은 **버그를 방지**합니다. 컴파일러는 잘못된 형식의 변수에 어떤 작업도 적용되지 않게 보장합니다.\n\n### 형식이 엄격한 언어\n\n안전한 코딩을 위해 Rust에서 정해놓은 **형식을** 엄격하게 **지켜야** 합니다. 그래서 비교적 코딩의 자유도가 떨어집니다.\n\n하지만 Rust는 이러한 형식을 따라가다보면, 속도와 메모리 사용 측면에서 효율적이면서도 **안정적인 코드를 작성**해 나갈 수 있도록 여러분들을 **자연스럽게** 안내하도록 설계되었습니다.\n\n### 코딩을 알려주는 친절한 컴파일러\n\n오류가 나면 어떻게 수정해야하는지 **오류 해결 방법을** 컴파일러에서 **알려줍니다.** \n\n','Rust는 빠른 속도와 안정성을 가져요!'),(4,'HISTORY','![img](data:image/png;base64,)\n\nRust 프로그래밍 언어는 **2006년** 모질라(Mozilla) 연구소의 **Graydon Hoare**에 의해 설계되었습니다. \n그리고 **처음에는 개인적인 프로젝트**로 시작되었습니다.\n\n모질라는 2009년부터 이 프로젝트를 지원하기 시작했으며, **2010년 Rust를 처음 발표**하였습니다. Rust의 첫버전인 Rust 1.0은 2015년 5월에 발표되었으며, 지속적인 버전 업그레이드를 통해 **2022년 3월에는 v1.61.0**에 이르렀습니다.\n\n2021년 2월 **Mozilla, Amazon AWS, Huawei, Google, Microsoft 등의 5개 기업은 Rust Foundation**을 만들었으며,\n\n2021년 4월 **Google**은 Android Open Source Project에서 C/C++의 대안으로 **Rust를 지원**할 것을 발표하였습니다.\n','Rust는2006년에 시작되었고, 2010년에 처음 공식 배포됐어요!'),(5,'SURVEY','StackOverflow에서 개발자들을 상대로 한 설문조사에서는 Rust는 지난 **6년(2016~2021)간 가장 사용해보고 싶은 언어 1위**로 선택 받았습니다. 그리고 설문 결과에서는 해당 퍼센트가 올라가는 추세임을 볼 수 있습니다.\n\n​\n\n![](data:image/png;base64,)\n\n​\n','Rust는 6년 연속으로 가장 관심받는 언어입니다!'),(6,'ENTERPRISE','# 메타(구 페이스북)\n\n## 백엔드 서버 언어로 Rust를 새롭게 채택!\n\n2022년 7월 27일(현지 시각), 메타가 공식 홈페이지를 통해 자사 서비스 개발과 유지, 관리 작업에 중요한 역할을 하는 **서버 사이드(server-side) 언어**와 주요 **지원 언어**를 공개했는데, 그 중에서 Rust가 새롭게 포함되었습니다.\n\nMeta에서는 다양한 플랫폼과 사용 사례에 대해 다양한 프로그래밍 언어를 사용합니다.\n새로운 언어를 지원하는 것은 가볍게 내리는 결정이 아닙니다.\n\nMeta측에서 밝힌 바로는 Meta가 채택하는 모든 언어가 특정 사용 사례에 가장 적합하도록 하는 것이 중요하므로 언어를 평가할 때마다 **높은 수준의 노력**을 기울입니다.\n\n언어 결정은 한 번 결정되면 고정되는 경향이 있으므로 처음부터 엔지니어에게 최고의 작업 도구를 제공하기 위해 신중을 기하고자 합니다.\n\n조금 더 자세히 알아보자면, 성능이 중요한 **백엔드 서버**에는 **C++**과 **러스트** 사용을 권장했습니다.\n\n메타는 **러스트를 비교적 최근 지원 언어로 추가**하였습니다.\n\n메타는 최근 자사 제품과 서비스의 **러스트 사용 빈도가 증가하는 추세**이며, **CLI 툴에도** **Rust** 사용을 **권장**했습니다.\n\n그리고 러스트를 장기간 지원할 의사가 있다고 밝히며, **개발자의 러스트 채택을 적극 환영**한다고 전했습니다.\n\n# 마이크로소프트\n\n윈도우에서 메모리 관련 버그를 줄이기 위하여 러스트를 도입하였습니다.\n\n현재(2022년 9월 19일 기준) 깃허브에는 마이크로소프트의 공개적 러스트 저장소가 27개 존재합니다. [https://github.com/orgs/microsoft/repositories?q=&type=all&language=rust&sort=](https://github.com/orgs/microsoft/repositories?q=&type=all&language=rust&sort=)\n\n![img](data:image/png;base64,)\n\n**마이크로소프트의 러스트 팀**은 마이크로소프트 내에서 **러스트 사용을 지원**하는 한편,\n\n컴파일러, 핵심 도구, 설명서 및 언어의 다른 측면에 대해 긴밀하게 작업하면서\n\n**러스트 커뮤니티에 참여할 기회를 모색**할 계획이라고 공식적으로 밝혔습니다.\n\n마이크로소프트 측은 “모질라(Mozilla)가 후원하는 **러스트 언어는 보안과**\n\n**신뢰 측면에서 강점**이 있어 안전한 고성능 소프트웨어 시스템을 개발할 수 있다”라고 말했습니다.\n\n마이크로소프트는 마이크로소프트 개발자 부서와 협력해 윈도우 및 리눅스의 내부 제품군을 위한 **러스트** 컴파일러 및 도구를 개선할 **소프트웨어 엔지니어 구인 광고를 게시**했습니다.\n![img](data:image/png;base64,)\n마이크로소프트는 **러스트 개발 언어에 큰 관심**을 갖고 있으며, **러스트를 사용**해 **새로운 구성 요소**를 만들고 **기존 구성 요소를 재작성**하는 방법을 모색하고 있습니다.\n\n마이크로소프트는 윈32 메타데이터(Win32 Metadata) 프로젝트를 통해 러스트와 다른 언어에서 윈도우 API에 더 쉽게 접근할 수 있도록 하는 것을 목표로 합니다.\n\n# 드롭박스\n\n드롭박스는 프로그래밍의 핵심적인 부분에 러스트를 이용합니다.\n\n다음의 사진은 러스트 언어 공식 홈페이지에 나와있는 부분을 가져온 것입니다.\n\n![img](data:image/png;base64,)\n\n해석을 하자면 다음과 같습니다.\n\nDropbox 핵심 파일 저장 시스템의 여러 구성 요소는\n\n더 큰 데이터 센터 효율성을 추구하기 위한 대규모 **프로젝트의 일부로 Rust로 작성**되었습니다.\n\n현재 5억 명 이상의 사용자에게 서비스를 제공하는 **모든 Dropbox 스토리지**에서\n\n**Rust가 사용**되고 있습니다.\n','meta(페이스북)과 Microsoft 등 대기업에서 사용돼요!\n곧, Linux에서도 사용될 예정입니다!'),(7,'CPP','#include <iostream>\n#include <fstream>\n#include <cstdlib>\n#include <vector>\n#include <string>\n#include <chrono>\n#include <algorithm> \nusing namespace std;\n\nvoid MergeSort(vector<int>& v, int s, int e);\nvoid MergeSortedIntervals(vector<int>& v, int s, int m, int e);\nvoid QuickSort(vector<int>& v, int left, int right);\nint paritition(vector<int>& v, int left, int right);\n\nint main() {\n	fstream fs;\n	fs.open(\"in.in\", ios::in);\n	\n	\n	string strBuf;\n	vector<int> vec;\n	while (!fs.eof()) {\n		getline(fs, strBuf, \',\');\n		vec.push_back(stoi(strBuf));\n	}\n	\n	//기본Sort\n	vector<int> tempVec = vec;\n	auto start = chrono::high_resolution_clock::now();\n	sort(tempVec.begin(), tempVec.end());\n	auto elapsed = chrono::high_resolution_clock::now() - start;\n	double microseconds = chrono::duration_cast<std::chrono::microseconds>(elapsed).count() / 1000.0;\n	cout << \"C++ 기본 Sort: \" << microseconds << \"ms\" << endl;\n	\n	//MergeSort\n	tempVec = vec;\n	start = chrono::high_resolution_clock::now();\n	MergeSort(tempVec, 0, tempVec.size()-1);\n	elapsed = chrono::high_resolution_clock::now() - start;\n	microseconds = chrono::duration_cast<std::chrono::microseconds>(elapsed).count() / 1000.0;\n	cout << \"Merge Sort: \" << microseconds << \"ms\" << endl;\n	\n	//QuickSort\n	tempVec = vec;\n	start = chrono::high_resolution_clock::now();\n	QuickSort(tempVec, 0, tempVec.size()-1);\n	elapsed = chrono::high_resolution_clock::now() - start;\n	microseconds = chrono::duration_cast<std::chrono::microseconds>(elapsed).count() / 1000.0;\n	cout << \"Quick Sort: \" << microseconds << \"ms\" << endl;\n	\n	fs.close();	\n	return 0;\n}\n\nvoid MergeSortedIntervals(vector<int>& v, int s, int m, int e) {\n	vector<int> temp;\n	int i, j;\n	i = s;\n	j = m + 1;\n\n	while (i <= m && j <= e) {\n\n		if (v[i] <= v[j]) {\n			temp.push_back(v[i]);\n			++i;\n		}\n		else {\n			temp.push_back(v[j]);\n			++j;\n		}\n\n	}\n\n	while (i <= m) {\n		temp.push_back(v[i]);\n		++i;\n	}\n\n	while (j <= e) {\n		temp.push_back(v[j]);\n		++j;\n	}\n\n	for (int i = s; i <= e; ++i)\n		v[i] = temp[i - s];\n\n}\n\nvoid MergeSort(vector<int>& v, int s, int e) {\n	if (s < e) {\n		int m = (s + e) / 2;\n		MergeSort(v, s, m);\n		MergeSort(v, m + 1, e);\n		MergeSortedIntervals(v, s, m, e);\n	}\n}\n\nint paritition(vector<int>& v, int left, int right)\n{\n	\n	int pivot = v[left];\n	int low = left + 1;\n	int high = right;\n\n	while (low <= high) \n	{\n		while (low <= right && pivot >= v[low])\n		{\n			low++; \n		}\n		while (high >= (left+1) && pivot <= v[high])\n		{\n			high--; \n		}\n		if (low <= high) \n		{\n			int temp = v[low];\n			v[low] = v[high];\n			v[high] = temp;\n		}\n	}\n	\n	int temp = v[left];\n	v[left] = v[high];\n	v[high] = temp;\n\n	return high;\n}\n\nvoid QuickSort(vector<int>& v, int left, int right)\n{\n	if (left < right)\n	{\n		int q = paritition(v, left, right);  \n		QuickSort(v, left, q - 1); \n		QuickSort(v, q + 1, right); \n\n	}\n\n}',NULL),(8,'JAVA','import java.io.BufferedReader;\nimport java.io.FileReader;\nimport java.util.*;\nimport java.util.stream.Collectors;\nimport java.util.stream.Stream;\n\npublic class Code\n{\n    public static void main (String[] args)\n    {\n        Code code = new Code();\n        code.run();\n    }\n\n    private void run() {\n        List<List<String>> records = new ArrayList<>();\n        try (BufferedReader br = new BufferedReader(new FileReader(\"in.in\"))) {\n            String line;\n            while ((line = br.readLine()) != null) {\n                String[] values = line.split(\",\");\n                records.add(Arrays.asList(values));\n            }\n        } catch (Exception e) {\n            e.printStackTrace();\n        }\n\n        List<Integer> list = records.get(0).stream().map(Integer::parseInt).collect(Collectors.toList());\n\n        // 자바 기본 Sort\n        List<Integer> temp = new ArrayList<>();\n        temp.addAll(list);\n        long start = System.currentTimeMillis();\n        Collections.sort(temp);\n        System.out.println(\"Java 기본 Sort: \" + (System.currentTimeMillis() - start) + \"ms\");\n\n        // Merge Sort\n        List<Integer> temp2 = new ArrayList<>();\n        temp2.addAll(list);\n        start = System.currentTimeMillis();\n        mergeSort(temp2);\n        System.out.println(\"Merge Sort: \" + (System.currentTimeMillis() - start) + \"ms\");\n\n\n        // Quick Sort\n        List<Integer> temp3 = new ArrayList<>();\n        temp3.addAll(list);\n        start = System.currentTimeMillis();\n        quickSort(temp3);\n        System.out.println(\"Quick Sort: \" + (System.currentTimeMillis() - start) + \"ms\");\n    }\n\n    public static List<Integer> quickSort(List<Integer> list) {\n        if (list.size() <= 1) return list;\n        int pivot = list.get(list.size() / 2);\n\n        List<Integer> lesserArr = new LinkedList<>();\n        List<Integer> equalArr = new LinkedList<>();\n        List<Integer> greaterArr = new LinkedList<>();\n\n        for (int num : list) {\n            if (num < pivot) lesserArr.add(num);\n            else if (num > pivot) greaterArr.add(num);\n            else equalArr.add(num);\n        }\n\n        return Stream.of(quickSort(lesserArr), equalArr, quickSort(greaterArr))\n                .flatMap(Collection::stream)\n                .collect(Collectors.toList());\n    }\n\n    public List<Integer> mergeSort(List<Integer> targetList) {\n        // 사이즈가 1보다 크다면\n        if (targetList.size() > 1) {\n            // 왼쪽 오른쪽을 merge 합니다.\n            return merge(\n                    // 왼쪽 / 오른쪽으로 배열을 나누고 다시 sort하도록 합니다.\n                    mergeSort(targetList.subList(0, targetList.size() / 2)),\n                    mergeSort(targetList.subList(targetList.size() / 2, targetList.size()))\n            );\n        } else {\n            // 사이즈가 1 이하라면 재귀가 종료됩니다.\n            return targetList;\n        }\n    }\n\n    public List<Integer> merge (List<Integer> left, List<Integer> right) {\n        // 결과가 될 임시 배열입니다.\n        List<Integer> result = new ArrayList<>();\n        int rightIdx = 0;\n\n        // 왼쪽 배열을 순환하면서\n        for (Integer l : left) {\n\n            // right를 끝까지 돌았는지 / right배열의 값이 l보다 작은지 확인하고,\n            while (right.size() > rightIdx && l > right.get(rightIdx)) {\n                // 작은 값을 결과에 넣습니다.\n                result.add(right.get(rightIdx));\n                rightIdx++;\n            }\n            // left가 작다면 left element를 넣습니다.\n            result.add(l);\n        }\n        // 오른쪽 배열의 남은 숫자를 결과에 넣습니다.\n        for (int i = rightIdx; i < right.size(); i ++) {\n            result.add(right.get(i));\n        }\n        return result;\n    }\n}\n\n',NULL),(9,'PYTHON','import csv\nimport time\n\ndef merge(left,right):\n    sort = []\n    i, j = 0, 0\n    left_size = len(left)\n    right_size = len(right)\n    while left_size > i and right_size > j:\n        if left[i] > right[j]:\n            sort.append(right[j])\n            j += 1\n        else:\n            sort.append(left[i])\n            i += 1\n    \n    if left_size > i:\n        sort.extend(left[i:])\n    elif right_size > j:\n        sort.extend(right[j:])\n    return sort\n\ndef merge_sort(unsort):\n    size = len(unsort)\n    if size > 1:\n        mid = size // 2\n        return merge(merge_sort(unsort[:mid]),merge_sort(unsort[mid:]))\n    else:\n        return unsort\n\ndef split(pivot,unsort):\n    pivot_list = []\n    left, right = [], []\n    for x in unsort:\n        if x < pivot:\n            left.append(x)\n        elif x > pivot:\n            right.append(x)\n        else:\n            pivot_list.append(x)\n    return (left, right)\n\ndef quick_sort(unsort):\n    size = len(unsort)\n    if size > 1:\n        pivot = unsort[size//2]\n        left,right = split(pivot,unsort)\n        return quick_sort(left)+[pivot]+quick_sort(right)\n    else:\n        return unsort\n\n\nwith open(\"in.in\",\"rt\") as file: \n    cln = csv.reader(file)\n    tmp = [row for row in cln]\n\ntemp  = tmp[0]\ntest = [int(i) for i in temp]\nstart = time.time()\nsorted(test)\ncalcTime = round((time.time() - start) * 1000 , 4)\nprint(\"Python 기본 Sort: \" + str(calcTime) + \"ms\")\n\nstart = time.time()\nmerge_sort(test)\ncalcTime = round((time.time() - start) * 1000 , 4)\nprint(\"Merge Sort: \" + str(calcTime) + \"ms\")\n\nstart = time.time()\nquick_sort(test)\ncalcTime = round((time.time() - start) * 1000 , 4)\nprint(\"Quick Sort: \" + str(calcTime) + \"ms\")',NULL),(10,'PERFORMANCE','Rust는 높은 안전성과 빠른 속도가 특징인 프로그래밍 언어입니다. \n\n해당 페이지에서는 Rust와 Java, Python, C++의 비교 코드를 직접 실행시키며 차이를 확인할 수 있습니다. \n\n![](data:image/png;base64,)\n해당 그래프는 프로그래밍 언어를 벤치마크 하여 성능 측정을 한 결과를 나타낸 표입니다.\nC와 C++ 그리고 Rust가 아주 근소한 차이로 1,2,3위를 차지하고 있습니다.\n또한 4위인 .NET과는 차이가 확연하게 남을 알 수 있습니다.\n\n### 자, 이제 C, C++과 Rust를 벤치마크한 결과를 확인해 보겠습니다. \n벤치마크 프로그램은 여러가지가 있지만 그중에서 k-nucleotide와 regex-redux를 살펴보겠습니다.\n\n# k-nucleotide\n### C VS Rust\n![](data:image/png;base64,)\n해당 벤치마크 프로그램에서는 Rust가 C보다 적은 cpu 시간을 사용함을 알 수 있습니다.\n\n\n### C++ VS Rust\n![](data:image/png;base64,)\n\nC++와 비교한 결과에서는 1위가 C++이지만, 2위~5위까지가 Rust임을 확인 할 수 있습니다.\n이처럼 C++가 더 빠른 이유는 Rust가 안정성을 위한 검사를 진행하고 컴파일 되기 때문인 영향도 있습니다. \n다만, 확실한 것은 Rust는 메모리 누수로 오류가 날 가능성이 거의 없다는 것입니다.\n\n# regex-redux\n### C VS Rust\n![](data:image/png;base64,)\n해당 프로그램의 결과를 보면, 근소한 차이이지만, Rust가 더 작은 cpu 시간을 가짐을 알 수 있습니다.\n\n\n### C++ VS Rust\n![](data:image/png;base64,)\n\n해당 결과를 보면, Rust가 1위~8위까지 한 결과를 살펴볼 수 있습니다.\n\n### 물론 벤치마크 프로그램마다 저마다 차이가 있지만, Rust가 cpu time 측면에서 항상 상위권에 있다는 것은 사실입니다.\n\n이제 각 언어 탭을 눌러서, 500,000개의 정렬되지 않은 숫자 데이터를 각 언어별 기본 제공 Sort함수와 Merge Sort, Quick Sort의 실행시간을 비교하여 봅시다.','Rust와 타언어 성능비교 & 정렬 알고리즘 구현 예제');
