INSERT INTO `ExerciseContent` VALUES (1,'Rust를 사용해서 Hello World!를 출력하세요..','없음.','','Hello World!를 출력하세요. ','Hello World!',1,'fn main() {\n println!(\"Hello Hi!\")\n}',NULL,0),(2,'두 정수 A와 B를 입력받은 다음, A+B를 출력하는 프로그램을 작성하시오.','첫째 줄에 A와 B가 주어진다. (0 < A, B < 10)','1 2','첫째 줄에 A+B를 출력한다.','3',2,'use std::io;\n\nfn main() {\n    let mut line = String::new();\n    io::stdin().read_line(&mut line).unwrap();\n    println!(\n        \"{}\",\n        line.split_whitespace()\n            .map(|word| word.parse::<i32>())\n            .sum::<Result<i32, _>>()\n            .unwrap()\n    );\n}',NULL,0),(3,'두 정수 A와 B를 입력받은 다음, A×B를 출력하는 프로그램을 작성하시오.','첫째 줄에 A와 B가 주어진다. (0 < A, B < 10)','1 2','첫째 줄에 A×B를 출력한다.','2',3,'fn main() {\n\n}',NULL,0),(4,'두 정수 A와 B가 주어졌을 때, A와 B를 비교하는 프로그램을 작성하시오.','첫째 줄에 A와 B가 주어진다. A와 B는 공백 한 칸으로 구분되어져 있다.','1 2','첫째 줄에 다음 세 가지 중 하나를 출력한다.\n\nA가 B보다 큰 경우에는 \'>\'를 출력한다.\nA가 B보다 작은 경우에는 \'<\'를 출력한다.\nA와 B가 같은 경우에는 \'==\'를 출력한다.\n(-10,000 ≤ A, B ≤ 10,000)','<',4,'fn main() {\n    let mut inp = String::new();\n    std::io::stdin().read_line(&mut inp).unwrap();\n    let parts: Vec<i32> = inp.split(\' \').map(|x| x.trim().parse().unwrap()).collect();\n    if parts[0] == parts[1] {\n        println!(\"==\")\n    }\n    else if parts[0] < parts[1]{\n        println!(\"<\")\n    }\n    else {\n        println!(\">\")\n    }\n}',NULL,0),(5,'시험 점수를 입력받아 90 ~ 100점은 A, 80 ~ 89점은 B, 70 ~ 79점은 C, 60 ~ 69점은 D, 나머지 점수는 F를 출력하는 프로그램을 작성하시오.','첫째 줄에 시험 점수가 주어진다. 시험 점수는 0보다 크거나 같고, 100보다 작거나 같은 정수이다.','100','시험 성적을 출력한다.','A',5,'use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n    \n    let score: i32 = input.trim().parse().unwrap();\n    \n    let grade: &\'static str = match score / 10 {\n        9 | 10 => \"A\",\n        8 => \"B\",\n        7 => \"C\",\n        6 => \"D\",\n        _ => \"F\",\n    };\n    \n    println!(\"{}\", grade);\n}',NULL,0),(6,'KOI 전자에서는 건강에 좋고 맛있는 훈제오리구이 요리를 간편하게 만드는 인공지능 오븐을 개발하려고 한다. 인공지능 오븐을 사용하는 방법은 적당한 양의 오리 훈제 재료를 인공지능 오븐에 넣으면 된다. 그러면 인공지능 오븐은 오븐구이가 끝나는 시간을 분 단위로 자동적으로 계산한다. \n\n또한, KOI 전자의 인공지능 오븐 앞면에는 사용자에게 훈제오리구이 요리가 끝나는 시각을 알려 주는 디지털 시계가 있다. \n\n훈제오리구이를 시작하는 시각과 오븐구이를 하는 데 필요한 시간이 분단위로 주어졌을 때, 오븐구이가 끝나는 시각을 계산하는 프로그램을 작성하시오.','첫째 줄에는 현재 시각이 나온다. 현재 시각은 시 A (0 ≤ A ≤ 23) 와 분 B (0 ≤ B ≤ 59)가 정수로 빈칸을 사이에 두고 순서대로 주어진다. 두 번째 줄에는 요리하는 데 필요한 시간 C (0 ≤ C ≤ 1,000)가 분 단위로 주어진다. ','14 30\n20','첫째 줄에 종료되는 시각의 시와 분을 공백을 사이에 두고 출력한다. (단, 시는 0부터 23까지의 정수, 분은 0부터 59까지의 정수이다. 디지털 시계는 23시 59분에서 1분이 지나면 0시 0분이 된다.)','14 50',12,'fn main() {\n\n}',NULL,0),(7,'N을 입력받은 뒤, 구구단 N단을 출력하는 프로그램을 작성하시오. 출력 형식에 맞춰서 출력하면 된다.','첫째 줄에 N이 주어진다. N은 1보다 크거나 같고, 9보다 작거나 같다.','2','출력형식과 같게 N*1부터 N*9까지 출력한다.','2 * 1 = 2\n2 * 2 = 4\n2 * 3 = 6\n2 * 4 = 8\n2 * 5 = 10\n2 * 6 = 12\n2 * 7 = 14\n2 * 8 = 16\n2 * 9 = 18',13,'use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n    let number = input.trim().parse::<i32>().unwrap();\n\n    for i in 1..10 {\n        println!(\"{} * {} = {}\", number, i, number * i);\n    }\n}',NULL,0),(8,'n이 주어졌을 때, 1부터 n까지 합을 구하는 프로그램을 작성하시오.','첫째 줄에 n (1 ≤ n ≤ 10,000)이 주어진다.','3','1부터 n까지 합을 출력한다.','6',14,'fn main() {\n\n}',NULL,0),(9,'첫째 줄에는 별 1개, 둘째 줄에는 별 2개, N번째 줄에는 별 N개를 찍는 문제','첫째 줄에 N(1 ≤ N ≤ 10)이 주어진다.','3','첫째 줄부터 N번째 줄까지 차례대로 별을 출력한다.','*\n**\n***\n',15,'use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input)\n        .expect(\"WRONG_INPUT\");\n    let n: i32 = input.trim().parse().unwrap();\n    \n    for i in 1..(n + 1) {\n        for _ in 1..(i + 1) {\n            print!(\"*\");\n        }\n        println!();\n    }\n}',NULL,0),(10,'두 정수 A와 B를 입력받은 다음, A+B를 출력하는 프로그램을 작성하시오.','입력은 여러 개의 테스트 케이스로 이루어져 있다.\n\n각 테스트 케이스는 한 줄로 이루어져 있으며, 각 줄에 A와 B가 주어진다. (0 < A, B < 10)\n\n입력의 마지막에는 0 두 개가 들어온다.','1 1\n2 3\n3 4\n9 8\n5 2\n0 0','각 테스트 케이스마다 A+B를 출력한다.','2\n5\n7\n17\n7',16,'fn main() {\n\n}',NULL,0),(11,'N개의 정수가 주어진다. 이때, 최솟값과 최댓값을 구하는 프로그램을 작성하시오.','첫째 줄에 정수의 개수 N (1 ≤ N ≤ 1,000,000)이 주어진다. 둘째 줄에는 N개의 정수를 공백으로 구분해서 주어진다. 모든 정수는 -1,000,000보다 크거나 같고, 1,000,000보다 작거나 같은 정수이다.','5\n20 10 35 30 7','첫째 줄에 주어진 정수 N개의 최솟값과 최댓값을 공백으로 구분해 출력한다.','7 35',17,'use std::io::Read;\n\nfn main() {\n    let mut line = String::new();\n    std::io::stdin().read_to_string(&mut line).unwrap();\n\n    let (mut min, mut max): (i32, i32) = (1_000_000, -1_000_000);\n\n    line.split_whitespace()\n        .skip(1)\n        .map(|i| i.parse::<i32>().unwrap())\n        .for_each(|i| {\n            if i < min {\n                min = i;\n            }\n            if i > max {\n                max = i;\n            }\n        });\n\n    println!(\"{} {}\", min, max);\n}',NULL,0),(12,'두 자연수 A와 B가 있을 때, A%B는 A를 B로 나눈 나머지 이다. 예를 들어, 7, 14, 27, 38을 3으로 나눈 나머지는 1, 2, 0, 2이다. \n\n수 5개를 입력받은 뒤, 이를 42로 나눈 나머지를 구한다. 그 다음 서로 다른 값이 몇 개 있는지 출력하는 프로그램을 작성하시오.','첫째 줄부터 다섯번째 줄 까지 숫자가 한 줄에 하나씩 주어진다. 이 숫자는 1,000보다 작거나 같고, 음이 아닌 정수이다.','1\n2\n3\n4\n5','첫째 줄에, 42로 나누었을 때, 서로 다른 나머지가 몇 개 있는지 출력한다.','5',18,'fn main() {\n\n}',NULL,0),(13,'알파벳 소문자, 대문자, 숫자 0-9중 하나가 주어졌을 때, 주어진 글자의 아스키 코드값을 출력하는 프로그램을 작성하시오.','알파벳 소문자, 대문자, 숫자 0-9 중 하나가 첫째 줄에 주어진다.','A','입력으로 주어진 글자의 아스키 코드 값을 출력한다.','65',19,'use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n\n    let buffer = input.trim();\n\n    println!(\"{:?}\", buffer.as_bytes()[0]);\n}',NULL,0),(14,'N개의 숫자가 공백 없이 쓰여있다. 이 숫자를 모두 합해서 출력하는 프로그램을 작성하시오.','첫째 줄에 숫자의 개수 N (1 ≤ N ≤ 100)이 주어진다. 둘째 줄에 숫자 N개가 공백없이 주어진다.','5\n12345','입력으로 주어진 숫자 N개의 합을 출력한다.','15',20,'fn main() {\n\n}',NULL,0),(15,'알파벳 대소문자로 된 단어가 주어지면, 이 단어에서 가장 많이 사용된 알파벳이 무엇인지 알아내는 프로그램을 작성하시오. 단, 대문자와 소문자를 구분하지 않는다.','첫째 줄에 알파벳 대소문자로 이루어진 단어가 주어진다. 주어지는 단어의 길이는 1,000,000을 넘지 않는다.','Mississipi','첫째 줄에 이 단어에서 가장 많이 사용된 알파벳을 대문자로 출력한다. 단, 가장 많이 사용된 알파벳이 여러 개 존재하는 경우에는 ?를 출력한다.','?',21,'use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n    let input = input.trim().bytes();\n\n    let mut alphabet = [0; 26];\n\n    for i in input {\n        alphabet[((i | 32) - b\'a\') as usize] += 1;\n    }\n\n    let max_pos = alphabet.iter().position(|c| c == alphabet.iter().max().unwrap()).unwrap();\n    let max_num = alphabet[max_pos];\n    let max_count = alphabet.iter().filter(|&&x| x == max_num).count();\n\n    if max_count != 1 {\n        println!(\"?\");\n    } else {\n        println!(\"{}\", (max_pos as u8 + b\'A\') as char);\n    }\n}',NULL,0),(16,'상근이의 동생 상수는 수학을 정말 못한다. 상수는 숫자를 읽는데 문제가 있다. 이렇게 수학을 못하는 상수를 위해서 상근이는 수의 크기를 비교하는 문제를 내주었다. 상근이는 세 자리 수 두 개를 칠판에 써주었다. 그 다음에 크기가 큰 수를 말해보라고 했다.\n\n상수는 수를 다른 사람과 다르게 거꾸로 읽는다. 예를 들어, 734와 893을 칠판에 적었다면, 상수는 이 수를 437과 398로 읽는다. 따라서, 상수는 두 수중 큰 수인 437을 큰 수라고 말할 것이다.\n\n두 수가 주어졌을 때, 상수의 대답을 출력하는 프로그램을 작성하시오.','첫째 줄에 상근이가 칠판에 적은 두 수 A와 B가 주어진다. 두 수는 같지 않은 세 자리 수이며, 0이 포함되어 있지 않다.','734 893','첫째 줄에 상수의 대답을 출력한다.','437',22,'fn main() {\n\n}',NULL,0),(17,'알파벳으로만 이루어진 단어를 입력받아, 그 길이를 출력하는 프로그램을 작성하시오.','첫째 줄에 영어 소문자와 대문자로만 이루어진 단어가 주어진다. 단어의 길이는 최대 100이다.','pulljima','첫째 줄에 입력으로 주어진 단어의 길이를 출력한다.','8',23,'fn main() {\n\n}',NULL,0),(19,'배열을 정렬하는 것은 쉽다. 수가 주어지면, 그 수의 각 자리수를 내림차순으로 정렬해보자.','첫째 줄에 정렬하려고 하는 수 N이 주어진다. N은 1,000,000,000보다 작거나 같은 자연수이다.','2143','첫째 줄에 자리수를 내림차순으로 정렬한 수를 출력한다.','4321',28,'use std::io;\n\nfn main() {\n	let mut input = String::new();\n	io::stdin().read_line(&mut input).unwrap();\n	let mut str: Vec<_> = input.trim_end().chars().collect();\n\n	str.sort_by(|a, b| b.cmp(a));\n\n	println!(\"{}\", str.iter().collect::<String>());\n}',NULL,0),(20,'알파벳 소문자와 대문자로만 이루어진 길이가 N인 단어가 주어진다.\n\n한 줄에 10글자씩 끊어서 출력하는 프로그램을 작성하시오.','첫째 줄에 단어가 주어진다. 단어는 알파벳 소문자와 대문자로만 이루어져 있으며, 길이는 100을 넘지 않는다. 길이가 0인 단어는 주어지지 않는다.','BaekjoonOnlineJudge','입력으로 주어진 단어를 열 개씩 끊어서 한 줄에 하나씩 출력한다. 단어의 길이가 10의 배수가 아닌 경우에는 마지막 줄에는 10개 미만의 글자만 출력할 수도 있다.','BaekjoonOn\nlineJudge',29,'fn main() {\n\n}',NULL,0),(21,'어떤 단어를 뒤에서부터 읽어도 똑같다면 그 단어를 팰린드롬이라고 한다. \'radar\', \'sees\'는 팰린드롬이다.\n\n수도 팰린드롬으로 취급할 수 있다. 수의 숫자들을 뒤에서부터 읽어도 같다면 그 수는 팰린드롬수다. 121, 12421 등은 팰린드롬수다. 123, 1231은 뒤에서부터 읽으면 다르므로 팰린드롬수가 아니다. 또한 10도 팰린드롬수가 아닌데, 앞에 무의미한 0이 올 수 있다면 010이 되어 팰린드롬수로 취급할 수도 있지만, 특별히 이번 문제에서는 무의미한 0이 앞에 올 수 없다고 하자.','입력은 여러 개의 테스트 케이스로 이루어져 있으며, 각 줄마다 1 이상 99999 이하의 정수가 주어진다. 입력의 마지막 줄에는 0이 주어지며, 이 줄은 문제에 포함되지 않는다.','121\n1231\n12421\n0','각 줄마다 주어진 수가 팰린드롬수면 \'yes\', 아니면 \'no\'를 출력한다.','yes\nno\nyes',30,'use std::io::{self, Read};\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_to_string(&mut input).unwrap();\n    for line in input.lines() {\n        if line == \"0\" {return}\n        if (line.chars()).eq(line.chars().rev()) {\n            println!(\"yes\");\n        } else {\n            println!(\"no\");\n        }\n    }\n}',NULL,0),(22,'2019 HEPC - MAVEN League의 \"비밀번호 만들기\"와 같은 방식으로 비밀번호를 만든 경민이는 한 가지 문제점을 발견하였다. 비밀번호가 랜덤으로 만들어져서 기억을 못 한다는 것이었다! 그래서 경민이는 메모장에 사이트의 주소와 비밀번호를 저장해두기로 했다. 하지만 컴맹인 경민이는 메모장에서 찾기 기능을 활용하지 못하고 직접 눈으로 사이트의 주소와 비밀번호를 찾았다. 메모장에 저장된 사이트의 수가 늘어나면서 경민이는 비밀번호를 찾는 일에 시간을 너무 많이 쓰게 되었다. 이를 딱하게 여긴 문석이는 경민이를 위해 메모장에서 비밀번호를 찾는 프로그램을 만들기로 결심하였다! 문석이를 도와 경민이의 메모장에서 비밀번호를 찾아주는 프로그램을 만들어보자.','첫째 줄에 저장된 사이트 주소의 수 N(1 ≤ N ≤ 100,000)과 비밀번호를 찾으려는 사이트 주소의 수 M(1 ≤ M ≤ 100,000)이 주어진다.\n\n두번째 줄부터 N개의 줄에 걸쳐 각 줄에 사이트 주소와 비밀번호가 공백으로 구분되어 주어진다. 사이트 주소는 알파벳 소문자, 알파벳 대문자, 대시(\'-\'), 마침표(\'.\')로 이루어져 있고, 중복되지 않는다. 비밀번호는 알파벳 대문자로만 이루어져 있다. 모두 길이는 최대 20자이다.\n\nN+2번째 줄부터 M개의 줄에 걸쳐 비밀번호를 찾으려는 사이트 주소가 한줄에 하나씩 입력된다. 이때, 반드시 이미 저장된 사이트 주소가 입력된다.','5 3\nnoj.am IU\nacmicpc.net UAENA\nstartlink.io THEKINGOD\ngoogle.com ZEZE\nnate.com VOICEMAIL\nstartlink.io\ngoogle.com\nnate.com','첫 번째 줄부터 M개의 줄에 걸쳐 비밀번호를 찾으려는 사이트 주소의 비밀번호를 차례대로 각 줄에 하나씩 출력한다.','THEKINGOD\nZEZE\nVOICEMAIL',32,'use std::collections::HashMap;\nuse std::io::{self, Read};\n\nfn main() {\n    let mut buf = String::with_capacity(42 * 100_000);\n    io::stdin().read_to_string(&mut buf).unwrap();\n    let mut buf = buf.split_whitespace();\n\n    let n: usize = buf.next().unwrap().parse().unwrap();\n    let m: usize = buf.next().unwrap().parse().unwrap();\n\n    let mut passwds = HashMap::with_capacity(n);\n\n    for _ in 0..n {\n        passwds.insert(buf.next().unwrap(), buf.next().unwrap());\n    }\n\n    let mut out = String::with_capacity(21 * m);\n    for address in buf {\n        out.push_str(passwds.get(address).unwrap());\n        out.push(\'\\n\');\n    }\n\n    print!(\"{}\", out);\n}',NULL,0),(23,'실수(float) 1개를 입력받아 저장한 후,\n저장되어 있는 값을 소수점 셋 째 자리에서 반올림하여\n소수점 이하 둘 째 자리까지 출력하시오.','실수 1개가 입력된다.','1.59254','결과를 소수점 셋 째 자리에서 반올림 해, 소숫점 이하 둘째 자리까지 출력한다.','1.59',33,'use std::io;\n\nfn main() {\n    let mut input_text = String::new();\n    io::stdin()\n        .read_line(&mut input_text)\n        .expect(\"failed to read from stdin\");\n\n    let trimmed = input_text.trim();\n    match trimmed.parse::<f32>() {\n        Ok(f) => println!(\"{:.2}\", f),\n        Err(..) => println!(\"this was not an float: {}\", trimmed),\n    };\n}',NULL,0),(24,'어떤 형식에 맞추어 시간이 입력될 때, 그대로 출력하는 연습을 해보자.','시(hour)와 분(minute)이 \":\" 으로 구분되어 입력된다.','입력받은 시간을 \"시:분\" 형식으로 출력한다.','3:16','3:16',34,'use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin()\n        .read_line(&mut input)\n        .expect(\"failed to read from stdin\");\n\n    println!(\"{}\", input)\n}',NULL,0),(25,'정수 3개를 입력받아 합과 평균을 출력해보자.\n단, -2147483648 ~ +2147483647','정수 3개가 공백을 두고 입력된다.\n단, -2147483648 ~ +2147483647','합과 평균을 줄을 바꿔 출력한다.\n평균은 소수점 이하 둘째 자리에서 반올림해서 소수점 이하 첫째 자리까지 출력한다.\n','1 2 3','6\n2.0',35,'fn main() {\n\n}',NULL,0),(26,'세 정수 a, b, c가 입력되었을 때, 짝(even)/홀(odd)을 출력해보자.','세 정수 a, b, c 가 공백을 두고 입력된다.\n0 <= a, b, c <= +2147483647','1 2 8','입력된 순서대로 짝(even)/홀(odd)을 줄을 바꿔 출력한다.','odd\neven\neven',36,'fn main() {\n\n}',NULL,0),(27,'인학이는 숫자 7을 좋아한다.\n\n어떤 정수가 입력되면 그 수가 7의 배수인지 확인하시오.','자연수가 입력된다.','9','7의 배수일 경우 multiple를 출력하고, 7의 배수가 아니면 not multiple을 출력하시오.','not multiple',37,'fn main() {\n\n}',NULL,0),(28,'주원이는 월, 수, 금, 일 아르바이트를 간다.\n요일의 번호가 입력으로 주어지면 그 날이 아르바이트 가는 날이면 \"oh my god\"를 가는 날이 아니면 \"enjoy\"를 출력하시오.','입력으로 요일이 주어진다.','월',' 아르바이트 가는 날이면 \"oh my god\"를 가는 날이 아니면 \"enjoy\"를 출력하시오.','oh my god',38,'use std::io;\n\nfn main() {\n  let mut input = String::new();\n  io::stdin().read_line(&mut input).unwrap();\n\n  let day = match input.as_str() {\n    \"월\" | \"수\" | \"금\" | \"일\" => \"oh my god\",\n    \"화\" | \"목\" | \"토\" => \"enjoy\",\n    _ => \"out of range\",\n  };\n  \n  println!(\"{}\", day);\n}',NULL,0),(29,'태어난 해, 월, 일을 입력받아 사주팔자를 보는 프로그램을 작성하시오.\n\n사주를 보는 방법)\n\n세 수(년,월,일)가 주어지면,  (년 - 월 + 일)에 마지막 숫자가 0이면 \"대박\"을 출력, 그렇지 않으면 \"그럭저럭\"을 출력하세요.','세 정수가 입력으로 주어진다. 순서대로 년도, 월, 일 이다.','1902 2 10','년도 - 월 + 일의 마지막 숫자가 0이면 \"대박\"을 , 그렇지 않으면 \"그럭저럭\"을 출력하시오.','대박',39,'fn main() {\n\n}',NULL,0),(30,'지금 1반과 2반이 축구를 하고있다.\n\n축구경기 타임은 총 90분이고,\n\n현재 1반이 0점, 2반이 2점인 상황에서, 1반은 경남정보고 최고의 스트라이커인 성익이를 투입하기로 결정했다.\n\n성익이는 5분마다 골을 넣을 수 있는 능력을 가지고 있다.\n\n만약 80분에 투입이 되면 80분에 곧바로 골을 넣게되고 85분에 골을 넣음으로서 동점이 가능하게 된다.\n\n(90분이되면 경기가 바로 종료되므로 골을 넣을 수 없다. 동내심판인 성빈이는 성익이가 잘 되는 것을 싫어하기 때문에 추가시간 따위는 주지 않는다. )\n\n현재 경기타임과 우리팀의 득점이 입력으로 주어 질때, 성익이를 투입하면 우리팀의 최종 득점은 몇 점인지 출력하시오.','현재 경기시간과 우리팀의 득점이 입력으로 주어진다.(정수)','74 2','경기가 끝났을때 우리팀의 득점을 출력한다.','6',40,'fn main() {\n\n}',NULL,0);
