INSERT INTO `ExerciseTry` VALUES (1,'2022-08-23 20:00:39.430000','FAIL','fn main() {\n println!(\"Hello Hi!\")\n}',1,'hdm',0),(2,'2022-08-31 17:24:29.996000','SOLVE','',1,'hgcho',0),(3,'2022-08-31 18:17:34.723000','SOLVE','use std::io;\n\nfn main() {\n    let mut line = String::new();\n    io::stdin().read_line(&mut line).unwrap();\n    println!(\n        \"{}\",\n        line.split_whitespace()\n            .map(|word| word.parse::<i32>())\n            .sum::<Result<i32, _>>()\n            .unwrap()\n    );\n}',2,'jmj',4),(4,'2022-08-31 18:17:58.128000','FAIL','fn main() {\n println!(\"Hello Hi!\")\n}',1,'jmj',14),(5,'2022-09-23 20:57:56.316000','SOLVE','fn main() {\n    let mut inp = String::new();\n    std::io::stdin().read_line(&mut inp).unwrap();\n    let parts: Vec<i32> = inp.split(\' \').map(|x| x.trim().parse().unwrap()).collect();\n    if parts[0] == parts[1] {\n        println!(\"==\")\n    }\n    else if parts[0] < parts[1]{\n        println!(\"<\")\n    }\n    else {\n        println!(\">\")\n    }\n}',4,'jmj',14),(6,'2022-09-24 12:50:10.954000','SOLVE','use std::io;\n\nfn main() {\n    let mut input_text = String::new();\n    io::stdin()\n        .read_line(&mut input_text)\n        .expect(\"failed to read from stdin\");\n\n    let trimmed = input_text.trim();\n    match trimmed.parse::<f32>() {\n        Ok(f) => println!(\"{:.2}\", f),\n        Err(..) => println!(\"this was not an float: {}\", trimmed),\n    };\n}',33,'hdm',0),(7,'2022-09-24 13:58:07.000000','SOLVE','use std::io;\n\nfn main() {\n    let mut input_text = String::new();\n    io::stdin()\n        .read_line(&mut input_text)\n        .expect(\"failed to read from stdin\");\n\n    let trimmed = input_text.trim();\n    match trimmed.parse::<f32>() {\n        Ok(f) => println!(\"{:.2}\", f),\n        Err(..) => println!(\"this was not an float: {}\", trimmed),\n    };\n}',33,'jmj',0),(8,'2022-09-24 13:59:10.538000','SOLVE','use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin()\n        .read_line(&mut input)\n        .expect(\"failed to read from stdin\");\n\n    println!(\"{}\", input)\n}',34,'jmj',0),(9,'2022-09-24 14:00:08.229000','SOLVE','use std::io::Read;\n\nfn main() {\n    let mut line = String::new();\n    std::io::stdin().read_to_string(&mut line).unwrap();\n\n    let (mut min, mut max): (i32, i32) = (1_000_000, -1_000_000);\n\n    line.split_whitespace()\n        .skip(1)\n        .map(|i| i.parse::<i32>().unwrap())\n        .for_each(|i| {\n            if i < min {\n                min = i;\n            }\n            if i > max {\n                max = i;\n            }\n        });\n\n    println!(\"{} {}\", min, max);\n}',17,'jmj',6),(10,'2022-09-24 14:00:26.086000','SOLVE','use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n    \n    let score: i32 = input.trim().parse().unwrap();\n    \n    let grade: &\'static str = match score / 10 {\n        9 | 10 => \"A\",\n        8 => \"B\",\n        7 => \"C\",\n        6 => \"D\",\n        _ => \"F\",\n    };\n    \n    println!(\"{}\", grade);\n}',5,'jmj',0),(11,'2022-09-24 15:40:20.349000','SOLVE','use std::io;\n\nfn main() {\n  let mut input = String::new();\n  io::stdin().read_line(&mut input).unwrap();\n\n  let day = match input.as_str() {\n    \"월\" | \"수\" | \"금\" | \"일\" => \"oh my god\",\n    \"화\" | \"목\" | \"토\" => \"enjoy\",\n    _ => \"out of range\",\n  };\n  \n  println!(\"{}\", day);\n}',38,'jmj',0),(12,'2022-09-24 15:48:46.835000','SOLVE','use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n    let number = input.trim().parse::<i32>().unwrap();\n\n    for i in 1..10 {\n        println!(\"{} * {} = {}\", number, i, number * i);\n    }\n}',13,'jmj',0),(13,'2022-09-24 15:54:05.138000','SOLVE','use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input)\n        .expect(\"WRONG_INPUT\");\n    let n: i32 = input.trim().parse().unwrap();\n    \n    for i in 1..(n + 1) {\n        for _ in 1..(i + 1) {\n            print!(\"*\");\n        }\n        println!();\n    }\n}',15,'jmj',0),(14,'2022-09-24 16:01:29.547000','SOLVE','use std::collections::HashMap;\nuse std::io::{self, Read};\n\nfn main() {\n    let mut buf = String::with_capacity(42 * 100_000);\n    io::stdin().read_to_string(&mut buf).unwrap();\n    let mut buf = buf.split_whitespace();\n\n    let n: usize = buf.next().unwrap().parse().unwrap();\n    let m: usize = buf.next().unwrap().parse().unwrap();\n\n    let mut passwds = HashMap::with_capacity(n);\n\n    for _ in 0..n {\n        passwds.insert(buf.next().unwrap(), buf.next().unwrap());\n    }\n\n    let mut out = String::with_capacity(21 * m);\n    for address in buf {\n        out.push_str(passwds.get(address).unwrap());\n        out.push(\'\\n\');\n    }\n\n    print!(\"{}\", out);\n}',32,'jmj',0),(15,'2022-09-24 16:35:19.748000','SOLVE','fn main() {\n    let stdin = std::io::stdin();\n    let mut buf = String::new();\n    stdin.read_line(&mut buf).unwrap();\n\n    let input = buf.trim();\n\n    println!(\"{:?}\", input.as_bytes()[0]);\n}',19,'jmj',0),(16,'2022-09-24 16:46:20.688000','SOLVE','use std::io;\n\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_line(&mut input).unwrap();\n    let input = input.trim().bytes();\n\n    let mut alphabet = [0; 26];\n\n    for i in input {\n        alphabet[((i | 32) - b\'a\') as usize] += 1;\n    }\n\n    let max_pos = alphabet.iter().position(|c| c == alphabet.iter().max().unwrap()).unwrap();\n    let max_num = alphabet[max_pos];\n    let max_count = alphabet.iter().filter(|&&x| x == max_num).count();\n\n    if max_count != 1 {\n        println!(\"?\");\n    } else {\n        println!(\"{}\", (max_pos as u8 + b\'A\') as char);\n    }\n}',21,'jmj',0),(17,'2022-09-24 17:05:12.838000','SOLVE','use std::io;\n\nfn main() {\n	let mut input = String::new();\n	io::stdin().read_line(&mut input).unwrap();\n	let mut str: Vec<_> = input.trim_end().chars().collect();\n\n	str.sort_by(|a, b| b.cmp(a));\n\n	println!(\"{}\", str.iter().collect::<String>());\n}',28,'jmj',0),(18,'2022-09-24 17:07:36.008000','SOLVE','use std::io::{self, Read};\nfn main() {\n    let mut input = String::new();\n    io::stdin().read_to_string(&mut input).unwrap();\n    for line in input.lines() {\n        if line == \"0\" {return}\n        if (line.chars()).eq(line.chars().rev()) {\n            println!(\"yes\");\n        } else {\n            println!(\"no\");\n        }\n    }\n}',30,'jmj',0),(23,'2022-09-28 15:23:57.320000','SOLVE','fn main() {\n    let mut inp = String::new();\n    std::io::stdin().read_line(&mut inp).unwrap();\n    let parts: Vec<i32> = inp.split(\' \').map(|x| x.trim().parse().unwrap()).collect();\n    if parts[0] == parts[1] {\n        println!(\"==\")\n    }\n    else if parts[0] < parts[1]{\n        println!(\"<\")\n    }\n    else {\n        println!(\">\")\n    }\n}',4,'hgcho',5),(24,'2022-09-28 15:24:16.677000','FAIL','fn main() {\n\n}',12,'hgcho',0),(25,'2022-09-29 17:17:01.457000','FAIL','fn main() {\n println!(\"Hello H!\")\n}',1,'admin',0),(26,'2022-09-29 17:17:18.269000','FAIL','fn main() {\n\n}',16,'admin',0),(27,'2022-09-30 14:27:45.071000','FAIL','use std::io::Read;\n\nfn main() {\n    let mut line = String::new();\n    std::io::stdin().read_to_string(&mut line).unwrap();\n\n    let (mut min, mut max): (i32, i32) = (1_000_000, -1_000_000);\n\n    line.split_whitespace()\n        .skip(1)\n        .map(|i| i.parse::<i32>().unwrap())\n        .for_each(|i| {\n            if i > min {\n                min = i;\n            }\n            if i < max {\n                max = i;\n            }\n        });\n\n    println!(\"{} {}\", min, max);\n}',17,'hdm',6),(28,'2022-10-04 20:57:42.815000','SOLVE','use std::io;\n\nfn main() {\n    let mut line = String::new();\n    io::stdin().read_line(&mut line).unwrap();\n    println!(\n        \"{}\",\n        line.split_whitespace()\n            .map(|word| word.parse::<i32>())\n            .sum::<Result<i32, _>>()\n            .unwrap()\n    );\n}',2,'hdm',12),(29,'2022-10-06 07:13:50.916000','FAIL','fn main() {\n\n}',3,'hdm',0),(30,'2022-10-11 19:06:54.461000','FAIL','fn main() {\n println!(\"Hello Hi!\")\n}',1,'pay7845',5),(32,'2022-10-14 19:52:25.341000','FAIL','fn main() {\n println!(\"Hello Hi!\")\n}',1,'ehddud1006',0);
