INSERT INTO `Reference` VALUES (1,'모든 프로그래머들은 되도록 이해하기 쉽게 이해되는 코드를 작성하기 위해 노력하지만, 자주 부연 설명이 필요합니다. 이런 경우, 프로그래머들은 메모를 남기거나 소스코드에 컴파일러는 무시하도록 되어 있는 *주석* 을 남겨 소스코드를 읽는 사람이 혜택을 받을 수 있게 합니다.\n\n여기에 간단한 주석이 있습니다:\n\n```text\n\n// Hello, world.\n\n```\n\nRust에서 주석은 두개의 슬래쉬로 시작해야 하고 해당 줄의 끝까지 계속됩니다. 한 줄을 넘는 주석을 작성할 경우, `//`를 각 줄에 포함시켜 사용하면 됩니다, 이런 식으로요:\n\n```text\n\n// 우리는 여기에 뭔가 복잡한 것을 적어놓고자 하는데, 그를 위해 충분히 긴 여러 줄의 주석이 필요합니다.\n// 휴! 다행입니다.\n// 이 주석은 그에 대해 설명할테니까요.\n\n```\n\n주석은 코드의 뒷 부분에 위치할 수도 있습니다:\n\nFilename: src/main.rs\n\n```rust\n\nfn main() {\n    let lucky_number = 7; // I’m feeling lucky today.\n}\n\n```\n\n하지만 주석을 코드와 나눠 앞 줄에 기재되는 형식을 더 자주 보게 될 겁니다.\n\nFilename: src/main.rs\n\n```rust\n\nfn main() {\n    // I’m feeling lucky today.\n    let lucky_number = 7;\n}\n```','2022-08-30 12:10:40.146000','Comments(주석)',1),(2,'기본 변수는 *불변성*입니다. 이것은 Rust가 제공하는 안전성과 손쉬운 동시성이라는 장점을 취할 수 있도록 코드를 작성하게끔 강제하는 요소 중 하나입니다. 하지만 여전히 당신은 가변 변수를 사용하고 싶을테죠. 어떻게 그리고 왜 Rust에서 불변성을 애호해주길 권장하는지 알아보면 그런 생각을 포기할 수 있을지도 모르겠습니다.\n\n변수가 불변성인 경우, 일단 값이 이름에 bound되면 해당 값을 변경할 수 없습니다. 시험 삼아 다음과 같이 코드를 작성해봅시다.\n\n```rust\n\nfn main() {\n    let x = 5;\n    println!(\"The value of x is: {}\", x);\n    x = 6;\n    println!(\"The value of x is: {}\", x);\n}\n\n```\n\n해당 코드를 실행시켜 봅시다. 당신은 다음과 같이 출력되는 에러를 확인하게 될 겁니다.\n\n```text\n\nerror[E0384]: re-assignment of immutable variable `x`\n --> src/main.rs:4:5\n  |\n2 |     let x = 5;\n  |         - first assignment to `x`\n3 |     println!(\"The value of x is: {}\", x);\n4 |     x = 6;\n  |     ^^^^^ re-assignment of immutable variable\n\n```\n\n위의 예제는 컴파일러가 당신이 만든 프로그램에서 당신을 도와 에러를 찾아주는 방법에 대해 보여주고 있습니다. 컴파일러 에러가 힘빠지게 만들 수도 있지만, 단지 당신의 프로그램이 아직 안전하게 수행되긴 미흡하다는 뜻이지, 당신의 소양이 부족함을 의미하는 건 아닙니다. 숙련된 Rustacean들도 여전히 에러를 발생시키니까요. 에러가 나타내는 것은 `불변성 변수에 재할당`이고, 원인은 우리가 불변성 변수 `x`에 두 번째로 값을 할당했기 때문입니다.\n\n우리가 이전에 불변성으로 선언한 것의 값을 변경하고자 하는 시도를 하면 컴파일 타임의 에러를 얻게 되고 이로 인해 버그가 발생할 수 있기 때문에 중요합니다. 만약 우리 코드의 일부는 값이 변경되지 않는다는 것을 가정하는데 다른 코드는 이와 다르게 값을 변경한다면, 전자에 해당하는 코드는 우리가 의도한 대로 수행되지 않을 수 있습니다. 특히 후자에 해당되는 코드가 항상 그렇지 않고 *가끔* 값을 변경하는 경우 나중에 버그의 원인을 추적하기가 매우 어렵습니다.\n\nRust에서는 컴파일러가 변경되지 않은 값에 대한 보증을 해주고, 실제로 이는 바뀌지 않습니다. 이것이 의미하는 바는 당신이 코드를 작성하거나 분석할 시에 변수의 값이 어떻게 변경되는지 추적할 필요가 없기 때문에 코드를 더 합리적으로 만들어줍니다.\n\n하지만 가변성은 매우 유용하게 사용될 수 있습니다. 변수는 기본적으로 불변성이지만 우리는 변수명의 접두어로 `mut`을 추가하는 것을 통해 가변성 변수를 선언할 수 있습니다. 이 변수의 값이 변경을 허용하는 것에 추가로 향후 코드를 보는 사람에게 코드의 다른 부분에서 해당 변수의 값을 변경할 것이라는 의도를 주지시킵니다.\n\n예를 들어, 위의 코드를 다음과 같이 변경해보도록 합니다.\n\n```rust\n\nfn main() {\n    let mut x = 5;\n    println!(\"The value of x is: {}\", x);\n    x = 6;\n    println!(\"The value of x is: {}\", x);\n}\n\n```\n\n위의 프로그램을 수행하면 다음과 같은 결과를 얻게 됩니다:\n\n```text\n\n$ cargo run\n   Compiling variables v0.1.0 (file:///projects/variables)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.30 secs\n     Running `target/debug/variables`\nThe value of x is: 5\nThe value of x is: 6\n\n```\n\n`mut`를 사용하여, `x`에 bind된 값을 `5`에서 `6`으로 변경할 수 있습니다. 불변성 변수만을 사용하는 것보다 가변성 변수를 사용하여 보다 쉽게 구현할 수 있을 경우 가변성 변수를 만들어 사용할 수도 있습니다.\n\n이런 의사 결정에 있어서 버그를 예방하는 것 외에도 고려해야 할 요소들이 있습니다. 예를 들어, 대규모 데이터 구조체를 다루는 경우 가변한 인스턴스를 사용하는 것이 새로 인스턴스를 할당하고 반환하는 것보다 빠를 수 있습니다. 데이터 규모가 작을수록 새 인스턴스를 생성하고 함수적 프로그래밍 스타일로 작성하는 것이 더 합리적이고, 그렇기에 약간의 성능 하락을 통해 가독성을 확보할 수 있다면 더 가치있는 선택입니다.\n\n### [변수와 상수 간의 차이점들](https://rinthel.github.io/rust-lang-book-ko/ch03-01-variables-and-mutability.html#%EB%B3%80%EC%88%98%EC%99%80-%EC%83%81%EC%88%98-%EA%B0%84%EC%9D%98-%EC%B0%A8%EC%9D%B4%EC%A0%90%EB%93%A4)\n\n변수의 값을 변경할 수 없다는 사항이 아마 당신에게 다른 언어가 가진 프로그래밍 개념을 떠오르게 하지 않나요: *상수* 불변성 변수와 마찬가지로 상수 또한 이름으로 bound된 후에는 값의 변경이 허용되지 않지만, 상수와 변수는 조금 다릅니다.\n\n첫 째로, 상수에 대해서는 `mut`을 사용하는 것이 허용되지 않습니다: 상수는 기본 설정이 불변성인 것이 아니고 불변성 그 자체입니다.\n\n우리가 상수를 사용하고자 하면 `let`키워드 대신 `const`키워드를 사용해야 하고, 값의 유형을 선언해야 합니다. 우리가 사용할 수 있는 유형들과 유형의 선언을 챕터 “Data Types,”에서 다루게 될 것이므로 자세한 사항은 지금 걱정하지 말고, 우리는 반드시 값의 유형을 선언해야 한다는 것을 알고 지나갑시다.\n\n상수는 전체 영역을 포함하여 어떤 영역에서도 선언될 수 있습니다. 이는 코드의 많은 부분에서 사용될 필요가 있는 값을 다루는데 유용합니다.\n\n마지막 차이점은 상수는 오직 상수 표현식만 설정될 수 있지, 함수 호출의 결과값이나 그 외에 실행 시간에 결정되는 값이 설정될 수는 없다는 점입니다.\n\n아래의 `MAX_POINTS`라는 이름을 갖는 상수를 선언하는 예제에서는 값을 100,000으로 설정합니다. (Rust의 상수 명명 규칙에 따라 모든 단어를 대문자로 사용합니다.)\n\n```rust\n\nconst MAX_POINTS: u32 = 100_000;\n\n```\n\n상수는 자신이 선언되어 있는 영역 내에서 프로그램이 실행되는 시간 동안 항상 유효하기에, 당신의 어플리케이션 도메인 전체에 걸쳐 프로그램의 다양한 곳에서 사용되는 값을 상수로 하면 유용합니다. 사용자가 한 게임에서 획득할 수 있는 최대 포인트, 빛의 속도 같은 값 등등...\n\n당신의 프로그램 전체에 걸쳐 하드코드 해야 하는 값을 이름지어 상수로 사용하면 향후 코드를 유지보수 하게 될 사람에게 그 의미를 전달할 수 있으므로 유용합니다. 또한 향후 해당 값을 변경해야 하는 경우에 상수로 선언된 값 한 곳만 변경하면 되므로 도움이 될 겁니다.\n\n### [Shadowing](https://rinthel.github.io/rust-lang-book-ko/ch03-01-variables-and-mutability.html#shadowing)\n\n이전에 선언한 변수와 같은 이름의 새 변수를 선언할 수 있고, 새 변수는 이전 변수를 *shadows*하게 됩니다. Rustaceans들은 이를 첫 변수가 두 번째에 의해 *shadowed* 됐다고 표현하게 됩니다. 해당 변수명은 두 번째 변수의 값을 갖게 된다는 뜻이죠. `let`키워드를 사용해서 다음처럼 반복하여 같은 변수명으로 변수를 shadow 할 수 있습니다.\n\n\n```rust\n\nfn main() {\n    let x = 5;\n\n    let x = x + 1;\n\n    let x = x * 2;\n\n    println!(\"The value of x is: {}\", x);\n}\n\n```\n\n이 프로그램은 처음 `x`에 값 `5`를 bind 합니다. 이후 반복된 `let x =` 구문으로 `x`를 shadow하고 원본 값에 `1`을 더해서 `x`의 값은 `6`이 됩니다. 세 번째 `let` 문으로 또 `x`를 shadow하고, 이전 값에 `2`를 곱하여 `x`의 최종값은 `12`가 됩니다. 이 프로그램을 실행하면 다음과 같은 결과를 볼 수 있습니다.\n\n```text\n\n$ cargo run\n   Compiling variables v0.1.0 (file:///projects/variables)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/variables`\nThe value of x is: 12\n\n```\n\n이와 같은 사용은 변수를 `mut`으로 선언하는 것과는 차이가 있게 됩니다. 왜냐면 `let`키워드를 사용하지 않고 변수에 새로 값을 대입하려고 하면 컴파일-시에 에러를 얻게 되기 때문이죠. 우리가 몇 번 값을 변경할 수는 있지만 그 이후에 변수는 불변성을 갖게 됩니다.\n\n또 다른 `mut`과 shadowing의 차이는 `let`키워드를 다시 사용하여 효과적으로 새 변수를 선언하고, 값의 유형을 변경할 수 있으면서도 동일 이름을 사용할 수 있다는 점 입니다. 예를 들어, 공백 문자들을 입력받아 얼마나 많은 공백 문자가 있는지 보여주고자 할 때, 실제로는 저장하고자 하는 것은 공백의 개수일테죠.\n\n```rust\n\nlet spaces = \"   \";\nlet spaces = spaces.len();\n\n```\n\n이와 같은 구조가 허용되는 이유는 첫 `spaces` 변수가 문자열 유형이고 두 번째 `spaces` 변수는 첫 번째 것과 동일한 이름을 가진 새롭게 정의된 숫자 유형의 변수이기 때문입니다. Shadowing은 `space_str`이나 `space_num` 과 같이 대체된 이름을 사용하는 대신 간단히 `spaces` 이름을 사용할 수 있게 해줍니다. 그러나 우리가 `mut`을 사용하려고 했다면:\n\n```rust\n\nlet mut spaces = \"   \";\nspaces = spaces.len();\n\n```\n\n우리는 다음처럼 변수의 유형을 변경할 수 없다는 컴파일-시의 에러를 얻게 될 겁니다:\n\n```text\n\nerror[E0308]: mismatched types\n --> src/main.rs:3:14\n  |\n3 |     spaces = spaces.len();\n  |              ^^^^^^^^^^^^ expected &str, found usize\n  |\n  = note: expected type `&str`\n             found type `usize`\n\n```\n\n변수가 어떻게 동작하는지 탐구했으니, 더 많은 데이터 유형을 살펴보도록 합시다.','2022-09-05 12:17:09.180000','변수와 가변성',2),(3,'함수는 Rust에 녹아들어 있습니다. 여러분은 이미 언어에서 가장 중요하게 생각하는 `main`함수를 보셨습니다. 이는 다수의 프로그램에서 실행 지점입니다. 여러분은 또한 `fn` 키워드도 보셨을텐데, 이는 새로운 함수의 선언을 가능하게 합니다.\n\nRust 코드는 *뱀 형태*를 변수나 함수 이름의 형식 규칙으로 사용합니다. 뱀 형태에서, 모든 문자는 소문자를 사용하며 밑줄 표시로 단어를 구분합니다. 다음은 예제로 함수를 선언하는 프로그램입니다:\n\n```rust\n\nfn main() {\n    println!(\"Hello, world!\");\n\n    another_function();\n}\n\nfn another_function() {\n    println!(\"Another function.\");\n}\n\n```\n\nRust에서의 함수 선언은 `fn`으로 시작하며 함수 이름 뒤에 괄호의 형식으로 되어 있습니다. 중괄호는 컴파일러에게 함수의 시작과 종료 지점을 알려주게 됩니다.\n\n우리는 함수의 이름과 괄호 형식을 기입하는 것을 통해 우리가 선언했던 어떤 함수든 호출할 수 있습니다. `another_function`이 프로그램 내에 정의되어 있으므로, `main` 함수에서 해당 함수를 호출할 수 있습니다. 주의할 점은, 소스 코드 내에서 `another_function`이 `main` 함수 *뒤에* 정의했다는 점 입니다. 우리는 이를 `main` 함수 앞에도 정의할 수 있습니다. Rust는 당신의 함수의 위치를 신경쓰지 않습니다, 어디든 정의만 되어 있으면 됩니다.\n\n함수를 추가로 탐색하기 위해 *functions* 이라는 이름의 새로운 바이너리 프로젝트를 시작합시다. `another_function` 예제를 코드에 추가하고 실행해보세요. 다음과 같은 결과가 나타납니다:\n\n```text\n\n$ cargo run\n   Compiling functions v0.1.0 (file:///projects/functions)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.28 secs\n     Running `target/debug/functions`\nHello, world!\nAnother function.\n\n```\n\n`main` 함수 안의 내용이 줄의 순서대로 수행됩니다. 처음으로, \"Hello, world!\" 메시지가 출력되고, `another_function`이 호출되고 그의 메시지를 출력합니다.\n\n### 함수 매개변수\n\n함수는 함수 고유한 부분인 특별한 변수 *매개변수*를 갖는 형식으로 선언될 수 있습니다. 함수가 매개변수를 취할 때, 우리는 상수를 그들의 전달인자로 제공할 수 있습니다. 기술적으로, 여기서 전달되는 상수를 *전달인자*라고 부릅니다만, 사람들은 보통 “전달인자”와 “매개변수”를 혼용해서 사용하는 경향이 있습니다.\n\n다음의 재작성 된 `another_function`은 Rust에서 매개변수가 어떤 것인지 보여줍니다:\n\n```rust\n\nfn main() {\n    another_function(5);\n}\n\nfn another_function(x: i32) {\n    println!(\"The value of x is: {}\", x);\n}\n\n```\n\n이 프로그램을 실행해보시면 다음과 같은 결과가 출력되는 것을 보게 될 겁니다:\n\n```text\n\n$ cargo run\n   Compiling functions v0.1.0 (file:///projects/functions)\n    Finished dev [unoptimized + debuginfo] target(s) in 1.21 secs\n     Running `target/debug/functions`\nThe value of x is: 5\n\n```\n\n`another_function`의 선언은 `x`로 명명된 하나의 매개변수를 갖습니다. `x`의 타입은 `i32`로 정의됩니다. `5`가 `another_function`으로 전달되면, `println!` 매크로는 중괄호 짝으로 된 형식 문자열에 `5`를 전달합니다. 함수의 선언부에서, 여러분은 *반드시* 각 매개변수의 타입을 정의해야 합니다. 이 사항은 Rust를 설계하며 내린 신중한 결정사항입니다: 함수의 정의에 타입을 명시하여 코드 내 다른 부분에서 이들을 사용하는 것을 통해 당신의 의도를 추측하지 않아도 되게 됩니다.\n\n여러분의 함수에 여러 개의 매개변수를 사용하고 싶으면, 매개변수들을 다음처럼 쉼표와 함께 구분해서 사용할 수 있습니다:\n\n```rust\n\nfn main() {\n    another_function(5, 6);\n}\n\nfn another_function(x: i32, y: i32) {\n    println!(\"The value of x is: {}\", x);\n    println!(\"The value of y is: {}\", y);\n}\n\n```\n\n이 예제는 각각 `i32` 타입인 두 개의 매개변수를 갖는 함수를 생성합니다. 함수는 그의 두 매개변수의 값을 출력합니다. 주의할 점은, 함수 매개변수는 이번 예제처럼 굳이 같은 타입이 아니여도 된다는 점 입니다. 한번 코드를 실행해봅시다. 여러분의 *function* 프로젝트의 내용을 위의 예제로 변경한 뒤에, 수행시키면 됩니다:\n\n```text\n\n$ cargo run\n   Compiling functions v0.1.0 (file:///projects/functions)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/functions`\nThe value of x is: 5\nThe value of y is: 6\n\n```\n\n우리는 값 `5`와 `6`을 `x`와 `y`로 전달했기 때문에, 이 값들이 담긴 두 문장을 출력합니다.\n\n### 함수 본문\n\n함수 본문은 필요에 따라 표현식으로 종결되는 구문의 나열로 구성됩니다. 지금까지 우리는 종결 표현식이 없는 함수만 다뤘기에, 표현식이 구문의 일부처럼 여겨질지 모르겠습니다. Rust가 표현식에 기반한 언어기 때문에, 이것은 이해하셔야 하는 중요한 차이점 입니다. 다른 언어들은 이와 같은 차이가 없으니, 구문과 표현식이 함수의 본문에 어떤 식으로 차이나게 적용되는지 살펴보도록 하겠습니다.\n\n### 구문과 표현식\n\n사실 우리는 이미 구문과 표현식을 사용했습니다. *구문*은 어떤 명령들의 나열로 값을 반환하지 않는 어떤 동작을 수행 합니다. *표현식*은 결과 값을 산출해냅니다. 다음 몇 개의 예제를 살펴보도록 합시다. `let` 키워드를 통해 변수를 만들고 값을 할당하는 구문을 만듭니다. 항목 3-3의, `let y = 6;`은 구문입니다:\n\n```rust\n\nfn main() {\n    let y = 6;\n}\n\n```\n\n항목 3-3: 하나의 구문을 갖는 `main` 함수를 선언하였다.\n\n함수 정의는 또 하나의 구문입니다; 상기 예제는 자신 그 자체가 구문입니다. 구문은 값을 반환하지 않습니다. 그러니, 여러분은 다음처럼 `let` 구문을 사용해서는 다른 변수에 값을 대입할 수 없습니다:\n\n```rust\n\nfn main() {\n    let x = (let y = 6);\n}\n\n```\n\n여러분이 이 프로그램을 수행하면, 다음과 같은 에러를 보게 될 겁니다:\n\n```text\n\n$ cargo run\n   Compiling functions v0.1.0 (file:///projects/functions)\nerror: expected expression, found statement (`let`)\n --> src/main.rs:2:14\n  |\n2 |     let x = (let y = 6);\n  |              ^^^\n  |\n  = note: variable declaration using `let` is a statement\n\n```\n\n`let y = 6` 구문은 반환 값이 없으므로, `x`에 bind 시킬 것이 없습니다. 이것이 다른 언어인 C나 Ruby와의 차이점 입니다. 이들 언어들은 `x = y = 6`와 같은 코드가 `x`와 `y`에 모두 `6`의 값을 대입할 수 있습니다; Rust에서는 허용되지 않습니다. 여러분이 작성하는 Rust 코드의 대부분은 표현식이며 이는 어떤 값을 산출합니다. `5 + 6`과 같은 간단한 수학 연산을 살펴보면, 이는 `11`이란 값을 산출하는 표현식입니다.\n\n표현식은 구문의 부분일 수 있습니다: 항목 3-3은 `let y = 6;`이란 구문을 갖는데, `6`은 `6`이란 값을 산출하는 표현식입니다. 함수를 호출하는 것은 표현식입니다. 매크로를 호출하는 것은 표현식입니다. 예제처럼 새로운 범위를 생성하는데 사용하는 block `{}`은 표현식입니다:\n\nFilename: src/main.rs\n\n```rust\n\nfn main() {\n    let x = 5;\n\n    let y = {\n        let x = 3;\n        x + 1\n    };\n\n    println!(\"The value of y is: {}\", y);\n}\n\n```\n\n표현식 부분:\n\n```rust\n\n{\n    let x = 3;\n    x + 1\n}\n\n```\n\n이번 경우에 해당 block은 `4`를 산출합니다. 이 값은 `let` 구문의 일부로 `y`에 bound됩니다. 여러분이 앞서 봐온 것과 다르게 `x + 1` 줄의 마지막이 세미콜론으로 끝나지 않은 점을 주목하세요. 표현식은 종결을 나타내는 세미콜론을 사용하지 않습니다. 만약 세미콜론을 표현식 마지막에 추가하면, 이는 구문으로 변경되고 반환 값이 아니게 됩니다. 이후부터 함수의 반환 값과 표현식을 살펴보실 때 이 점을 유의하세요.\n\n### 반환 값을 갖는 함수\n\n함수는 그들을 호출한 코드에 값을 반환할 수 있습니다. 우리는 반환되는 값을 명명해야 할 필요는 없지만, 그들의 타입은 화살표(`->`) 뒤에 선언해야 합니다. Rust에서 반환 값은 함수 본문의 마지막 표현식의 값과 동일합니다. `return` 키워드와 값을 써서 함수로부터 일찍 반환할 수 있지만, 대부분의 함수들은 암묵적으로 마지막 표현식을 반환합니다. 값을 반환하는 함수의 예를 보겠습니다:\n\n```rust\n\nfn five() -> i32 {\n    5\n}\n\nfn main() {\n    let x = five();\n\n    println!(\"The value of x is: {}\", x);\n}\n\n```\n\n`five` 함수에는 함수 호출, 매크로, 심지어 `let` 구문도 없이 그저 `5`란 숫자 하나가 있습니다. 이는 Rust에서 완벽하게 함수로 허용됩니다. 함수 반환 값의 타입이 `-> i32`로 명시되어 있다는 점 또한 주목하세요. 해당 코드를 수행하면 다음과 같은 결과를 얻게 될 겁니다:\n\n```text\n\n$ cargo run\n   Compiling functions v0.1.0 (file:///projects/functions)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.30 secs\n     Running `target/debug/functions`\nThe value of x is: 5\n\n```\n\n`5`는 `five` 함수가 반환한 값이고, 이 때문에 반환 타입을 `i32`으로 한 것이지요. 좀더 자세히 설명해보겠습니다. 중요한 지점이 두 곳 있습니다: 첫 째, `let x = five();` 줄은 우리가 반환 값을 변수의 초기 값으로 사용하는 것을 보여줍니다. `five`의 반환 값이 `5`이기 때문에, 해당 줄은 다음과 동일합니다:\n\n```rust\n\nlet x = 5;\n\n```\n\n둘 째, `five` 함수는 매개변수 없이 반환 값에 대한 타입만 정의되어 있지만, 본문에는 `5`만이 세미콜론 없이 외로이 있는 이유는 이것이 우리가 값을 반환하고자 할 때 사용하는 표현식이기 때문입니다. 다른 예제를 통해 살펴보겠습니다:\n\nFilename: src/main.rs\n\n```rust\n\nfn main() {\n    let x = plus_one(5);\n\n    println!(\"The value of x is: {}\", x);\n}\n\nfn plus_one(x: i32) -> i32 {\n    x + 1\n}\n\n```\n\n이 코드를 수행하면 `The value of x is: 6`를 출력하게 됩니다. 우리가 `x + 1` 끝에 세미콜론을 추가하여 표현식을 구문으로 변경하면 어떤 일이 일어날까요?\n\n\n```rust\n\nfn main() {\n    let x = plus_one(5);\n\n    println!(\"The value of x is: {}\", x);\n}\n\nfn plus_one(x: i32) -> i32 {\n    x + 1;\n}\n\n```\n\n이 코드를 실행하면 다음과 같은 에러를 얻게 됩니다:\n\n```text\n\nerror[E0308]: mismatched types\n --> src/main.rs:7:28\n  |\n7 |   fn plus_one(x: i32) -> i32 {\n  |  ____________________________^\n8 | |     x + 1;\n  | |          - help: consider removing this semicolon\n9 | | }\n  | |_^ expected i32, found ()\n  |\n  = note: expected type `i32`\n             found type `()`\n\n```\n\n에러 메시지의 중요 포인트는 “mismatched types,”으로 이 코드의 주요 문제를 보여줍니다. `plus_one` 함수의 정의는 `i32` 값을 반환하겠다고 하였으나, 구문은 값을 산출하지 않기에 `()`처럼 비어있는 튜플로 표현됩니다. 이런 이유로, 반환할 것이 없어서 함수가 정의된 내용과 상충하게 되고 이는 에러를 발생시킵니다. 이번 결과에서는, Rust가 문제를 해결할 수 있도록 도와주는 메시지를 제공합니다: 세미콜론을 제거하면 에러가 교정될 수도 있다고 제안하네요.','2022-09-05 12:20:10.045000','함수 동작 원리',3),(4,'Rust에서 사용되는 모든 값들은 어떤 *타입*을 갖습니다. 그러니 어떤 형태의 데이터인지 명시하여 Rust에게 알려줘서 이를 통해 데이터를 어떻게 다룰지 알 수 있도록 해야 합니다. 이번 장에서, 우리는 언어에 포함되어 있는 여러 타입들을 살펴보고자 합니다. 타입은 크게 스칼라와 컴파운드, 둘로 나눌 수 있습니다.\n\n이번 장의 전체에 걸쳐 주지해야 할 점은 Rust는 *타입이 고정된* 언어라는 점 입니다. 이게 의미하는 바는 모든 변수의 타입이 컴파일 시에 반드시 정해져 있어야 한다는 겁니다. 보통 컴파일러는 우리가 값을 사용하는 지에 따라 타입을 추측할 수 있습니다. 타입의 선택 폭이 넓은 경우는 반드시 타입의 명시를 첨가해야 합니다. 다음처럼:\n\n```rust\n\nlet guess: u32 = \"42\".parse().expect(\"Not a number!\");\n\n```\n\n여기에 타입 명시를 첨가하지 않은 경우, Rust는 다음과 같은 에러를 발생시킵니다.이와 같은 에러는 컴파일러가 우리에게 사용하고 싶은 타입이 무엇인지 추가적인 정보를 요구하는 겁니다.\n\n```text\n\nerror[E0282]: type annotations needed\n --> src/main.rs:2:9\n  |\n2 |     let guess = \"42\".parse().expect(\"Not a number!\");\n  |         ^^^^^\n  |         cannot infer type for `_`\n  |         consider giving `guess` a type\n\n```\n\n우리가 다루고자 하는 다양한 데이터 타입들 각각의 타입 명시를 살펴보겠습니다.\n\n### 스칼라 타입들\n\n*스칼라*는 하나의 값으로 표현되는 타입입니다. Rust는 정수형, 부동소수점 숫자, boolean, 그리고 문자, 네 가지 스칼라 타입을 보유하고 있습니다. 아마 다른 프로그래밍 언어에서도 본 적이 있겠지만, Rust에서 이들이 어떻게 동작하는지 살펴보도록 합시다.\n\n### 정수형\n\n*정수형*은 소수점이 없는 숫자 입니다. 우리는 이번 장의 앞부분에서 `u32`타입인 정수형을 사용했었습니다. 해당 타입의 선언은 부호 없는 32비트 변수임을 나타냅니다 (부호 있는 타입은 `u`대신 `i`로 시작합니다.) 표 1은 Rust에서 사용되는 정수형들을 보여줍니다. 부호, 미부호로 나뉜 다른 열의 타입을 사용하여(*i16*처럼) 정수 값의 타입을 선언할 수 있습니다.\n\nTable1: Rust에서의 정수 타입\n\n| Length | Signed | Unsigned |\n| --- | --- | --- |\n| 8-bit | i8 | u8 |\n| 16-bit | i16 | u16 |\n| 32-bit | i32 | u32 |\n| 64-bit | i64 | u64 |\n| arch | isize | usize |\n\n각각의 타입은 부호 혹은 미부호이며 명시된 크기를 갖습니다. 부호 혹은 미부호의 의미는, 숫자가 양수 혹은 음수를 다룰 수 있는지 혹은 없는지를 나타냅니다. 다르게 말하면, 숫자가 부호를 가져야 하는 경우(부호) 혹은 오직 양수만을 가질 것이기에 부호가 없이도 표현할 수 있는가(미부호)를 나타냅니다. 종이에 숫자 기재하는 것과 같죠: 부호와 함께 다뤄야 하는 경우에 숫자는 더하기 혹은 빼기 기호와 함께 표시하죠. 숫자가 양수라고 가정해도 문제 없는 상황에는 부호 없이 표시하게 됩니다. 부호된 숫자는 2의 보수 형태를 사용하여 저장됩니다. (2의 보수가 모른다면 검색해보세요. 이 사이트에서 다루는 내용이 아닙니다.)\n\n각 부호 변수는 -(2n - 1) 부터 2n - 1 - 1 까지의 값을 포괄합니다. 여기서 `n`은 사용되는 타입의 비트 수 입니다. 즉, `i8`은 -(27) 에서 27 - 1 까지의 값, 즉 -128 에서 127 사이의 값을 저장할 수 있습니다. 미부호 타입은 0 에서 2n - 1 까지의 값을 저장할 수 있습니다. 즉, `u8` 타입은 0 에서 28 - 1 다시 말해, 0 에서 255 까지의 값을 저장할 수 있습니다.\n\n추가로, `isize`와 `usize`타입은 당신의 프로그램이 동작하는 컴퓨터 환경이 64-bits인지 아닌지에 따라 결정됩니다. 64-bit 아키텍처이면 64bit를, 32-bit 아키텍처이면 32bit를 갖게 됩니다.\n\n당신은 테이블 3-2에서 보여주는 형태들처럼 정수형 리터럴을 사용할 수 있습니다. byte 리터럴을 제외하고 모든 정수형 리터럴은 `57u8`과 같은 타입 접미사와 `1_000`과 같이 시각적인 구분을 위한 `_`의 사용을 허용합니다.\n\nTable 2: Rust의 정수형 리터럴들\n\n| Number literals | Example |\n| --- | --- |\n| Decimal | 98_222 |\n| Hex | 0xff |\n| Octal | 0o77 |\n| Binary | 0b1111_0000 |\n| Byte (u8 only) | b\'A\' |\n\n그렇다면 어떤 타입의 정수를 사용해야 할까요? 확실하게 정해진 경우가 아니면 Rust의 기본 값인 `i32`가 일반적으로는 좋은 선택입니다. 이는 일반적으로 가장 빠르기 때문이죠. 심지어 64-bit 시스템에서도요. `isize`나 `usize`는 주로 일부 콜렉션 타입의 색인에 사용됩니다.\n\n### 부동 소수점 타입\n\nRust에는 소수점을 갖는 숫자인 *부동소수점 숫자*를 위한 두 가지 기본 타입도 있습니다. Rust의 부동소수점 타입은 `f32`와 `f64`로, 예상하신 대로 각기 32bit와 64bit의 크기를 갖습니다. 기본 타입은 `f64`인데, 그 이유는 최신의 CPU 상에서는 `f64`가 `f32`와 대략 비슷한 속도를 내면서도 더 정밀한 표현이 가능하기 때문입니다.\n\n다음은 부동소수점 숫자가 활용되는 예제입니다:\n\n```rust\n\nfn main() {\n    let x = 2.0; // f64\n\n    let y: f32 = 3.0; // f32\n}\n\n```\n\n부동소수점 숫자는 IEEE-754 표준에 따라 표현됩니다. `f32` 타입은 1배수의 정밀도인 부동소수점이고, `f64`는 2배수의 정밀도인 부동소수점입니다.\n\n### 수학적 연산들.\n\nRust가 지원하는 일반적인 기본 수학적 연산은 기대하신 것처럼 모든 숫자 타입에 적용됩니다: 더하기, 빼기, 곱하기, 나누기 등등. 다음의 코드로 보여주려는 것은 각 경우를 `let`문 내에서 사용할 수 있는 방법입니다.\n\n```rust\n\nfn main() {\n    // addition\n    let sum = 5 + 10;\n\n    // subtraction\n    let difference = 95.5 - 4.3;\n\n    // multiplication\n    let product = 4 * 30;\n\n    // division\n    let quotient = 56.7 / 32.2;\n\n    // remainder\n    let remainder = 43 % 5;\n}\n\n```\n\n위의 문장에서 각 표현식들은 수학 연산자를 사용하여 산출된 값을 변수로 bound 합니다. 부록 B에 Rust에서 제공하는 모든 연산자 목록이 들어있습니다.\n\n### Boolean 타입\n\n대부분의 다른 언어들처럼, boolean 타입은 Rust에서 둘 중 하나의 값만 가질 수 있습니다: `true`와 `false`. boolean 타입은 러스트에서 `bool`로 명시됩니다.\n\n예제:\n\n```rust\n\nfn main() {\n    let t = true;\n\n    let f: bool = false; // with explicit type annotation\n}\n\n```\n\nboolean 값을 사용하는 주된 방법은 `if`문과 같은 조건문에서 조건으로 사용하는 것입니다. 우리는 `if`문이 Rust에서 동작하는 방식을 “제어 흐름” 장에서 다루게 될 겁니다.\n\n### 문자 타입\n\n지금까지 숫자 타입만을 살펴봤는데, Rust는 문자 또한 지원합니다. Rust의 `char`는 이 언어의 가장 근본적인 알파벳 타입이고, 다음의 코드는 이를 사용하는 한 가지 방법입니다. 스트링이 큰따옴표를 쓰는 것에 반하여 `char` 타입은 작은따옴표로 쓰는 점을 주목하세요:\n\n```rust\n\nfn main() {\n   let c = \'z\';\n   let z = \'ℤ\';\n   let heart_eyed_cat = \'?\';\n}\n\n```\n\nRust의 `char`타입은 Unicode Scalar를 표현하는 값이고 이는 ASCII 보다 많은 표현을 가능하게 합니다. 억양 표시가 있는 문자, 한국어/중국어/일본어 표의 문자, 이모티콘, 넓이가 0인 공백문자 모두가 Rust에서는 `char`타입으로 사용할 수 있습니다. Unicode Scalar 값의 범위는 `U+0000`에서 `U+D7FF` 그리고 `U+E000`에서 `U+10FFFF` 를 포괄합니다. 그럼에도 불구하고 “문자”는 Unicode을 위한 개념이 아니기 때문에, 당신의 인간적 직관에 따른 “문자”와 Rust의 `char`가 동일하지 않을 수 있습니다. 우리는 스트링(문자열)부에서 이 주제에 대해 상세히 다루게 될 겁니다.\n\n### 복합 타입들\n\n*복합 타입들*은 다른 타입의 다양한 값들을 하나의 타입으로 묶을 수 있습니다. Rust는 두 개의 기본 타입들을 갖고 있습니다: 튜플과 배열.\n\n### 값들을 집합시켜서 튜플화하기.\n\n튜플은 다양한 타입의 몇 개의 숫자를 집합시켜 하나의 복합 타입으로 만드는 일반적인 방법입니다.\n\n우리는 괄호 안에 콤마로 구분되는 값들의 목록을 작성하여 튜플을 만듭니다. 튜플에 포함되는 각 값의 타입이 동일할 필요없이 서로 달라도 됩니다. 다음의 예제에 우리는 선택 사항인 타입 명시를 추가했습니다.\n\n```rust\n\nfn main() {\n    let tup: (i32, f64, u8) = (500, 6.4, 1);\n}\n\n```\n\n튜플은 단일 요소를 위한 복합계로 고려되었기에 변수 `tup`에는 튜플 전체가 bind 됩니다. 개별 값을 튜플의 밖으로 빼내오기 위해서는, 패턴 매칭을 사용하여 튜플의 값을 구조해체 시키면 됩니다. 다음을 봅시다:\n\n```rust\n\nfn main() {\n    let tup = (500, 6.4, 1);\n\n    let (x, y, z) = tup;\n\n    println!(\"The value of y is: {}\", y);\n}\n\n```\n\n해당 프로그램은 처음에 튜플을 만들고 변수 `tup`에 bind 시킵니다. 이후 패턴과 `let`을 통해 `tup`을 세개의 분리된 변수 `x`, `y`, 그리고 `z`에 이동시킵니다. 이것을 *구조해체*라고 부르는 이유는 하나의 튜플을 세 부분으로 나누기 때문입니다. 최종적으로 프로그램은 `y`의 값을 출력할 것이고 이는 `6.4`입니다.\n\n패턴 매칭을 통한 구조해체에 추가로, 우리는 마침표(`.`) 뒤에 우리가 접근하길 원하는 값의 색인을 넣는 것을 통해 튜플의 요소에 직접적으로 접근할 수 있습니다. 예제를 봅시다:\n\n```rust\n\nfn main() {\n    let x: (i32, f64, u8) = (500, 6.4, 1);\n\n    let five_hundred = x.0;\n\n    let six_point_four = x.1;\n\n    let one = x.2;\n}\n\n```\n\n위의 프로그램은 튜플 `x`를 만들고, 이의 각 요소들을 그들의 색인을 통해 접근하여 새 변수를 만듭니다. 대부분의 언어가 그렇듯이, 튜플의 첫 번째 색인은 0 입니다.\n\n### 배열\n\n여러 값들의 집합체를 만드는 다른 방법은 *배열*입니다. 튜플과는 다르게, 배열의 모든 요소는 모두 같은 타입이여야 합니다. Rust의 배열이 몇 다른 언어들의 배열과 다른 점은 Rust에서는 배열은 고정된 길이를 갖는다는 점입니다: 한번 선언되면, 이들은 크기는 커지거나 작아지지 않습니다.\n\nRust에서는 대괄호 안에 값들을 콤마로 구분하여 나열해서 배열을 만듭니다:\n\n```rust\n\nfn main() {\n    let a = [1, 2, 3, 4, 5];\n}\n\n```\n\n배열이 유용할 때는 당신의 데이터를 heap보다 stack에 할당하는 것을 원하거나(stack 과 heap에 대해서는 소유권 부분에서 다루게 될 것입니다), 당신이 항상 고정된 숫자의 요소를 갖는다고 확신하고 싶을 때입니다. 이들은 벡터 타입처럼 가변적이지 않습니다. 벡터 타입은 유사 집합체로 표준 라이브러리에서 제공되며 확장 혹은 축소가 가능합니다. 배열이나 벡터 중에 뭘 선택해야 할지 확실하지 않은 상황이라면 벡터를 사용하도록 하세요. 벡터 부분에서 벡터에 대해 더 자세히 다룹니다.\n\n벡터가 아닌 배열을 선택하게 되는 경우의 예로, 프로그램이 올해의 달 이름을 알고자 할 경우입니다. 프로그램이 달을 추가하거나 삭제하는 경우는 거의 없을 것이므로, 고정적으로 12개의 아이템을 가질테니 배열을 사용하면 됩니다.\n\n```rust\n\nlet months = [\"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\",\n              \"August\", \"September\", \"October\", \"November\", \"December\"];\n\n```\n\n### 배열 요소에 접근하기\n\n배열은 stack에 단일 메모리 뭉치로 할당됩니다. 우리는 색인을 통해 배열의 요소에 접근할 수 있습니다. 이렇게요:\n\n```rust\n\nfn main() {\n    let a = [1, 2, 3, 4, 5];\n\n    let first = a[0];\n    let second = a[1];\n}\n\n```\n\n이번 예제에서, `first`로 명명된 변수는 값 `1`이 될텐데, 왜냐면 배열 색인 `[0]`에 들어있는 값이기 때문이죠. `second`로 명명된 변수는 배열의 색인 `[1]`의 값인 `2`가 되겠죠.\n\n### 유효하지 않은 배열 요소에 대한 접근\n\n만약 우리가 배열의 끝을 넘어선 요소에 접근하려고 하면 어떻게 될까요? 예제를 다음처럼 변경해봤습니다.\n\n\n```rust\n\nfn main() {\n    let a = [1, 2, 3, 4, 5];\n    let index = 10;\n\n    let element = a[index];\n\n    println!(\"The value of element is: {}\", element);\n}\n\n```\n\n이번 코드를 `cargo run`을 통해 동작시키면 다음의 결과를 얻게 됩니다:\n\n```text\n\n$ cargo run\n   Compiling arrays v0.1.0 (file:///projects/arrays)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/arrays`\nthread \'<main>\' panicked at \'index out of bounds: the len is 5 but the index is\n 10\', src/main.rs:6\nnote: Run with `RUST_BACKTRACE=1` for a backtrace.\n\n```\n\n컴파일 시에는 아무런 에러도 발생시키지 않습니다만, 프로그램의 결과는 *실행 중에* 에러가 발생했고 성공적으로 종료되지 못했다고 나옵니다.\n\n색인을 사용하여 요소에 접근하려고 하면 Rust는 지정한 색인이 배열 길이보다 작은지 확인합니다. 색인이 길이보다 길면 Rust는 프로그램이 오류와 함께 종료 될 때 Rust가 사용하는 용어인 *패닉(panic)*합니다.\n\n이것은 Rust의 안전 원칙이 동작하는 첫 번째 예입니다. 많은 저수준 언어에서 이러한 타입의 검사는 수행되지 않으며 잘못된 색인을 제공하면 유효하지 않은 메모리에 액세스 할 수 있습니다. Rust는 메모리 접근을 허용하고 계속 진행하는 대신 즉시 종료하여 이러한 종류의 오류로부터 사용자를 보호합니다.','2022-09-05 12:23:07.359000','데이터 타입들',4),(5,'구조체(*struct*)는 사용자들이 연관된 여러 값들을 묶어서 의미있는 데이터 단위를 정의할 수 있게 합니다. 객체지향 언어를 사용해 본 경험이 있으시다면, 구조체(*struct*)는 객체의 데이터 속성 같은 것으로 보시면 됩니다. 이번 장에서는 튜플과 구조체를 비교해 보고, 구조체를 어떻게 사용하는지 알아보며, 메소드와 구조체 데이터의 동작과 관련된 연관함수(associated functions)의 정의 방법에 대해 알아보도록 하겠습니다. 구조체와 열거형(6장에서 살펴볼 것입니다)에 대한 개념은 여러분의 프로그램 도메인 상에서 새로운 타입을 만들기 위한 기초 재료로서, 러스트의 컴파일 시점 타입 검사 기능을 최대한 활용합니다.\n\n# **구조체를 정의하고 초기화하기**\n\n구조체는 튜플과 비슷합니다. 튜플과 유사하게, 구조체의 구성요소들은 각자 다른 타입을 지닐 수 있습니다. 그러나 튜플과는 다르게 각 구성요소들은 명명할 수 있어 값이 의미하는 바를 명확하게 인지할 수 있습니다. 구조체는 각 구성요소들에 명명을 할 수 있다는 점 덕분에 튜플보다 유연하게 다룰 수 있습니다. 구조체 내의 특정 요소 데이터 명세를 기술하거나, 접근할 때 순서에 의존할 필요가 없기 때문입니다.\n\n구조체를 정의할 때는 `struct` 키워드를 먼저 입력하고 명명할 구조체명을 입력하면 됩니다. 구조체의 이름은 함께 묶이게 되는 구성요소들의 의미를 내포할 수 있도록 짓는 것이 좋습니다. 이후 중괄호 안에서는, 필드(*field*)라 불리는 각 구성요소들의 타입과 접근할 수 있는 이름을 정의합니다.\n\n아래 예제 5-1에서는 사용자 계정에 대한 정보를 저장하는 구조체를 정의합니다.\n\n```rust\n\nstruct User {\n    username: String,\n    email: String,\n    sign_in_count: u64,\n    active: bool,\n}\n\n```\n\nListing1: 사용자 계정정보를 저장하는 `User` 구조체 정의\n\n정의한 구조체를 사용하려면, 각 필드의 값을 명세한 인스턴스(*instance*)를 생성해야 합니다. 인스턴스는 구조체의 이름을 명시함으로써 사용할 수 있고, 필드를 식별할 수 있는 이름인 키와 그 키에 저장하고자 하는 값의 쌍(`key:value`)을 이어지는 중괄호 안에 추가하여 생성할 수 있습니다.\n\n구조체를 정의할때 필드들의 순서가 정의한 필드의 순서와 같을 필요는 없습니다. 달리 서술하자면, 구조체 정의는 무엇이 들어가야 하는 지 대략적으로 정의된 양식 정도라고 생각하시면 되고, 인스턴스는 그것에 특정한 값을 넣어 실체화한 것이라 생각하시면 됩니다. 아래 예제 5-2에서는 특정 사용자를 선언하는 과정을 보여줍니다.\n\n```rust\n\nlet user1 = User {\n    email: String::from(\"someone@example.com\"),\n    username: String::from(\"someusername123\"),\n    active: true,\n    sign_in_count: 1,\n};\n\n```\n\nListing 2: 구조체 `User`의 인스턴스 생성하기\n\n구조체에서 특정한 값을 읽어오려면, 점(.) 표기법을 사용하시면 됩니다. 사용자의 이메일 값을 얻고자 하면, `user1.email` 과 같은 방식으로 접근하실 수 있습니다. 변경이 가능한 구조체 인스턴스에 들어있는 값을 바꾸고자 할 때는, 점(.) 표기법을 사용하여 특정 필드에 새 값을 할당할 수 있습니다.\n\n```rust\n\nlet mut user1 = User {\n    email: String::from(\"someone@example.com\"),\n    username: String::from(\"someusername123\"),\n    active: true,\n    sign_in_count: 1,\n};\n\nuser1.email = String::from(\"anotheremail@example.com\");\n\n```\n\nListing 3: `User` 인스턴스의 `email`필드 변경하기\n\n인스턴스는 반드시 `변경 가능(mutable)`해야합니다. Rust에서는 특정 필드만 변경할 수 있도록 허용하지 않습니다. 다른 표현식과 마찬가지로, 함수 본문의 마지막에 새 인스턴스 구조체를 표현식(expressions)으로 생성하여 새 인스턴스를 바로 반환 할 수 있습니다.\n\nListing 4에서는 주어진 `email`과 `user_name`으로 `User` 인스턴스를 반환하는 `build_user` 함수를 보여줍니다. 활성 필드는 `true` 값을 가져오고 `sign_in_count`는 `1` 값을 가져옵니다.\n\n```rust\n\nfn build_user(email: String, username: String) -> User {\n    User {\n        email: email,\n        username: username,\n        active: true,\n        sign_in_count: 1,\n    }\n}\n\n```\n\n예제 4: 사용자의 이메일과 이름을 받아 `User`구조체의 인스턴스를 반환하는 `build_user` 함수\n\n구조체 필드와 동일한 이름으로 함수 매개 변수의 이름을 지정하는 것이 합리적이긴 하지만, `email` 및 `username` 필드 이름과 변수를 반복해야하는 것은 비효율적입니다. 구조체에 더 많은 필드가 많다면, 더욱 성가실 것입니다. 다행히도 편리한 방법이 있습니다!\n\n### 변수명이 필드명과 같을 때 간단하게 필드 초기화하기\n\n변수명과 구조체의 필드명이 같다면, 필드 초기화 축약법(*field init shorthand*) 을 이용할 수 있습니다. 이를 활용하면 구조체를 생성하는 함수를 더 간단히 작성할 수 있게 됩니다. 아래 예제 5의 `build_user` 함수에는 `email`과 `username` 라는 매개변수가 있습니다. 함수는 `User`구조체가 구현된 인스턴스를 반환합니다.\n\n매개변수인 `email`과 `username`이 `User`구조체의 필드명과 같기 떄문에, 함수 `build_user` 에서 `email`과 `username`를 명시하는 부분을 예제 4와 같이 다시 작성할 필요가 없습니다.\n\n예제 5의 `build_user` 함수는 예제 4와 같은 방식으로 동작합니다. 필드 초기화를 이러한 방식으로 수행하는 문법은 간결한 코드를 작성하는데 도움이 되고, 많은 필드의 값이 정의되어야할 때 특히 유용합니다.\n\n```rust\n\nfn build_user(email: String, username: String) -> User {\n    User {\n        email,\n        username,\n        active: true,\n        sign_in_count: 1,\n    }\n}\n\n```\n\n예제 5: 매개변수 `email`과 `username`가 구조체의 필드와 이름이 같아, 함수 내에서 특별히 명시하지 않고 초기화한 예인 `build_user` 함수\n\n`email` 필드와 `email` 매개 변수의 이름이 같기 때문에 `email:email` 대신 `email` 만 작성하면됩니다!\n\n### 구조체 갱신법을 이용하여 기존 구조체 인스턴스로 새 구조체 인스턴스 생성하기\n\n존재하는 인스턴스에서 기존 값의 대부분은 재사용하고, 몇몇 값만 바꿔 새로운 인스턴스를 정의하는 방법은 유용합니다. 예제 6는 변수 `user2`에 `email`과 `username`은 새로 할당하고, 나머지 필드들은 예제 2에서 정의한 `user1`의 값들을 그대로 사용하는 방식으로 `User` 인스턴스를 생성하는 것을 보여줍니다.\n\n```rust\n\nlet user2 = User {\n    email: String::from(\"another@example.com\"),\n    username: String::from(\"anotherusername567\"),\n    active: user1.active,\n    sign_in_count: user1.sign_in_count,\n};\n\n```\n\n예제 6: `user1`의 일부 값들을 재사용하여, 구조체 `User`의 인스턴스 `user2`를 새로 생성\n\n구조체 갱신법(*struct update syntax*)은 예제 6에서 작성한 짧은 코드와 같은 효과를 낼 수 있습니다. 구조체 갱신법은, 입력으로 주어진 인스턴스와 변화하지 않는 필드들을 명시적으로 할당하지 않기 위해 `..` 구문을 사용합니다. 예제 7의 코드는 `user1` 인스턴스와 `active`, `sign_in_count` 필드의 값은 같고, `email`과 `username` 필드들은 값은 다른 `user2` 인스턴스를 생성할 때 구조체 갱신법을 사용하는 것을 보여줍니다.\n\n```rust\n\nlet user2 = User {\n    email: String::from(\"another@example.com\"),\n    username: String::from(\"anotherusername567\"),\n    ..user1\n};\n\n```\n\n예제 7: 인스턴스 갱신 문법의 사용 예시 - 새 `User` 구조체 생성 시 `email`과 `username` 필드에는 새 값을 할당하고, 나머지 필드는 `user1`에서 재사용\n\n### 이름이 없고 필드마다 타입은 다르게 정의 가능한 튜플 구조체\n\n구조체명을 통해 의미를 부여할 수 있으나 필드의 타입만 정의할 수 있고 명명은 할 수 없는, 튜플 구조체(*tuple structs*)라 불리는 튜플과 유사한 형태의 구조체도 정의할 수 있습니다.\n\n튜플 구조체는 일반적인 구조체 정의방법과 똑같이 `struct` 키워드를 통해 정의할 수 있고, 튜플의 타입 정의가 키워드 뒤에서 이루어지면 됩니다. 아래는 튜플 구조체인 `Color`, `Point`의 정의와 사용 예시 입니다.\n\n```rust\n\nstruct Color(i32, i32, i32);\nstruct Point(i32, i32, i32);\n\nlet black = Color(0, 0, 0);\nlet origin = Point(0, 0, 0);\n\n```\n\n다른 튜플 구조체이기 때문에, `black`과 `origin`이 다른 타입이란 것을 유념해 두셔야 합니다. 구조체 내의 타입이 모두 동일하더라도 각각의 구조체는 고유의 타입이기 때문입니다. 한편 튜플 구조체 인스턴스는, 튜플과 비슷하게 동작합니다.\n\n### 필드가 없는 유사 유닛 구조체\n\n또한 어떤 필드도 없는 구조체 역시 정의할 수 있습니다! 이는 유닛 타입인 `()`와 비슷하게 동작하고, 그 때문에 유사 유닛 구조체(*unit-like structs*)라 불립니다. 유사 유닛 구조체는 특정한 타입의 트레잇(trait)을 구현해야하지만 타입 자체에 데이터를 저장하지 않는 경우에 유용합니다.\n\n> 구조체 데이터의 소유권(Ownership)\n> \n> \n> 예제 1에서의 `User` 구조체 정의에서는, `&str` 문자 슬라이스 타입 대신 `String`타입을 사용했습니다. 이는 의도적인 선택으로, 구조체 전체가 유효한 동안 구조체가 그 데이터를 소유하게 하고자 함입니다.\n> \n\n구조체가 소유권이 없는 데이터의 참조를 저장할수는 있지만, 라이프타임(*lifetimes*) 의 사용을 전제로 합니다. 라이프타임은 구조체가 존재하는동안 참조하는 데이터를 계속 존재할 수 있도록 합니다. 라이프타임을 사용하지 않고 참조를 저장하고자 하면 아래와 같은 일이 발생합니다.\n\n```rust\n\nstruct User {\n    username: &str,\n    email: &str,\n    sign_in_count: u64,\n    active: bool,\n}\n\nfn main() {\n    let user1 = User {\n        email: \"someone@example.com\",\n        username: \"someusername123\",\n        active: true,\n        sign_in_count: 1,\n    };\n}\n\n```\n\n컴파일러는 라이프타임이 명시되어야 한다고 에러를 발생시킵니다.\n\n```text\n\nerror[E0106]: missing lifetime specifier\n -->\n  |\n2 |     username: &str,\n  |               ^ expected lifetime parameter\n\nerror[E0106]: missing lifetime specifier\n -->\n  |\n3 |     email: &str,\n  |            ^ expected lifetime parameter\n\n```\n\n참조가 저장이 불가능한 위 에러 개선에 대해서는 나중에 살펴보도록 하겠습니다. 지금은 `&str` 대신 `String` 을 사용하는 방식으로 에러를 고치도록 하겠습니다.\n\n# 구조체를 이용한 예제 프로그램\n\n어느 시점에 구조체를 이용하기를 원하게 될지를 이해해보기 위해서, 사각형의 넓이를 계산하는 프로그램을 작성해봅시다. 단일 변수들로 구성된 프로그램으로 시작한 뒤, 이 대신 구조체를 이용하기까지 프로그램을 리팩토링해 볼 것입니다.\n\nCargo로 픽셀 단위로 명시된 사각형의 길이와 너비를 입력받아서 사각형의 넓이를 계산하는 *rectangles*라는 이름의 새로운 바이너리 프로젝트를 만듭시다. Listing 7은 우리 프로젝트의 *src/main.rs* 내에 설명한 동작을 수행하는 한 방법을 담은 짧은 프로그램을 보여줍니다:\n\n```rust\n\nfn main() {\n    let length1 = 50;\n    let width1 = 30;\n\n    println!(\n        \"The area of the rectangle is {} square pixels.\",\n        area(length1, width1)\n    );\n}\n\nfn area(length: u32, width: u32) -> u32 {\n    length * width\n}\n\n```\n\nListing 7: 길이와 너비가 각각의 변수에 지정된 사각형의 넓이 계산하기\n\n이제 이 프로그램을 `cargo run`으로 실행해보세요:\n\n```text\n\nThe area of the rectangle is 1500 square pixels.\n\n```\n\n### [튜플을 이용한 리팩터링](https://rinthel.github.io/rust-lang-book-ko/ch05-02-example-structs.html#%ED%8A%9C%ED%94%8C%EC%9D%84-%EC%9D%B4%EC%9A%A9%ED%95%9C-%EB%A6%AC%ED%8C%A9%ED%84%B0%EB%A7%81)\n\n비록 Listing 7가 잘 동작하고 각 차원축의 값을 넣은 `area` 함수를 호출함으로써 사각형의 넓이를 알아냈을지라도, 이것보다 더 좋게 할 수 있습니다. 길이와 너비는 함께 하나의 사각형을 기술하기 떄문에 서로 연관되어 있습니다.\n\n이 방법에 대한 사안은 `area`의 시그니처에서 여실히 나타납니다:\n\n```rust\n\nfn area(length: u32, width: u32) -> u32 {\n\n```\n\n`area` 함수는 어떤 사각형의 넓이를 계산하기로 되어있는데, 우리가 작성한 함수는 두 개의 파라미터들을 가지고 있습니다. 파라미터들은 연관되어 있지만, 우리 프로그램 내의 어디에도 표현된 바 없습니다. 길이와 너비를 함께 묶는다면 더 읽기 쉽고 관리하기도 좋을 것입니다. 페이지 XX, 튜플로 값들을 묶기 절에서 이런 일을 하는 한가지 방법을 이미 다루었습니다: 바로 튜플을 이용하는 것이지요. Listing 8은 튜플을 이용한 우리 프로그램의 또다른 버전을 보여줍니다:\n\n```rust\n\nfn main() {\n    let rect1 = (50, 30);\n\n    println!(\n        \"The area of the rectangle is {} square pixels.\",\n        area(rect1)\n    );\n}\n\nfn area(dimensions: (u32, u32)) -> u32 {\n    dimensions.0 * dimensions.1\n}\n\n```\n\nListing 8: 튜플을 이용하여 사각형의 길이와 너비를 명시하기\n\n어떤 면에서는 프로그램이 더 좋아졌습니다. 튜플은 한 조각의 구조체를 추가할 수 있게 해주고, 우리는 이제 단 하나의 인자만 넘기게 되었습니다. 그러나 다른 한편으로 이 버전은 덜 명확합니다: 튜플은 요소에 대한 이름이 없어서, 튜플 내의 값을 인덱스로 접근해야 하기 때문에 우리의 계산이 더 혼란스러워 졌습니다.\n\n면적 계산에 대해서는 길이와 너비를 혼동하는 것이 큰 문제가 아니겠으나, 만일 우리가 화면에 이 사각형을 그리고 싶다면, 문제가 됩니다! 우리는 `length`가 튜플 인덱스 `0`이고 `width`가 튜플 인덱스 `1`이라는 점을 꼭 기억해야 할 것입니다. 만일 다른 누군가가 이 코드를 이용해서 작업한다면, 그들 또한 이 사실을 알아내어 기억해야 할테지요. 우리의 코드 내에 데이터의 의미를 전달하지 않았기 때문에, 이 값들을 잊어먹거나 혼동하여 에러를 발생시키는 일이 쉽게 발생할 것입니다.\n\n### 구조체를 이용한 리팩터링: 의미를 더 추가하기\n\n우리는 데이터에 이름표를 붙여 의미를 부여하기 위해 구조체를 이용합니다. Listing 9에서 보시는 바와 같이, 우리가 사용중인 튜플은 전체를 위한 이름 뿐만 아니라 부분들을 위한 이름들도 가지고 있는 데이터 타입으로 변형될 수 있습니다:\n\n```rust\n\nstruct Rectangle {\n    length: u32,\n    width: u32,\n}\n\nfn main() {\n    let rect1 = Rectangle { length: 50, width: 30 };\n\n    println!(\n        \"The area of the rectangle is {} square pixels.\",\n        area(&rect1)\n    );\n}\n\nfn area(rectangle: &Rectangle) -> u32 {\n    rectangle.length * rectangle.width\n}\n\n```\n\nListing 9: `Rectangle` 구조체 정의하기\n\n여기서 우리는 구조체를 정의하고 이를 `Rectangle`이라 명명했습니다. `{}` 안에서 `length`와 `width`를 필드로 정의했는데, 둘 모두 `u32` 타입입니다. 그런 다음 `main` 함수 안에서 길이 50 및 너비 30인 특정한 `Rectangle` 인스턴스(instance)를 생성했습니다.\n\n우리의 `area` 함수는 이제 하나의 파라미터를 갖도록 정의되었는데, 이는 `rectangle`이라는 이름이고, `Rectangle` 구조체 인스턴스의 불변 참조자 타입입니다. 우리는 구조체의 소유권을 얻기 보다는 빌리기를 원합니다. 이 방법으로, `main`은 그 소유권을 유지하고 `rect1`을 계속 이용할 수 있는데, 이는 우리가 함수 시그니처 내에서와 함수 호출시에 `&`를 사용하게 된 이유입니다.\n\n`area` 함수는 `Rectangle` 인스턴스 내의 `length`와 `width` 필드에 접근합니다. `area`에 대한 우리의 함수 시그니처는 이제 정확히 우리가 의미한 바를 나타냅니다: `length`와 `width` 필드를 사용하여 `Rectangle`의 넓이를 계산한다는 뜻 말이죠. 이는 길이와 너비가 서로 연관되어 있음을 잘 전달하며, `0`과 `1`을 사용한 튜플 인덱스 값을 이용하는 대신에 값들에 대해서 서술적인 이름을 사용합니다 - 명확성 측면에서 승리입니다.\n\n### 파생 트레잇(derived trait)으로 유용한 기능 추가하기\n\n우리가 프로그램을 디버깅하는 동안 구조체 내의 모든 값을 보기 위해서 `Rectangle`의 인스턴스를 출력할 수 있다면 도움이 될 것입니다. Listing 10은 우리가 이전 장들에서 해왔던 것처럼 `println!` 매크로를 이용한 것입니다:\n\n```rust\n\nstruct Rectangle {\n    length: u32,\n    width: u32,\n}\n\nfn main() {\n    let rect1 = Rectangle { length: 50, width: 30 };\n\n    println!(\"rect1 is {}\", rect1);\n}\n\n```\n\nListing 10: `Rectangle` 인스턴스 출력 시도하기\n\n이 코드를 실행시키면, 다음과 같은 핵심 메세지와 함께 에러가 발생합니다:\n\n```text\n\nerror[E0277]: the trait bound `Rectangle: std::fmt::Display` is not satisfied\n\n```\n\n`println!` 매크로는 다양한 종류의 포맷을 출력할 수 있으며, 기본적으로 `{}`은 `println!`에게 `Display`라고 알려진 포맷팅을 이용하라고 전달해줍니다: 직접적인 최종 사용자가 사용하도록 의도된 출력이지요. 여지껏 우리가 봐온 기본 타입들은 `Display`가 기본적으로 구현되어 있는데, 이는 `1` 혹은 다른 기본 타입을 유저에게 보여주고자 하는 방법이 딱 한가지기 때문입니다. 하지만 구조체를 사용하는 경우, `println!`이 출력을 형식화하는 방법은 덜 명확한데 이는 표시 방법의 가능성이 더 많기 때문입니다: 여러분은 쉽표를 이용하길 원하나요, 혹은 그렇지 않은가요? 여러분은 중괄호를 출력하길 원하나요? 모든 필드들이 다 보여지는 편이 좋은가요? 이러한 모호성 때문에, 러스트는 우리가 원하는 것을 추론하는 시도를 하지 않으며 구조체는 `Display`에 대한 기본 제공 되는 구현체를 가지고 있지 않습니다.\n\n계속 에러를 읽어나가면, 아래와 같은 도움말을 찾게 될 것입니다:\n\n```text\n\nnote: `Rectangle` cannot be formatted with the default formatter; try using\n`:?` instead if you are using a format string\n\n```\n\n한번 시도해보죠! `println!` 매크로 호출은 이제 `println!(\"rect1 is {:?}\", rect1);`처럼 보이게 될 것입니다. `{}` 내에 `:?` 명시자를 집어넣는 것은 `println!`에게 `Debug`라 불리우는 출력 포맷을 사용하고 싶다고 말해줍니다. `Debug`는 개발자에게 유용한 방식으로 우리의 구조체를 출력할 수 있도록 해줘서 우리 코드를 디버깅 하는 동안 그 값을 볼수 있게 해주는 트레잇입니다.\n\n이 변경을 가지고 코드를 실행해보세요. 젠장! 여전히 에러가 납니다:\n\n```text\n\nerror: the trait bound `Rectangle: std::fmt::Debug` is not satisfied\n\n```\n\n하지만 또다시, 컴파일러가 우리에게 도움말을 제공합니다:\n\n```text\n\nnote: `Rectangle` cannot be formatted using `:?`; if it is defined in your\ncrate, add `#[derive(Debug)]` or manually implement it\n\n```\n\n러스트는 디버깅 정보를 출력하는 기능을 포함하고 있는 것이 *맞지만*, 우리 구조체에 대하여 해당 기능을 활성화하도록 명시적인 사전동의를 해주어야 합니다. 그러기 위해서, Listing 11에서 보는 바와 같이 구조체 정의부분 바로 전에 `#[derive(Debug)]` 어노테이션을 추가합니다:\n\n```rust\n\n#[derive(Debug)]\nstruct Rectangle {\n    length: u32,\n    width: u32,\n}\n\nfn main() {\n    let rect1 = Rectangle { length: 50, width: 30 };\n\n    println!(\"rect1 is {:?}\", rect1);\n}\n\n```\n\nListing11: `Debug` 트레잇을 파생시키기 위한 어노테이션의 추가 및 디버그 포맷팅을 이용한 `Rectangle` 인스턴스의 출력\n\n이제 프로그램을 실행시키면, 에러는 사라지고 다음과 같은 출력을 보게될 것입니다:\n\n```text\n\nrect1 is Rectangle { length: 50, width: 30 }\n\n```\n\n좋아요! 이게 제일 예쁜 출력은 아니지만, 이 인스턴스를 위한 모든 필드의 값을 보여주는데, 이는 디버깅 하는 동안 분명히 도움이 될 것입니다. 우리가 더 큰 구조체를 가지게 됐을 때는, 읽기 좀 더 수월한 출력을 쓰는 것이 유용합니다; 그러한 경우, `println!` 스트링 내에 `{:?}` 대신 `{:#?}`을 사용할 수 있습니다. 예제 내에서 `{:#?}` 스타일을 이용하게 되면, 출력이 아래와 같이 생기게 될 것입니다:\n\n```rust\n\nrect1 is Rectangle {\n    length: 50,\n    width: 30\n}\n\n```\n\n러스트는 우리를 위해 `derive` 어노테이션을 이용한 여러 트레잇을 제공하여 우리의 커스텀 타입에 대해 유용한 동작을 추가할 수 있도록 해줍니다. 이 트레잇들과 그 동작들은 부록 C에서 그 목록을 찾을 수 있습니다.\n\n우리의 `area` 함수는 매우 특정되어 있습니다: 딱 사각형의 면적만 계산합니다. 이 동작을 우리의 `Rectangle` 구조체와 더 가까이 묶을 수 있다면 유용할텐데요, 그 이유는 이 함수가 다른 타입과는 작동하지 않기 때문입니다. `area` 함수를 `Rectangle` 타입 내에 정의된 `area` 메소드로 바꾸어서 이 코드를 어떻게 더 리팩터링할 수 있는지 살펴봅시다.','2022-09-05 12:27:07.223000','구조체',5),(6,'코드를 작성할 때, 열거형이 구조체보다 유용하고 적절하게 사용되는 상황에 대해서 살펴볼 것입니다. IP 주소를 다뤄야 하는 경우를 생각해 봅시다. 현재 IP 주소에는 두 개의 주요한 표준이 있습니다: 버전 4와 버전 6입니다. 프로그램에서 다룰 IP 주소의 경우의 수는 이 두 가지가 전부입니다: 모든 가능한 값들을 *나열(enumerate)* 할 수 있으며, 이 경우를 열거라고 부를 수 있습니다.\n\nIP 주소는 버전 4나 버전 6중 하나이며, 동시에 두 버전이 될 수는 없습니다. IP 주소의 속성을 보면 열거형 자료 구조가 적절합니다. 왜냐하면, 열거형의 값은 variants 중 하나만 될 수 있기 때문입니다. 버전 4나 버전 6은 근본적으로 IP 주소이기 때문에, 이 둘은 코드에서 모든 종류의 IP 주소에 적용되는 상황을 다룰 때 동일한 타입으로 처리되는 것이 좋습니다.\n\n`IpAddrKind` 이라는 열거형을 정의하면서 포함할 수 있는 IP 주소인 `V4` 과 `V6` 를 나열함으로써 이 개념을 코드에 표현할 수 있습니다. 이것들은 열거형의 *variants* 라고 합니다:\n\n```rust\n\nenum IpAddrKind {\n    V4,\n    V6,\n}\n\n```\n\n이제 `IpAddrKind` 은 우리의 코드 어디에서나 쓸 수 있는 데이터 타입이 되었습니다.\n\n### 열거형 값\n\n아래처럼 `IpAddrKind` 의 두 개의 variants 에 대한 인스턴스를 만들 수 있습니다:\n\n```rust\n\nlet four = IpAddrKind::V4;\nlet six = IpAddrKind::V6;\n\n```\n\n열거형의 variants 는 열거형을 정의한 식별자에 의해 이름 공간이 생기며, 두 개의 콜론을 사용하여 둘을 구분할 수 있습니다. `IpAddrKind::V4` 와 `IpAddrKind::V6` 의 값은 동일한 타입이기 때문에, 이 방식이 유용합니다: `IpAddrKind`. 이제 `IpAddrKind` 타입을 인자로 받는 함수를 정의할 수 있습니다:\n\n```rust\n\nfn route(ip_type: IpAddrKind) { }\n\n```\n\n그리고, variant 중 하나를 사용해서 함수를 호출할 수 있습니다:\n\n```rust\n\nroute(IpAddrKind::V4);\nroute(IpAddrKind::V6);\n\n```\n\n열거형을 사용하면 이점이 더 있습니다. IP 주소 타입에 대해 더 생각해 볼 때, 지금으로써는 실제 IP 주소 *데이터*를 저장할 방법이 없습니다. 단지 어떤 *종류* 인지만 알 뿐입니다. 구조체에 대해 방금 공부했다고 한다면, 이 문제를 Listing 1에서 보이는 것처럼 풀려고 할 것입니다:\n\n```rust\n\nenum IpAddrKind {\n    V4,\n    V6,\n}\n\nstruct IpAddr {\n    kind: IpAddrKind,\n    address: String,\n}\n\nlet home = IpAddr {\n    kind: IpAddrKind::V4,\n    address: String::from(\"127.0.0.1\"),\n};\n\nlet loopback = IpAddr {\n    kind: IpAddrKind::V6,\n    address: String::from(\"::1\"),\n};\n\n```\n\nListing 1: `struct` 를 사용해서 IP 주소의 데이터와 `IpAddrKind` variant 저장하기\n\n여기서 두 개의 필드를 갖는 `IpAddr` 를 정의했습니다: `IpAddrKind` 타입(이전에 정의한 열거형)인 `kind` 필드와 `String` 타입인 `address` 필드입니다. 구조체에 대한 두 개의 인스턴스가 있습니다. 첫 번째 `home` 은 `kind` 의 값으로 `IpAddrKind::V4` 을 갖고 연관된 주소 데이터로 `127.0.0.1` 를 갖습니다. 두 번째 `loopback` 은 `IpAddrKind` 의 다른 variant 인 `V6` 을 값으로 갖고, 연관된 주소로 `::1` 를 갖습니다. `kind` 와 `address` 의 값을 함께 사용하기 위해 구조체를 사용했습니다. 그렇게 함으로써 variant 가 연관된 값을 갖게 되었습니다.\n\n각 열거형 variant 에 데이터를 직접 넣는 방식을 사용해서 열거형을 구조체의 일부로 사용하는 방식보다 더 간결하게 동일한 개념을 표현할 수 있습니다. `IpAddr` 열거형의 새로운 정의에서는 두 개의 `V4` 와 `V6` variant 는 연관된 `String` 타입의 값을 갖게 됩니다.\n\n```rust\n\nenum IpAddr {\n    V4(String),\n    V6(String),\n}\n\nlet home = IpAddr::V4(String::from(\"127.0.0.1\"));\n\nlet loopback = IpAddr::V6(String::from(\"::1\"));\n\n```\n\n열거형의 각 variant 에 직접 데이터를 붙임으로써, 구조체를 사용할 필요가 없어졌습니다.\n\n구조체 보다 열거형을 사용할 때 다른 장점이 있습니다. 각 variant 는 다른 타입과 다른 양의 연관된 데이터를 가질 수 있습니다. 버전 4 타입의 IP 주소는 항상 0 ~ 255 사이의 숫자 4개로 된 구성요소를 갖게 될 것입니다. `V4` 주소에 4개의 `u8` 값을 저장하길 원하지만, V6 주소는 하나의 String 값으로 표현되길 원한다면, 구조체로는 이렇게 할 수 없습니다. 열거형은 이런 경우를 쉽게 처리합니다:\n\n```rust\n\nenum IpAddr {\n    V4(u8, u8, u8, u8),\n    V6(String),\n}\n\nlet home = IpAddr::V4(127, 0, 0, 1);\n\nlet loopback = IpAddr::V6(String::from(\"::1\"));\n\n```\n\n두 가지 다른 종류의 IP 주소를 저장하기 위해 코드상에서 열거형을 정의하는 몇 가지 방법을 살펴봤습니다. 그러나, 누구나 알듯이 IP 주소와 그 종류를 저장하는 것은 흔하기 때문에, [표준 라이브러리에 사용할 수 있는 정의가 있습니다!](https://doc.rust-lang.org/std/net/enum.IpAddr.html)\n\n표준 라이브러리에서 `IpAddr` 를 어떻게 정의하고 있는지 살펴봅시다.\n\n위에서 정의하고 사용했던 것과 동일한 열거형과 variant 를 갖고 있지만, variant 에 포함된 주소 데이터는 두 가지 다른 구조체로 되어 있으며, 각 variant 마다 다르게 정의하고 있습니다:\n\n```rust\n\nstruct Ipv4Addr {\n    // details elided\n}\n\nstruct Ipv6Addr {\n    // details elided\n}\n\nenum IpAddr {\n    V4(Ipv4Addr),\n    V6(Ipv6Addr),\n}\n\n```\n\n이 코드에서 보듯이 열거형 variant 에 어떤 종류의 데이터라도 넣을 수 있습니다: 예를 들면 문자열, 숫자 타입, 혹은 구조체. 다른 열거형 조차도 포함할 수 있습니다! 또한 표준 라이브러리 타입들은 어떤 경우에는 해결책으로 생각한 것보다 훨씬 더 복잡하지 않습니다.\n\n현재 스코프에 표준 라이브러리를 가져오지 않았기 때문에, 표준 라이브러리에 `IpAddr` 정의가 있더라도, 동일한 이름의 타입을 만들고 사용할 수 있습니다.\n\nListing 2 에 있는 열거형의 다른 예제를 살펴봅시다: 이 예제에서는 각 variants 에 다양한 유형의 타입들이 포함되어 있습니다:\n\n```rust\n\nenum Message {\n    Quit,\n    Move { x: i32, y: i32 },\n    Write(String),\n    ChangeColor(i32, i32, i32),\n}\n\n```\n\nListing 2: `Message` 열거형은 각 variants 가 다른 타입과 다른 양의 값을 저장함.\n\n이 열거형에는 다른 데이터 타입을 갖는 네 개의 variants 가 있습니다:\n\n- `Quit` 은 연관된 데이터가 전혀 없습니다.\n- `Move` 은 익명 구조체를 포함합니다.\n- `Write` 은 하나의 `String` 을 포함합니다.\n- `ChangeColor` 는 세 개의 `i32` 을 포함합니다.\n\nListing 2 에서 처럼 variants 로 열거형을 정의하는 것은 다른 종류의 구조체들을 정의하는 것과 비슷합니다. 열거형과 다른 점은 `struct` 키워드를 사용하지 않는다는 것과 모든 variants 가 `Message` 타입으로 그룹화된다는 것입니다. 아래 구조체들은 이전 열거형의 variants 가 갖는 것과 동일한 데이터를 포함할 수 있습니다:\n\n```rust\n\nstruct QuitMessage; // 유닛 구조체\nstruct MoveMessage {\n    x: i32,\n    y: i32,\n}\nstruct WriteMessage(String); // 튜플 구조체\nstruct ChangeColorMessage(i32, i32, i32); // 튜플 구조체\n\n```\n\n각기 다른 타입을 갖는 여러 개의 구조체를 사용한다면, 이 메시지 중 어떤 한 가지를 인자로 받는 함수를 정의하기 힘들 것입니다. Listing 2 에 정의한 `Message` 열거형은 하나의 타입으로 이것이 가능합니다.\n\n열거형과 구조체는 한 가지 더 유사한 점이 있습니다: 구조체에 `impl` 을 사용해서 메소드를 정의한 것처럼, 열거형에도 정의할 수 있습니다. 여기 `Message` 열거형에 에 정의한 `call` 이라는 메소드가 있습니다:\n\n```rust\n\nimpl Message {\n    fn call(&self) {\n        // 메소드 내용은 여기 정의할 수 있습니다.\n    }\n}\n\nlet m = Message::Write(String::from(\"hello\"));\nm.call();\n\n```\n\n열거형의 값을 가져오기 위해 메소드 안에서 `self` 를 사용할 것입니다. 이 예제에서 생성한 변수 `m` 은 `Message::Write(String::from(\"hello\"))` 값을 갖게 되고, 이 값은 `m.call()`이 실행될 때, `call` 메소드 안에서 `self`가 될 것입니다.\n\n표준 라이브러리에 있는 매우 흔하게 사용하고 유용한 열거형을 살펴봅시다: `Option`.\n\n### `[Option` 열거형과 Null 값 보다 좋은 점들.](https://rinthel.github.io/rust-lang-book-ko/ch06-01-defining-an-enum.html#option-%EC%97%B4%EA%B1%B0%ED%98%95%EA%B3%BC-null-%EA%B0%92-%EB%B3%B4%EB%8B%A4-%EC%A2%8B%EC%9D%80-%EC%A0%90%EB%93%A4)\n\n이전 절에서, `IpAddr` 열거형을 사용하여 작성한 프로그램에서는 러스트 타입 시스템을 사용하여 데이터뿐만 아니라 더 많은 정보를 담을 수 있는 방법을 살펴보았습니다.\n\n이번 절에서는 표준 라이브러리에서 열거형으로 정의된 또 다른 타입인 `Option` 에 대한 사용 예를 살펴볼 것입니다. `Option` 타입은 많이 사용되는데, 값이 있거나 없을 수도 있는 아주 흔한 상황을 나타내기 때문입니다. 이 개념을 타입 시스템의 관점으로 표현하자면, 컴파일러가 발생할 수 있는 모든 경우를 처리했는지 체크할 수 있습니다. 이렇게 함으로써 버그를 방지할 수 있고, 이것은 다른 프로그래밍 언어에서 매우 흔합니다.\n\n프로그래밍 언어 디자인은 가끔 어떤 특성들이 포함되었는지의 관점에서 생각되기도 하지만, 포함되지 않은 특성들도 역시 중요합니다. 러스트는 다른 언어들에서 흔하게 볼 수 있는 null 특성이 없습니다. *Null* 은 값이 없다는 것을 표현하는 하나의 값입니다. null 을 허용하는 언어에서는, 변수는 항상 두 상태중 하나가 될 수 있습니다: null 혹은 null 이 아님.\n\nnull 을 고안한 Tony Hoare 의 \"Null 참조 : 10 억 달러의 실수\"에서 다음과 같이 말합니다:\n\n> 나는 그것을 나의 10억 달러의 실수라고 생각한다. 그 당시 객체지향 언어에서 처음 참조를 위한 포괄적인 타입 시스템을 디자인하고 있었다. 내 목표는 컴파일러에 의해 자동으로 수행되는 체크를 통해 모든 참조의 사용은 절대적으로 안전하다는 것을 확인하는 것이었다. 그러나 null 참조를 넣고 싶은 유혹을 참을 수 없었다. 간단한 이유는 구현이 쉽다는 것이었다. 이것은 수없이 많은 오류와 취약점들, 시스템 종료를 유발했고, 지난 40년간 10억 달러의 고통과 손실을 초래했을 수도 있다.\n> \n\nnull 값으로 발생하는 문제는, null 값을 null 이 아닌 값처럼 사용하려고 할 때 여러 종류의 오류가 발생할 수 있다는 것입니다. null이나 null이 아닌 속성은 어디에나 있을 수 있고, 너무나도 쉽게 이런 종류의 오류를 만들어 냅니다.\n\n그러나, null 이 표현하려고 하는 것은 아직까지도 유용합니다: null 은 현재 어떤 이유로 유효하지 않고, 존재하지 않는 하나의 값입니다.\n\n문제는 실제 개념에 있기보다, 특정 구현에 있습니다. 이와 같이 러스트에는 null 이 없지만, 값의 존재 혹은 부재의 개념을 표현할 수 있는 열거형이 있습니다. 이 열거형은 `Option<T>` 이며, 다음과 같이 [표준 라이브러리에 정의되어](https://doc.rust-lang.org/std/option/enum.Option.html) 있습니다:\n\n```rust\n\nenum Option<T> {\n    Some(T),\n    None,\n}\n\n```\n\n`Option<T>` 열거형은 매우 유용하며 기본적으로 포함되어 있기 때문에, 명시적으로 가져오지 않아도 사용할 수 있습니다. 또한 variants 도 마찬가지입니다: `Option::` 를 앞에 붙이지 않고, `Some` 과 `None` 을 바로 사용할 수 있습니다. `Option<T>` 는 여전히 일반적인 열거형이고, `Some(T)` 과 `None` 도 여전히 `Option<T>` 의 variants 입니다.\n\n`<T>` 는 러스트의 문법이며 아직 다루지 않았습니다. 제너릭 타입 파라미터이며, 제너릭에 대해서는 나중에 더 자세히 다룰 것입니다. 지금은 단지 `<T>` 가 `Option` 열거형의 `Some` variant 가 어떤 타입의 데이터라도 가질 수 있다는 것을 의미한다는 것을 알고 있으면 됩니다. 여기 숫자 타입과 문자열 타입을 갖는 `Option` 값에 대한 예들이 있습니다:\n\n```rust\n\nlet some_number = Some(5);\nlet some_string = Some(\"a string\");\n\nlet absent_number: Option<i32> = None;\n\n```\n\n`Some` 이 아닌 `None` 을 사용한다면, `Option<T>` 이 어떤 타입을 가질지 러스트에게 알려줄 필요가 있습니다. 컴파일러는 `None` 만 보고는 `Some` variant 가 어떤 타입인지 추론할 수 없습니다.\n\n`Some` 값을 얻게 되면, 값이 있다는 것과 `Some` 이 갖고 있는 값에 대해 알 수 있습니다. `None` 값을 사용하면, 어떤 면에서는 null 과 같은 의미를 갖게 됩니다: 유효한 값을 갖지 않습니다. 그렇다면 왜 `Option<T>` 가 null 을 갖는 것보다 나을까요?\n\n간단하게 말하면, `Option<T>` 와 `T` (`T` 는 어떤 타입이던 될 수 있음)는 다른 타입이며, 컴파일러는 `Option<T>` 값을 명확하게 유효한 값처럼 사용하지 못하도록 합니다. 예를 들면, 아래 코드는 `Option<i8>` 에 `i8` 을 더하려고 하기 때문에 컴파일되지 않습니다:\n\n```rust\n\nlet x: i8 = 5;\nlet y: Option<i8> = Some(5);\n\nlet sum = x + y;\n\n```\n\n이 코드를 실행하면, 아래와 같은 에러 메시지가 출력됩니다:\n\n```\n\nerror[E0277]: the trait bound `i8: std::ops::Add<std::option::Option<i8>>` is\nnot satisfied\n -->\n  |\n7 | let sum = x + y;\n  |           ^^^^^\n  |\n\n```\n\n주목하세요! 실제로, 이 에러 메시지는 러스트가 `Option<i8>` 와 `i8` 를 어떻게 더해야 하는지 모른다는 것을 의미하는데, 둘은 다른 타입이기 때문입니다. 러스트에서 `i8` 과 같은 타입의 값을 가질 때, 컴파일러는 항상 유효한 값을 갖고 있다는 것을 보장할 것입니다. 값을 사용하기 전에 null 인지 확인할 필요도 없이 자신 있게 사용할 수 있습니다. 단지 `Option<i8>` 을 사용할 경우엔 (혹은 어떤 타입 이건 간에) 값이 있을지 없을지에 대해 걱정할 필요가 있으며, 컴파일러는 값을 사용하기 전에 이런 케이스가 처리되었는지 확인해 줄 것입니다.\n\n다르게 얘기하자면, `T` 에 대한 연산을 수행하기 전에 `Option<T>` 를 `T` 로 변환해야 합니다. 일반적으로, 이런 방식은 null 과 관련된 가장 흔한 이슈 중 하나를 발견하는데 도움을 줍니다: 실제로 null 일 때, null 이 아니라고 가정하는 경우입니다.\n\nnull 이 아닌 값을 갖는다는 가정을 놓치는 경우에 대해 걱정할 필요가 없게 되면, 코드에 더 확신을 갖게 됩니다. null 일 수 있는 값을 사용하기 위해서, 명시적으로 값의 타입을 `Option<T>` 로 만들어 줘야 합니다. 그다음엔 값을 사용할 때 명시적으로 null 인 경우를 처리해야 합니다. 값의 타입이 `Option<T>` 가 아닌 모든 곳은 값이 null 아 아니라고 안전하게 *가정할 수 있습니다*. 이것은 null을 너무 많이 사용하는 문제를 제한하고 러스트 코드의 안정성을 높이기 위한 러스트의 의도된 디자인 결정사항입니다.\n\n그럼 `Option<T>` 타입인 값을 사용할 때, `Some` variant 에서 `T` 값을 어떻게 가져와서 사용할 수 있을까요? `Option<T>` 열거형에서 다양한 상황에서 유용하게 사용할 수 있는 많은 메소드들이 있습니다; [문서에서](https://doc.rust-lang.org/std/option/enum.Option.html) 확인할 수 있습니다. `Option<T>` 의 메소드들에 익숙해지는 것은 러스트를 사용하는데 매우 유용할 것입니다.\n\n일반적으로, `Option<T>` 값을 사용하기 위해서는 각 variant 를 처리할 코드가 필요할 것입니다. `Some(T)` 값일 경우만 실행되는 코드가 필요하고, 이 코드는 안에 있는 `T` 를 사용할 수 있습니다. 다른 코드에서는 `None` 값일 때 실행되는 코드가 필요가 하기도 하며, 이 코드에서는 사용할 수 있는 `T` 값이 없습니다. `match` 표현식은 제어 흐름을 위한 구분으로, 열거형과 함께 사용하면 이런 일들을 할 수 있습니다: 열거형이 갖는 variant 에 따라 다른 코드를 실행할 것이고, 그 코드는 매칭 된 값에 있는 데이터를 사용할 수 있습니다.','2022-09-05 12:32:00.377000','열거형',6),(7,'### 값을 해체하여 분리하기\n\n우린 패턴을 이용해 구조체, 열거형, 튜플, 참조자 등의 값들을 해체(destructuring)할 수도 있습니다. 각각에 대해 알아봅시다.\n\n### 구조체 해체하기\n\nListing 12 는 `x` 와 `y` 두개의 필드를 가진 `Point` 구조체를 나타냅니다. 이는 `let` 구문과 패턴을 이용해 이를 해체해봅시다:\n\n```rust\n\nstruct Point {\n    x: i32,\n    y: i32,\n}\n\nfn main() {\n    let p = Point { x: 0, y: 7 };\n\n    let Point { x: a, y: b } = p;\n    assert_eq!(0, a);\n    assert_eq!(7, b);\n}\n\n```\n\nListing 12: 구조체의 필드를 여러 분리된 변수로 해체하기\n\n이 코드는 `p` 변수의 필드인 `x` 와 `y` 에 각각 대응되는 `a` 와 `b` 변수를 생성합니다. 이 예시를 보면 패턴 내 변수의 이름이 꼭 구조체의 필드명과 일치할 필요는 없다는 것을 알 수 있습니다. 하지만 해당 변수가 어떤 필드를 나타내는지 기억하기 쉽도록 필드명과 일치하도록 작성하는게 일반적입니다.\n\n다만 일치하도록 작성할 때 `let Point { x: x, y: y } = p;` 는 `x` 와 `y` 이 중복됩니다. 여러분은 이때, 즉 패턴이 구조체 필드명과 일치할때 약칭 구문을 사용할 수 있습니다: 여러분은 구조체 필드명을 나열하는 것만으로 해당 필드의 값을 가진 변수를 만들어낼 수 있습니다. Listing 13 은 Listing 12 의 코드를 `let` 패턴내의 `a` 와 `b` 대신 `x` 와 `y` 변수를 사용하도록 변경한 예시입니다.\n\n```rust\n\nstruct Point {\n    x: i32,\n    y: i32,\n}\n\nfn main() {\n    let p = Point { x: 0, y: 7 };\n\n    let Point { x, y } = p;\n    assert_eq!(0, x);\n    assert_eq!(7, y);\n}\n\n```\n\nListing 13: 약칭 구문을 이용해 구조체 필드 해체하기\n\n이 코드는 `p` 변수의 `x` 와 `y` 필드에 대응되는 `x` 와 `y` 변수를 만들어냅니다. 결과는 `x` 와 `y` 변수가 `p` 구조체 내의 값을 갖는 것으로 나옵니다.\n\n또한, 모든 필드에 대응하는 변수를 만들지 않고 구조체 패턴의 일부에 리터럴 값을 이용해 해체할 수도 있습니다. 이렇게 함으로써 어떤 필드가 특정 값에 해당하는지를 검사하면서 나머지 필드를 해체한 변수를 만들 수 있습니다.\n\nListing 14 는 `Poin` 값을 3가지 경우로 나눈 `match` 표현을 나타냅니다: `x` 축 위의 점(`y = 0` 일때 참) 인 경우, `y` 축 위인 경우(`x = 0`), 혹은 그 외일 경우:\n\n```rust\n\nfn main() {\n    let p = Point { x: 0, y: 7 };\n\n    match p {\n        Point { x, y: 0 } => println!(\"On the x axis at {}\", x),\n        Point { x: 0, y } => println!(\"On the y axis at {}\", y),\n        Point { x, y } => println!(\"On neither axis: ({}, {})\", x, y),\n    }\n}\n\n```\n\nListing 14: 한 패턴 내에서 해체와 리터럴 값 매칭\n\n첫 번째 갈래는 `x` 축 위의 점인 경우에 해당하기에, `y` 필드가 `0` 값과 매치될 경우에 매치될 수 있도록 하였습니다. 또한 패턴은 여전히 `x` 변수를 생성하기 때문에 해당 변수를 갈래 내 코드에 사용할 수 있습니다.\n\n비슷하게, 두 번째 갈래는 `x` 필드를 `0` 값과 매치시킬 경우에 매치되도록 하여 `y` 축 위의 점인지 판별합니다. 마찬가지로 `y` 필드에 해당하는 `y` 변수도 생성됩니다. 세 번째 갈래는 어떤 리터럴도 특정하지 않습니다. 따라서 모든 `Point` 에 매치되고 모든 `x` 와 `y` 필드에 대한 변수를 생성합니다.\n\n이 예제에서 `p` 값은 `x` 가 `0` 이기 떄문에 두 번째 갈래에 매치됩니다. 따라서 이 코드는 `On the y axis at 7` 를 출력합니다.\n\n### 열거형 해체\n\n우린 이미 열거형을 해체해 봤습니다. 다만 한 가지 다루지 않은 내용이 있는데, 열거형을 해체하기 위한 패턴은 해당 열거형에 내장된 데이터의 정의 방식과 일치해야 합니다. 예시를 들기 위해, Listing 15 에 Listing 2 에서 사용했던 `Message` 열거형을 이용하고 각 내부 값을 해체하기 위한 `match` 패턴을 작성했습니다:\n\n```rust\n\nenum Message {\n    Quit,\n    Move { x: i32, y: i32 },\n    Write(String),\n    ChangeColor(i32, i32, i32),\n}\n\nfn main() {\n    let msg = Message::ChangeColor(0, 160, 255);\n\n    match msg {\n        Message::Quit => {\n            println!(\"The Quit variant has no data to destructure.\")\n        },\n        Message::Move { x, y } => {\n            println!(\n                \"Move in the x direction {} and in the y direction {}\",\n                x,\n                y\n            );\n        }\n        Message::Write(text) => println!(\"Text message: {}\", text),\n        Message::ChangeColor(r, g, b) => {\n            println!(\n                \"Change the color to red {}, green {}, and blue {}\",\n                r,\n                g,\n                b\n            )\n        }\n    }\n}\n\n```\n\nListing 15: 다른 종류의 값들을 갖는 열거형 variant 해체\n\n이 코드는 `Change the color to red 0, green 160, and blue 255` 를 출력합니다. 한번 `msg` 값을 이리저리 변경해보고 다른 갈래들을 실행시켜보세요.\n\n아무 값도 갖지 않는 `Message::Quit` 같은 variant 는 값을 해체할 수 없습니다. 따라서 리터럴 `Message::Quit` 값만 매치시킬 수 있으며, 패턴 내의 변수는 없습니다.\n\n`Message::Move` 등의 유사 구조체 variant 의 경우는 우리가 구조체를 매칭시킬때의 패턴과 유사한 패턴을 사용합니다. variant 명 뒤에 중괄호를 작성하고, 해당 갈래에서 사용할 변수를 나타내는 필드들을 나열합니다. 이땐 Listing 13 에서 사용했던 약칭 구문을 사용했습니다.\n\n하나의 요소를 가진 `Message::Write` 튜플과 세 개의 요소를 가진 `Message::ChangeColor` 튜플 등의 유사 튜플 variant 에 사용하는 패턴은 튜플을 매치시킬때 지정한 패턴과 유사합니다. 이때 패턴 내 변수의 개수는 우리가 매칭하려는 variant 내 요소의 개수와 일치해야합니다.\n\n### 참조자 해체\n\n우리가 패턴과 매칭하려는 값이 참조자를 포함하고 있을 땐 패턴 내에서 `&` 를 사용해 값으로부터 참조자를 해체해야 합니다. 이렇게 하면 참조자를 갖는 변수를 가져오는 대신 참조자가 가리키는 값을 갖는 변수를 가져올 수 있습니다. 이는 참조자들을 반복하는 반복자에서 클로저를 사용할 때, 해당 클로저 내에서 참조자가 아닌 참조자가 가리키는 값을 사용하길 원할 경우에 유용합니다.\n\nListing 16 의 예시는 `vector` 내의 `Point` 객체들을 가리키는 참조자들을 반복하며 구조체 참조자를 해체하는 것으로 간단하게 `x` 와 `y` 값을 계산할 수 있습니다:\n\n```rust\n\nlet points = vec![\n    Point { x: 0, y: 0 },\n    Point { x: 1, y: 5 },\n    Point { x: 10, y: -3 },\n];\n\nlet sum_of_squares: i32 = points\n    .iter()\n    .map(|&Point { x, y }| x * x + y * y)\n    .sum();\n\n```\n\nListing 16: 구조체 참조자를 구조체 필드 값들로 해체하기\n\n이 코드의 `sum_of_squares` 변수는 135 의 값을 갖습니다. 이 값은 `points` 벡터 내 `Point` 각각의 `x` 와 `y` 값을 제곱하고, 더한 값들을 모두 합친 값입니다.\n\n만약 `&Point { x, y }` 에서 `&` 를 뺀다면 타입 불일치(type mismatch) 오류가 발생합니다. `iter` 는 벡터 내 요소들의 실제 값이 아닌 참조자이기 때문입니다. 실제 오류는 다음과 같습니다:\n\n```\n\nerror[E0308]: mismatched types\n  -->\n   |\n14 |         .map(|Point { x, y }| x * x + y * y)\n   |               ^^^^^^^^^^^^ expected &Point, found struct `Point`\n   |\n   = note: expected type `&Point`\n              found type `Point`\n\n```\n\n이 오류는 러스트에선 클로저에서 `&Point` 를 사용하길 원했지만, 우리가 `Point` 참조자가 가리키는 값이 아니라 `Point` 값을 직접 매치시키려고 시도했기 때문입니다.\n\n### 구조체와 튜플 해체\n\n우린 패턴 해체를 더 복잡한 방법으로 섞고, 비교하고, 중첩시킬 수 있습니다. 다음 예제는 튜플 내에 구조체와 튜플을 갖는, 즉 중첩된 구조에서 본래 값을 얻는 복잡한 해체를 보여줍니다:\n\n```rust\n\nlet ((feet, inches), Point {x, y}) = ((3, 10), Point { x: 3, y: -10 });\n\n```\n\n이 코드는 우리가 복잡한 타입의 컴포넌트를 분리하고 각각의 값을 사용할 수 있게 합니다.\n\n패턴을 이용한 해체는 구조체의 각 필드값과 같은 일부의 값을 서로 별도로 사용하는 편리한 방법입니다.','2022-09-05 12:33:47.485000','해체-구조체,열거형',7),(8,'## 벡터\n\n우리가 보게될 첫번째 콜렉션은 *벡터*라고도 알려진 `Vec<T>`입니다. 벡터는 메모리 상에 서로 이웃하도록 모든 값을 집어넣는 단일 데이터 구조 안에 하나 이상의 값을 저장하도록 해줍니다. 벡터는 같은 타입의 값만을 저장할 수 있습니다. 이는 여러분이 파일 내의 텍스트의 라인들이라던가 장바구니의 아이템 가격들 같은 아이템 리스트를 저장하는 상황일 경우 유용합니다.\n\n### 새 벡터 만들기\n\n비어있는 새 벡터를 만들기 위해서는, 아래의 Listing 1과 같이 `Vec::new` 함수를 호출해 줍니다:\n\n```rust\n\nlet v: Vec<i32> = Vec::new();\n\n```\n\nListing 1: `i32` 타입의 값을 가질 수 있는 비어있는 새 벡터 생성\n\n여기에 타입 명시(type annotation)를 추가한 것을 주목하세요. 이 벡터에 어떠한 값도 집어넣지 않았기 때문에, 러스트는 우리가 저장하고자 하는 요소의 종류가 어떤 것인지 알지 못합니다. 이는 중요한 지점입니다. 벡터는 제네릭(generic)을 이용하여 구현되었습니다; 제네릭을 이용하여 여러분만의 타입을 만드는 방법은 제너릭 부분에서 다룰 것입니다. 지금 당장은, 표준 라이브러리가 제공하는 `Vec`타입은 어떠한 종류의 값이라도 저장할 수 있다는 것, 그리고 특정한 벡터는 특정한 타입의 값을 저장할 때, 이 타입은 꺾쇠 괄호(<>) 안에 적는다는 것만 알아두세요. Listing 1에서는 러스트에게 `v` 안의 `Vec`가 `i32` 타입의 요소를 가질 것이고 알려주었습니다.\n\n일단 우리가 값을 집어넣으면 러스트는 우리가 저장하고자 하는 값의 타입을 대부분 유추할 수 있으므로, 좀 더 현실적인 코드에서는 이러한 타입 명시를 할 필요가 거의 없습니다. 초기값들을 갖고 있는 `Vec<T>`을 생성하는 것이 더 일반적이며, 러스트는 편의를 위해 `vec!` 매크로를 제공합니다. 이 매크로는 우리가 준 값들을 저장하고 있는 새로운 `Vec`을 생성합니다. Listing 2는 `1`, `2`, `3`을 저장하고 있는 새로운 `Vec<i32>`을 생성할 것입니다:\n\n```rust\n\nlet v = vec![1, 2, 3];\n\n```\n\nListing 2: 값을 저장하고 있는 새로운 벡터 생성하기\n\n초기 `i32` 값들을 제공했기 때문에, 러스트는 `v`가 `Vec 타입이라는 것을 유추할 수 있으며, 그래서 타입 명시는 필요치 않습니다. 다음은, 벡터를 어떻게 수정하는지를 살펴보겠습니다.\n\n### 벡터 갱신하기\n\n벡터를 만들고 여기에 요소들을 추가하기 위해서는 아래 Listing 3과 같이 `push` 메소드를 사용할 수 있습니다:\n\n```rust\n\nlet mut v = Vec::new();\n\nv.push(5);\nv.push(6);\nv.push(7);\nv.push(8);\n\n```\n\nListing 3: `push` 메소드를 사용하여 벡터에 값을 추가하기\n\n어떤 변수에 대해 그 변수가 담고 있는 값이 변경될 수 있도록 하려면, `mut` 키워드를 사용하여 해당 변수를 가변으로 만들어 줄 필요가 있습니다. 우리가 집어넣는 숫자는 모두 `i32` 타입이며, 러스트는 데이터로부터 이 타입을 추론하므로, 우리는 `Vec<i32>` 명시를 붙일 필요가 없습니다.\n\n### 벡터를 드롭하는 것은 벡터의 요소들을 드롭시킵니다\n\n`struct`와 마찬가지로, Listing 4에 달려있는 주석처럼 벡터도 스코프 밖으로 벗어났을 때 해제됩니다:\n\n```\n\n{\n    let v = vec![1, 2, 3, 4];\n\n    // v를 가지고 뭔가 합니다\n\n} // <- v가 스코프 밖으로 벗어났고, 여기서 해제됩니다\n\n```\n\nListing 4: 벡터와 벡터의 요소들이 드롭되는 곳을 보여주기\n\n벡터가 드롭될 때 벡터의 내용물 또한 전부 드롭되는데, 이는 벡터가 가지고 있는 정수들이 모두 제거된다는 의미입니다. 이는 직관적인 것처럼 보일 수도 있겠지만 벡터의 요소들에 대한 참조자를 만들때는 좀 더 복잡해 질 수 있습니다. 다음으로 이런 상황을 파해쳐 봅시다!\n\n### 벡터의 요소들 읽기\n\n지금까지 벡터를 만들고, 갱신하고, 없애는 방법에 대해 알아보았으니, 벡터의 내용물을 읽어들이는 방법을 알아보는 것이 다음 단계로 좋아보입니다. 벡터 내에 저장된 값을 참조하는 두 가지 방법이 있습니다. 예제에서는 특별히 더 명료하게 하기 위해 함수들이 반환하는 값의 타입을 명시했습니다.\n\nListing 5는 인덱스 문법이나 `get` 메소드를 가지고 벡터의 값에 접근하는 두 방법 모두를 보여주고 있습니다:\n\n```rust\n\nlet v = vec![1, 2, 3, 4, 5];\n\nlet third: &i32 = &v[2];\nlet third: Option<&i32> = v.get(2);\n\n```\n\nListing 5: 인덱스 문법 혹은 `get` 메소드를 사용하여 벡터 내의 아이템에 접근하기\n\n두가지 세부사항을 주목하세요. 첫번째로, 인덱스값 `2`를 사용하면 세번째 값이 얻어집니다: 벡터는 0부터 시작하는 숫자로 인덱스됩니다. 두번째로, 세번째 요소를 얻기 위해 두 가지 다른 방법이 사용되었습니다: `&`와 `[]`를 이용하여 참조자를 얻은 것과, `get` 함수에 인덱스를 파라미터로 넘겨서 `Option<&T>`를 얻은 것입니다.\n\n러스트가 벡터 요소를 참조하는 두가지 방법을 제공하는 이유는 여러분이 벡터가 가지고 있지 않은 인덱스값을 사용하고자 했을 때 프로그램이 어떻게 동작할 것인지 여러분이 선택할 수 있도록 하기 위해서입니다. 예를 들어, 아래의 Listing 6과 같이 5개의 요소를 가지고 있는 벡터가 있고 100 인덱스에 있는 요소에 접근하려고 시도한 경우 프로그램은 어떻게 동작해야 할까요:\n\n```rust\n\nlet v = vec![1, 2, 3, 4, 5];\n\nlet does_not_exist = &v[100];\nlet does_not_exist = v.get(100);\n\n```\n\nListing 6: 5개의 요소를 가진 벡터에 100 인덱스에 있는 요소에 접근하기\n\n이 프로그램을 실행하면, 첫번째의 `[]` 메소드는 `panic!`을 일으키는데, 이는 존재하지 않는 요소를 참조하기 때문입니다. 이 방법은 여러분의 프로그램이 벡터의 끝을 넘어서는 요소에 접근하는 시도를 하면 프로그램이 죽게끔 하는 치명적 에러를 발생하도록 하기를 고려하는 경우 가장 좋습니다.\n\n`get` 함수에 벡터 범위를 벗어난 인덱스가 주어졌을 때는 패닉 없이 `None`이 반환됩니다. 보통의 환경에서 벡터의 범위 밖에 있는 요소에 접근하는 것이 종종 발생한다면 이 방법을 사용할만 합니다. 여러분의 코드는`Some(&element)` 혹은 `None`에 대해 다루는 로직을 갖추어야 합니다. 예를 들어 인덱스는 사람이 직접 번호를 입력하는 것으로 들어올 수도 있습니다. 만일 사용자가 잘못하여 너무 큰 숫자를 입력하여 프로그램이 `None` 값을 받았을 경우, 여러분은 사용자에게 현재 `Vec`에 몇개의 아이템이 있으며 유효한 값을 입력할 또한번의 기회를 줄 수도 있습니다. 이런 편이 오타 때문에 프로그램이 죽는 것 보다는 더 사용자 친화적이겠죠!\n\n### 유효하지 않은 참조자\n\n프로그램이 유효한 참조자를 얻을 때, 빌림 검사기(borrow checker)가  소유권 및 빌림 규칙을 집행하여 이 참조자와 벡터의 내용물로부터 얻은 다른 참조자들이 계속 유효하게 남아있도록 확실히 해줍니다. 같은 스코프 내에서 가변 참조자와 불변 참조자를 가질 수 없다는 규칙을 상기하세요. 이 규칙은 아래 예제에서도 적용되는데, Listing7에서는 벡터의 첫번째 요소에 대한 불변 참조자를 얻은 뒤 벡터의 끝에 요소를 추가하고자 했습니다:\n\n```rust\n\nlet mut v = vec![1, 2, 3, 4, 5];\n\nlet first = &v[0];\n\nv.push(6);\n\n```\n\nListing 7: 아이템에 대한 참조자를 가지는 동안 벡터에 요소 추가 시도하기\n\n이 예제를 컴파일하면 아래와 같은 에러가 발생합니다:\n\n```\n\nerror[E0502]: cannot borrow `v` as mutable because it is also borrowed as\nimmutable\n  |\n4 | let first = &v[0];\n  |              - immutable borrow occurs here\n5 |\n6 | v.push(6);\n  | ^ mutable borrow occurs here\n7 | }\n  | - immutable borrow ends here\n\n```\n\nListing 7의 코드는 동작을 해야만 할것처럼 보일 수도 있습니다: 왜 첫번째 요소에 대한 참조자가 벡터 끝에 대한 변경을 걱정해야 하죠? 이 에러에 대한 내막은 벡터가 동작하는 방법 때문입니다: 새로운 요소를 벡터의 끝에 추가하는 것은 새로 메모리를 할당하여 예전 요소를 새 공간에 복사하는 일을 필요로 할 수 있는데, 이는 벡터가 모든 요소들을 붙여서 저장할 공간이 충분치 않는 환경에서 일어날 수 있습니다. 이러한 경우, 첫번째 요소에 대한 참조자는 할당이 해제된 메모리를 가리키게 될 것입니다. 빌림 규칙은 프로그램이 이러한 상황에 빠지지 않도록 해줍니다.\n\n> 노트: Vec<T> 타입의 구현 세부사항에 대한 그밖의 것에 대해서는 https://doc.rust-lang.org/stable/nomicon/vec.html 에 있는 노미콘(The Nomicon)을 보세요:\n> \n\n### 벡터 내의 값들에 대한 반복처리\n\n만일 벡터 내의 각 요소들을 차례대로 접근하고 싶다면, 하나의 값에 접근하기 위해 인덱스를 사용하는것 보다는, 모든 요소들에 대해 반복처리를 할 수 있습니다. Listing 8은 `for` 루프를 사용하여 `i32`의 벡터 내에 있는 각 요소들에 대한 불변 참조자를 얻어서 이를 출력하는 방법을 보여줍니다:\n\n```rust\n\nlet v = vec![100, 32, 57];\nfor i in &v {\n    println!(\"{}\", i);\n}\n\n```\n\nListing 8: `for` 루프를 이용한 요소들에 대한 반복작업을 통해 각 요소들을 출력하기\n\n만일 모든 요소들을 변형시키길 원한다면 가변 벡터 내의 각 요소에 대한 가변 참조자로 반복작업을 할 수도 있습니다. Listing 9의 `for` 루프는 각 요소에 `50`을 더할 것입니다:\n\n```rust\n\nlet mut v = vec![100, 32, 57];\nfor i in &mut v {\n    *i += 50;\n}\n\n```\n\nListing 9: 벡터 내의 요소에 대한 가변 참조자로 반복하기\n\n가변 참조자가 참고하고 있는 값을 바꾸기 위해서, `i`에 `+=` 연산자를 이용하기 전에 역참조 연산자 (`*`)를 사용하여 값을 얻어야 합니다.\n\n### 열거형을 사용하여 여러 타입을 저장하기\n\n이 장의 시작 부분에서, 벡터는 같은 타입을 가진 값들만 저장할 수 있다고 이야기했습니다. 이는 불편할 수 있습니다; 다른 타입의 값들에 대한 리스트를 저장할 필요가 있는 상황이 분명히 있지요. 다행히도, 열거형의 variant는 같은 열거형 타입 내에 정의가 되므로, 백터 내에 다른 타입의 값들을 저장할 필요가 있다면 열거형을 정의하여 사용할 수 있습니다!\n\n예를 들어, 스프레드시트의 행으로부터 값들을 가져오고 싶은데, 여기서 어떤 열은 정수를, 어떤 열은 실수를, 어떤 열은 스트링을 갖고 있다고 해봅시다. 우리는 다른 타입의 값을 가지는 variant가 포함된 열거형을 정의할 수 있고, 모든 열거형 variant들은 해당 열거형 타입, 즉 같은 타입으로 취급될 것입니다. 따라서 우리는 궁극적으로 다른 타입을 담은 열거형 값에 대한 벡터를 생성할 수 있습니다. Listing 10에서 이를 보여주고 있습니다:\n\n```rust\n\nenum SpreadsheetCell {\n    Int(i32),\n    Float(f64),\n    Text(String),\n}\n\nlet row = vec![\n    SpreadsheetCell::Int(3),\n    SpreadsheetCell::Text(String::from(\"blue\")),\n    SpreadsheetCell::Float(10.12),\n];\n\n```\n\nListing 10: 열거형을 정의하여 벡터 내에 다른 타입의 데이터를 담을 수 있도록 하기\n\n러스트가 컴파일 타임에 벡터 내에 저장될 타입이 어떤 것인지 알아야할 필요가 있는 이유는 각 요소를 저장하기 위해 얼만큼의 힙 메모리가 필요한지 알기 위함입니다. 부차적인 이점은 이 백터에 허용되는 타입에 대해 명시적일 수 있다는 점입니다. 만일 러스트가 어떠한 타입이든 담을수 있는 벡터를 허용한다면, 벡터 내의 각 요소마다 수행되는 연산에 대해 하나 혹은 그 이상의 타입이 에러를 야기할 수도 있습니다. 열거형과 `match` 표현식을 사용한다는 것은 러스트가 컴파일 타임에 모든 가능한 경우에 대해 처리한다는 것을 보장해준다는 의미입니다.\n\n만약 프로그램을 작성할 때 여러분의 프로그램이 런타임에 벡터에 저장하게 될 타입의 모든 경우를 알지 못한다면, 열거형을 이용한 방식은 사용할 수 없을 것입니다. 대신 트레잇 객체(trait object)를 이용할 수 있습니다.\n\n지금까지 벡터를 이용하는 가장 일반적인 방식 중 몇가지에 대해 논의했는데, 표준 라이브러리의 `Vec`에 정의된 수많은 유용한 메소드들이 있으니 API 문서를 꼭 살펴봐 주시기 바랍니다. 예를 들면, `push`에 더해서, `pop` 메소드는 제일 마지막 요소를 반환하고 지워줍니다. 다음 콜렉션 타입인 `String`으로 넘어갑시다!','2022-09-05 12:35:20.978000','벡터',8),(9,'이미 스트링에 관한 이야기를 했습니다만, 지금은 좀 더 깊이 살펴보겠습니다. 새로운 러스트인들은 흔히들 스트링 부분에서 막히는데 이는 세 가지 개념의 조합으로 인한 것입니다: 가능한 에러를 꼭 노출하도록 하는 러스트의 성향, 많은 프로그래머의 예상보다 더 복잡한 데이터 구조인 스트링, 그리고 UTF-8입니다. 다른 언어들을 사용하다 왔을 때 이 개념들의 조합이 러스트의 스트링을 어려운 것처럼 보이게 합니다.\n\n스트링이 컬렉션 장에 있는 이유는 스트링이 바이트의 컬렉션 및 이 바이트들을 텍스트로 통역할때 유용한 기능을 제공하는 몇몇 메소드로 구현되어 있기 때문입니다. 이번 절에서는 생성, 갱신, 값 읽기와 같은 모든 컬렉션 타입이 가지고 있는, `String`에서의 연산에 대해 이야기 해보겠습니다. 또한 `String`을 다른 컬렉션들과 다르게 만드는 부분, 즉 사람과 컴퓨터가 `String` 데이터를 통역하는 방식 간의 차이로 인해 생기는 `String` 인덱싱의 복잡함을 논의해보겠습니다.\n\n### 스트링이 뭔가요?\n\n먼저 *스트링*이라는 용어가 정확히 무엇을 뜻하는 것인지 정의해보겠습니다. 러스트는 핵심 언어 기능 내에서 딱 한가지 스트링 타입만 제공하는데, 이는 바로 스트링 슬라이스인 `str`이고, 이것의 참조자 형태인 `&str`을 많이 봤죠.  *스트링 슬라이스*에 대해 얘기했고, 이는 다른 어딘가에 저장된 UTF-8로 인코딩된 스트링 데이터의 참조자입니다. 예를 들어, 스트링 리터럴은 프로그램의 바이너리 출력물 내에 저장되어 있으며, 그러므로 스트링 슬라이스입니다.\n\n`String` 타입은 핵심 언어 기능 내에 구현된 것이 아니고 러스트의 표준 라이브러리를 통해 제공되며, 커질 수 있고, 가변적이며, 소유권을 갖고 있고, UTF-8로 인코딩된 스트링 타입입니다. 러스트인들이 “스트링”에 대해 이야기할 때, 그들은 보통 `String`과 스트링 슬라이스 `&str` 타입 둘 모두를 이야기한 것이지, 이들 중 하나를 뜻한 것은 아닙니다. 이번 절은 대부분 `String`에 관한 것이지만, 두 타입 모두 러스트 표준 라이브러리에서 매우 많이 사용되며 `String`과 스트링 슬라이스 모두 UTF-8로 인코딩되어 있습니다.\n\n또한 러스트 표준 라이브러리는 `OsString`, `OsStr`, `CString`, 그리고 `CStr`과 같은 몇가지 다른 스트링 타입도 제공합니다. 심지어 어떤 라이브러리 크레이트들은 스트링 데이터를 저장하기 위해 더 많은 옵션을 제공할 수 있습니다. `*String`/`*Str`이라는 작명과 유사하게, 이들은 종종 소유권이 있는 타입과 이를 빌린 변형 타입을 제공하는데, 이는 `String`/`&str`과 비슷합니다. 이러한 스트링 타입들은, 예를 들면 다른 종류의 인코딩이 된 텍스트를 저장하거나 다른 방식으로 메모리에 저장될 수 있습니다. 여기서는 이러한 다른 스트링 타입은 다루지 않겠습니다; 이것들을 어떻게 쓰고 어떤 경우에 적합한지에 대해 알고 싶다면 각각의 API 문서를 확인하시기 바랍니다.\n\n### 새로운 스트링 생성하기\n\n`Vec`에서 쓸 수 있는 많은 연산들이 `String`에서도 마찬가지로 똑같이 쓰일 수 있는데, `new` 함수를 이용하여 스트링을 생성하는 것으로 아래의 Listing 11과 같이 시작해봅시다:\n\n```rust\n\nlet mut s = String::new();\n\n```\n\nListing 1: 비어있는 새로운 `String` 생성하기\n\n이 라인은 우리가 어떤 데이터를 담아둘 수 있는 `s`라는 빈 스트링을 만들어 줍니다. 종종 우리는 스트링에 담아두고 시작할 초기값을 가지고 있을 것입니다. 그런 경우, `to_string` 메소드를 이용하는데, 이는 `Display` 트레잇이 구현된 어떤 타입이든 사용 가능하며, 스트링 리터럴도 이 트레잇을 구현하고 있습니다. Listing 2에서 두 가지 예제를 보여주고 있습니다:\n\n```rust\n\nlet data = \"initial contents\";\n\nlet s = data.to_string();\n\n// the method also works on a literal directly:\nlet s = \"initial contents\".to_string();\n\n```\n\nListing 2: `to_string` 메소드를 사용하여 스트링 리터럴로부터 `String` 생성하기\n\n이 코드는 `initial contents`를 담고 있는 스트링을 생성합니다.\n\n또한 스트링 리터럴로부터 `String`을 생성하기 위해서 `String::from` 함수를 이용할 수도 있습니다. Listing 3의 코드는 `to_string`을 사용하는 Listing 12의 코드와 동일합니다:\n\n```rust\n\nlet s = String::from(\"initial contents\");\n\n```\n\nListing 3: `String::from` 함수를 사용하여 스트링 리터럴로부터 `String` 생성하기\n\n스트링이 너무나 많은 것들에 사용되기 때문에, 스트링을 위해 다양한 제네릭 API들을 사용할 수 있으며, 다양한 옵션들을 제공합니다. 몇몇은 쓸모없는 것처럼 느껴질 수도 있지만, 다 사용할 곳이 있습니다! 지금의 경우, `String::from`과 `.to_string`은 정확히 똑같은 일을 하며, 따라서 어떤 것을 사용하는가는 여러분의 스타일에 따라 달린 문제입니다.\n\n스트링이 UTF-8로 인코딩되었음을 기억하세요. 즉, 아래의 Listing 4에서 보는 것처럼 우리는 인코딩된 어떤 데이터라도 포함시킬 수 있습니다:\n\n```rust\n\nlet hello = String::from(\"السلام عليكم\");\nlet hello = String::from(\"Dobrý den\");\nlet hello = String::from(\"Hello\");\nlet hello = String::from(\"שָׁלוֹם\");\nlet hello = String::from(\"नमस्ते\");\nlet hello = String::from(\"こんにちは\");\nlet hello = String::from(\"안녕하세요\");\nlet hello = String::from(\"你好\");\nlet hello = String::from(\"Olá\");\nlet hello = String::from(\"Здравствуйте\");\nlet hello = String::from(\"Hola\");\n\n```\n\nListing4: 스트링에 다양한 언어로 인삿말 저장하기\n\n위의 모두가 유효한 `String` 값입니다.\n\n### 스트링 갱신하기\n\n`String`은 크기가 커질 수 있으며 이것이 담고 있는 내용물은 `Vec`의 내용물과 마찬가지로 더 많은 데이터를 집어넣음으로써 변경될 수 있습니다. 추가적으로, `+` 연산자나 `format!` 매크로를 사용하여 편리하게 `String` 값들을 서로 접합(concatenation)할 수 있습니다.\n\n### `push_str`과 `push`를 이용하여 스트링 추가하기\n\nListing 5와 같이 스트링 슬라이스를 추가하기 위해 `push_str` 메소드를 이용하여 `String`을 키울 수 있습니다:\n\n```rust\n\nlet mut s = String::from(\"foo\");\ns.push_str(\"bar\");\n\n```\n\nListing 5: `push_str` 메소드를 사용하여 `String`에 스트링 슬라이스 추가하기\n\n`s`는 위의 두 라인 뒤에 “foobar”를 담게 될 것입니다. `push_str` 메소드는 스트링 슬라이스를 파라미터로 갖는데 이는 파라미터의 소유권을 가져올 필요가 없기 때문입니다. 예를 들어, Listing 6의 코드는 `s1`에 `s2`의 내용물을 추가한 뒤 `s2`를 더 이상 쓸 수 없게 되었다면 불행했을 경우를 보여주고 있습니다:\n\n```rust\n\nlet mut s1 = String::from(\"foo\");\nlet s2 = \"bar\";\ns1.push_str(&s2);\nprintln!(\"s2 is {}\", s2);\n\n```\n\nListing 6: 스트링 슬라이스를 `String`에 붙인 이후에 스트링 슬라이스를 사용하기\n\n만일 `push_str` 함수가 `s2`의 소유권을 가져갔다면, 마지막 줄에서 그 값을 출력할 수 없었을 것입니다. 하지만, 이 코드는 우리가 기대했던 대로 작동합니다!\n\n`push` 메소드는 한 개의 글자를 파라미터로 받아서 `String`에 추가합니다. Listing 7은 `push` 메소드를 사용하여 `String`에 l을 추가하는 코드를 보여주고 있습니다:\n\n```rust\n\nlet mut s = String::from(\"lo\");\ns.push(\'l\');\n\n```\n\nListing 7: `push`를 사용하여 `String` 값에 한 글자 추가하기\n\n위의 코드를 실행한 결과로 `s`는 `lol`을 담고 있을 것입니다.\n\n### `+` 연산자나 `format!` 매크로를 이용한 접합\n\n종종 우리는 가지고 있는 두 개의 스트링을 조합하고 싶어합니다. 한 가지 방법은 아래 Listing 8와 같이 `+` 연산자를 사용하는 것입니다:\n\n```rust\n\nlet s1 = String::from(\"Hello, \");\nlet s2 = String::from(\"world!\");\nlet s3 = s1 + &s2; // s1은 여기서 이동되어 더이상 쓸 수 없음을 유의하세요\n\n```\n\nListing 8: `+` 연산자를 사용하여 두 `String` 값을 하나의 새로운 `String` 값으로 조합하기\n\n위의 코드 실행 결과로서, 스트링 `s3`는 `Hello, world!`를 담게 될 것입니다. `s1`이 더하기 연산 이후에 더이상 유효하지 않은 이유와 `s2`의 참조자가 사용되는 이유는 `+` 연산자를 사용했을 때 호출되는 함수의 시그니처와 맞춰야 하기 때문입니다 `+` 연산자는 `add` 메소드를 사용하는데, 이 메소드의 시그니처는 아래처럼 생겼습니다:\n\n```rust\n\nfn add(self, s: &str) -> String {\n\n```\n\n이는 표준 라이브러리에 있는 정확한 시그니처는 아닙니다: 표준 라이브러리 내에서 `add`는 제네릭을 이용하여 정의되어 있습니다. 여기서는 제네릭에 구체 타입(concrete type)을 대입한 `add`의 시그니처를 보는 중인데, 이는 우리가 `String` 값으로 이 메소드를 호출했을때 생깁니다. 제네릭에 대한 내용은 나중에 다룰 것입니다. 이 시그니처는 교묘한 `+` 연산자를 이해하는데 필요한 단서를 줍니다.\n\n첫번째로, `s2`는 `&`를 가지고 있는데, 이는 `add` 함수의 `s` 파라미터 때문에 첫번째 스트링에 두번째 스트링의 *참조자*를 더하고 있음을 뜻합니다: 우리는 `String`에 `&str`만 더할 수 있고, 두 `String`을 더하지는 못합니다. 하지만, 잠깐만요 - `&s2`의 타입은 `&String`이지, `add`의 두번째 파라미터에 명시한것처럼 `&str`은 아니죠. 왜 Listing 8의 예제가 컴파일될까요? `&s2`를 `add` 호출에 사용할 수 있는 이유는 `&String` 인자가 `&str`로 *강제*될 수 있기 때문입니다 - `add` 함수가 호출되면, 러스트는 *역참조 강제(deref coercion)* 라 불리는 무언가를 사용하는데, 이는 `add` 함수내에서 사용되는 `&s2`가 `&s2[..]`로 바뀌는 것으로 생각할 수 있도록 해줍니다.  `add`가 파라미터의 소유권을 가져가지는 않으므로, `s2`는 이 연산 이후에도 여전히 유효한 `String`일 것입니다.\n\n두번째로, 시그니처에서 `add`가 `self`의 소유권을 가져가는 것을 볼 수 있는데, 이는 `self`가 `&`를 *안 가지고* 있기 때문입니다. 즉 Listing 8의 예제에서 `s1`이 `add` 호출로 이동되어 이후에는 더 이상 유효하지 않을 것이라는 의미입니다. 따라서 `let s3 = s1 + &s2;`가 마치 두 스트링을 복사하여 새로운 스트링을 만들 것처럼 보일지라도, 실제로 이 구문은 `s1`의 소유권을 가져다가 `s2`의 내용물의 복사본을 추가한 다음, 결과물의 소유권을 반환합니다. 달리 말하면, 이 구문은 여러 복사본을 만드는 것처럼 보여도 그렇지 않습니다: 이러한 구현은 복사보다 더 효율적입니다.\n\n만일 여러 스트링을 접하고자 한다면, `+`의 동작은 다루기 불편해 집니다.:\n\n```rust\n\nlet s1 = String::from(\"tic\");\nlet s2 = String::from(\"tac\");\nlet s3 = String::from(\"toe\");\n\nlet s = s1 + \"-\" + &s2 + \"-\" + &s3;\n\n```\n\n이 지점에서 `s`는 `tic-tac-toe`가 될 것입니다. 모든 `+`와 `\"` 문자들과 함께 보면 어떤 결과가 나올지 알기 어렵습니다. 더 복잡한 스트링 조합을 위해서는 `format!` 매크로를 사용할 수 있습니다:\n\n```rust\n\nlet s1 = String::from(\"tic\");\nlet s2 = String::from(\"tac\");\nlet s3 = String::from(\"toe\");\n\nlet s = format!(\"{}-{}-{}\", s1, s2, s3);\n\n```\n\n이 코드 또한 `s`에 `tic-tac-toe`을 설정합니다. `format!` 매크로는 `println!`과 똑같은 방식으로 작동하지만, 스크린에 결과를 출력하는 대신 결과를 담은 `String`을 반환해줍니다. `format!`을 이용한 버전이 훨씬 읽기 쉽고, 또한 어떠한 파라미터들의 소유권도 가져가지 않습니다.\n\n### 스트링 내부의 인덱싱\n\n다른 많은 프로그래밍 언어들에서, 인덱스를 이용한 참조를 통해 스트링 내부의 개별 문자들에 접근하는 것은 유효하고 범용적인 연산에 속합니다. 그러나 러스트에서 인덱싱 문법을 이용하여 `String`의 부분에 접근하고자 하면 에러를 얻게 됩니다. 아래 Listing 9와 같은 코드를 생각해봅시다:\n\n```rust\n\nlet s1 = String::from(\"hello\");\nlet h = s1[0];\n\n```\n\nListing 9: 스트링에 인덱싱 문법을 사용하는 시도\n\n이 코드는 아래와 같은 에러를 출력합니다:\n\n```text\n\nerror: the trait bound `std::string::String: std::ops::Index<_>` is not\nsatisfied [--explain E0277]\n  |>\n  |>     let h = s1[0];\n  |>             ^^^^^\nnote: the type `std::string::String` cannot be indexed by `_`\n\n```\n\n에러와 노트 부분이 이야기해 줍니다: 러스트 스트링은 인덱싱을 지원하지 않는다고. 그렇지만 왜 안되는 걸까요? 이 질문에 답하기 위해서는 러스트가 어떻게 스트링을 메모리에 저장하는지에 관하여 살짝 이야기해야 합니다.\n\n### 내부적 표현\n\n`String`은 `Vec<u8>`을 감싼 것입니다(wrapper). Listing 4에서 보았던 몇가지 적절히 인코딩된 UTF-8 예제 스트링을 살펴봅시다. 첫번째로, 이것입니다:\n\n```rust\n\nlet len = String::from(\"Hola\").len();\n\n```\n\n이 경우, `len`은 4가 되는데, 이는 스트링 “Hola”를 저장하고 있는 `Vec`이 4바이트 길이라는 뜻입니다. UTF-8로 인코딩되면 각각의 글자들이 1바이트씩 차지한다는 것이죠. 그런데 아래 예제는 어떨까요?\n\n```rust\n\nlet len = String::from(\"Здравствуйте\").len();\n\n```\n\n이 스트링의 길이가 얼마인지 묻는다면, 여러분은 12라고 답할런지도 모릅니다. 그러나 러스트의 대답은 24입니다. 이는 “Здравствуйте”를 UTF-8로 인코딩된 바이트들의 크기인데, 각각의 유니코드 스칼라 값이 저장소의 2바이트를 차지하기 때문입니다. 따라서, 스트링의 바이트들 안의 인덱스는 유효한 유니코드 스칼라 값과 항상 대응되지는 않을 것입니다.\n\n이를 보여주기 위해, 다음과 같은 유효하지 않은 러스트 코드를 고려해 보세요:\n\n```rust\n\nlet hello = \"Здравствуйте\";\nlet answer = &hello[0];\n\n```\n\n`answer`의 값은 무엇이 되어야 할까요? 첫번째 글자인 `З`이 되어야 할까요? UTF-8로 인코딩될 때, `З`의 첫번째 바이트는 `208`이고, 두번째는 `151`이므로, `answer`는 사실 `208`이 되어야 하지만, `208`은 그 자체로는 유효한 문자가 아닙니다. `208`을 반환하는 것은 사람들이 이 스트링의 첫번째 글자를 요청했을 경우 사람들이 기대하는 것이 아닙니다; 하지만 그게 러스트가 인덱스 0에 가지고 있는 유일한 데이터죠. 바이트 값을 반환하는 것은 아마도 유저들이 원하는 것이 아닐 것입니다. 심지어는 라틴 글자들만 있을 때도요: `&\"hello\"[0]`는 `h`가 아니라 `104`를 반환합니다. 기대치 않은 값을 반환하고 즉시 발견하기 힘들지도 모를 버그를 야기하는 것을 방지하기 위해, 러스트는 이러한 코드를 전혀 컴파일하지 않고 이러한 오해들을 개발 과정 내에서 일찌감치 방지합니다.\n\n### 바이트와 스칼라 값과 문자소 클러스터(Grapheme cluster)! 이런!\n\nUTF-8에 대한 또다른 지점은, 실제로는 러스트의 관점에서 문자열을 보는 세 가지의 의미있는 방식이 있다는 것입니다: 바이트, 스칼라 값, 그리고 문자소 클러스터(우리가 *글자*라고 부르는 것과 가장 근접한 것)입니다.\n\n데바가나리 글자로 쓰여진 힌디어 “नमस्ते”를 보면, 이것은 궁극적으로 아래와 같이 `u8` 값들의 `Vec`으로서 저장됩니다:\n\n```text\n\n[224, 164, 168, 224, 164, 174, 224, 164, 184, 224, 165, 141, 224, 164, 164,\n224, 165, 135]\n\n```\n\n이건 18바이트이고 컴퓨터가 이 데이터를 궁극적으로 저장하는 방법입니다. 만일 우리가 이를 유니코드 스칼라 값, 즉 러스트의 `char` 타입인 형태로 본다면, 아래와 같이 보이게 됩니다:\n\n```text\n\n[\'न\', \'म\', \'स\', \'्\', \'त\', \'े\']\n\n```\n\n여섯개의 `char` 값이 있지만, 네번쨰와 여섯번째는 글자가 아닙니다: 그 자체로는 이해할 수 없는 발음 구별 부호입니다. 마지막으로, 만일 이를 문자소 클러스터로서 본다면, 사람들이 발음할 이 힌디 단어를 구성하는 네 글자를 얻습니다:\n\n```text\n\n[\"न\", \"म\", \"स्\", \"ते\"]\n\n```\n\n러스트는 컴퓨터가 저장하는 가공되지 않은(raw) 스트링을 번역하는 다른 방법을 제공하여, 데이터가 담고 있는 것이 어떤 인간의 언어든 상관없이 각각의 프로그램이 필요로 하는 통역방식을 선택할 수 있도록 합니다.\n\n러스트가 `String`을 인덱스로 접근하여 문자를 얻지 못하도록 하는 마지막 이유는 인덱스 연산이 언제나 상수 시간(O(1))에 실행될 것으로 기대받기 때문입니다. 그러나 `String`을 가지고 그러한 성능을 보장하는 것은 불가능한데, 그 이유는 러스트가 스트링 내에 얼마나 많은 유효 문자가 있는지 알아내기 위해 내용물의 시작 지점부터 인덱스로 지정된 곳까지 훑어야 하기 때문입니다.\n\n### 스트링 슬라이싱하기\n\n스트링 인덱싱의 리턴 타입이 어떤 것이 (바이트 값인지, 캐릭터인지, 문자소 클러스터인지, 혹은 스트링 슬라이스인지) 되어야 하는지 명확하지 않기 때문에 스트링의 인덱싱은 종종 나쁜 아이디어가 됩니다. 따라서, 여러분이 스트링 슬라이스를 만들기 위해 정말로 인덱스를 사용하고자 한다면 러스트는 좀 더 구체적으로 지정하도록 요청합니다. 여러분의 인덱싱을 더 구체적으로 하고 스트링 슬라이스를 원한다는 것을 가리키기 위해서, `[]`에 숫자 하나를 사용하는 인덱싱보다, `[]`와 범위를 사용하여 특정 바이트들이 담고 있는 스트링 슬라이스를 만들 수 있습니다:\n\n```rust\n\nlet hello = \"Здравствуйте\";\n\nlet s = &hello[0..4];\n\n```\n\n여기서 `s`는 스트링의 첫 4바이트를 담고 있는 `&str`가 될 것입니다. 앞서 우리는 이 글자들이 각각 2바이트를 차지한다고 언급했으므로, 이는 `s`가 “Зд”이 될 것이란 뜻입니다.\n\n만약에 `&hello[0..1]`라고 했다면 어떻게 될까요? 답은 다음과 같습니다: 러스트는 벡터 내에 유효하지 않은 인덱스에 접근했을 때와 동일한 방식으로 런타임에 패닉을 발생시킬 것입니다.\n\n```text\n\nthread \'main\' panicked at \'index 0 and/or 1 in `Здравствуйте` do not lie on\ncharacter boundary\', ../src/libcore/str/mod.rs:1694\n\n```\n\n여러분은 스트링 슬라이스를 만들기 위하여 범위를 이용하는 방법을 조심스럽게 사용해야 하는데, 이는 여러분의 프로그램을 죽게 만들 수도 있기 때문입니다.\n\n### 스트링 내에서 반복적으로 실행되는 메소드\n\n다행히도, 스트링의 요소에 접근하는 다른 방법이 있습니다.\n\n만일 개별적인 유니코드 스칼라 값에 대한 연산을 수행하길 원한다면, 가장 좋은 방법은 `chars` 메소드를 이용하는 것입니다. `chars`를 “नमस्ते”에 대해 호출하면 `char`타입의 6개의 값으로 나누어 반환하며, 여러분은 각각의 요소에 접근하기 위해 이 결과값에 대해 반복(iterate)할 수 있습니다:\n\n```rust\n\nfor c in \"नमस्ते\".chars() {\n    println!(\"{}\", c);\n}\n\n```\n\n이 코드는 다음을 출력할 것입니다:\n\n```text\n\nन\nम\nस\n्\nत\nे\n\n```\n\n`bytes` 메소드는 가공되지 않은 각각의 바이트를 반환하는데, 여러분의 문제 범위에 따라 적절할 수도 있습니다:\n\n```rust\n\nfor b in \"नमस्ते\".bytes() {\n    println!(\"{}\", b);\n}\n\n```\n\n이 코드는 이 `String`을 구성하는 아래처럼 시작되는 18 바이트를 출력합니다:\n\n```text\n\n224\n164\n168\n224\n// ... etc\n\n```\n\n하지만 유효한 유니코드 스칼라 값이 하나 이상의 바이트로 구성될지도 모른다는 것을 확실히 기억해주세요.\n\n스트링으로부터 문자소 클러스터를 얻는 방법은 복잡해서, 이 기능은 표준 라이브러리를 통해 제공되지 않습니다. 여러분이 원하는 기능이 이것이라면 [crates.io](https://crates.io/)에서 사용 가능한 크레이트가 있습니다.\n\n### 스트링은 그렇게 단순하지 않습니다\n\n종합하면, 스트링은 복잡합니다. 다른 프로그래밍 언어들은 이러한 복잡성을 프로그래머에게 어떻게 보여줄지에 대해 각기 다른 선택을 합니다. 러스트는 `String` 데이터의 올바른 처리가 모든 러스트 프로그램에 대한 기본적인 동작이 되도록 선택했는데, 이는 솔직히 프로그래머들이 UTF-8 데이터를 처리하는데 있어 더 많은 생각을 해야한다는 의미입니다. 이러한 거래는 다른 프로그래밍 언어들에 비해 더 복잡한 스트링을 노출시키지만, 한편으로는 여러분의 개발 생활 주기 후반에 비 ASCII 캐릭터를 포함하는 에러를 처리해야 하는 것을 막아줄 것입니다.\n\n이것보다 살짝 덜 복잡한 것으로 옮겨 갑시다: 해쉬맵이요!','2022-09-05 12:42:15.589000','스트링',9),(10,'이번에 살펴볼 컬렉션은 *해쉬맵*입니다. `HashMap<K, V>` 타입은 `K` 타입의 키에 `V` 타입의 값을 매핑한 것을 저장합니다. 이 매핑은 *해쉬 함수(hashing function)* 을 통해 동작하는데, 해쉬 함수는 이 키와 값을 메모리 어디에 저장할지 결정합니다. 많은 다른 프로그래밍 언어들도 이러한 종류의 데이터 구조를 지원하지만, 종종 해쉬, 맵, 오브젝트, 해쉬 테이블, 혹은 연관 배열 (associative) 등과 같은 그저 몇몇 다른 이름으로 이용됩니다.\n\n해쉬맵은 여러분이 벡터를 이용하듯 인덱스를 이용하는 것이 아니라 임의의 타입으로 된 키를 이용하여 데이터를 찾기를 원할때 유용합니다. 예를 들면, 게임 상에서는 각 팀의 점수를 해쉬맵에 유지할 수 있는데, 여기서 키는 팀의 이름이고 값은 팀의 점수가 될 수 있습니다. 팀의 이름을 주면, 여러분은 그 팀의 점수를 찾을 수 있습니다.\n\n이 장에서는 해쉬맵의 기본 API를 다룰 것이지만, 표준 라이브러리의 `HashMap`에 정의되어 있는 함수 중에는 더 좋은 것들이 숨어있습니다. 항상 말했듯이, 더 많은 정보를 원하신다면 표준 라이브러리 문서를 확인하세요.\n\n### 새로운 해쉬맵 생성하기\n\n우리는 빈 해쉬맵을 `new`로 생성할 수 있고, `insert`를 이용하여 요소를 추가할 수 있습니다. Listing 1에서, 우리는 팀 이름이 각각 블루(Blue)와 옐로우(Yellow)인 두 팀의 점수를 유지하고 있습니다. 블루 팀은 10점, 옐로우 팀은 50점으로 시작할 것입니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet mut scores = HashMap::new();\n\nscores.insert(String::from(\"Blue\"), 10);\nscores.insert(String::from(\"Yellow\"), 50);\n\n```\n\nListing 1: 새로운 해쉬맵을 생성하여 몇 개의 키와 값을 집어넣기\n\n먼저 표준 라이브러리의 컬렉션 부분으로부터 `HashMap`을 `use`로 가져와야할 필요가 있음을 주목하세요. 우리가 보고 있는 세 가지 일반적인 컬렉션 중에서 이 해쉬맵이 제일 덜 자주 사용되는 것이기 때문에, 프렐루드(prelude) 내에 자동으로 가져와지는 기능에 포함되어 있지 않습니다. 또한 해쉬맵은 표준 라이브러리로부터 덜 지원을 받습니다; 예를 들면 해쉬맵을 생성하는 빌트인 매크로가 없습니다.\n\n벡터와 마찬가지로, 해쉬맵도 데이터를 힙에 저장합니다. 이 `HashMap`은 `String` 타입의 키와 `i32` 타입의 값을 갖습니다. 벡터와 비슷하게 해쉬맵도 동질적입니다: 모든 키는 같은 타입이어야 하고, 모든 값도 같은 타입이여야 합니다.\n\n해쉬맵을 생성하는 또다른 방법은 튜플의 벡터에 대해 `collect` 메소드를 사용하는 것인데, 이 벡터의 각 튜플은 키와 키에 대한 값으로 구성되어 있습니다. `collect` 메소드는 데이터를 모아서 `HashMap`을 포함한 여러 컬렉션 타입으로 만들어줍니다. 예를 들면, 만약 두 개의 분리된 벡터에 각각 팀 이름과 초기 점수를 갖고 있다면, 우리는 `zip` 메소드를 이용하여 “Blue”와 10이 한 쌍이 되는 식으로 튜플의 벡터를 생성할 수 있습니다. 그 다음 Listing 2과 같이 `collect` 메소드를 사용하여 튜플의 벡터를 `HashMap`으로 바꿀 수 있습니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet teams  = vec![String::from(\"Blue\"), String::from(\"Yellow\")];\nlet initial_scores = vec![10, 50];\n\nlet scores: HashMap<_, _> = teams.iter().zip(initial_scores.iter()).collect();\n\n```\n\nListing 2: 팀의 리스트와 점수의 리스트로부터 해쉬맵 생성하기\n\n타입 명시 `HashMap<_, _>`이 필요한데 이는 `collect`가 다른 많은 데이터 구조로 바뀔 수 있고, 러스트는 여러분이 특정하지 않으면 어떤 것을 원하는지 모르기 때문입니다. 그러나 키와 값의 타입에 대한 타입 파라미터에 대해서는 밑줄을 쓸 수 있으며 러스트는 벡터에 담긴 데이터의 타입에 기초하여 해쉬에 담길 타입을 추론할 수 있습니다.\n\n### 해쉬맵과 소유권\n\n`i32`와 같이 `Copy` 트레잇을 구현한 타입에 대하여, 그 값들은 해쉬맵 안으로 복사됩니다. `String`과 같이 소유된 값들에 대해서는, 아래의 Listing 3와 같이 값들이 이동되어 해쉬맵이 그 값들에 대한 소유자가 될 것입니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet field_name = String::from(\"Favorite color\");\nlet field_value = String::from(\"Blue\");\n\nlet mut map = HashMap::new();\nmap.insert(field_name, field_value);\n// field_name과 field_value은 이 지점부터 유효하지 않습니다.\n// 이들을 이용하는 시도를 해보고 어떤 컴파일러 에러가 나오는지 보세요!\n\n```\n\nListing 3: 키와 값이 삽입되는 순간 이들이 해쉬맵의 소유가 되는 것을 보여주는 예\n\n`insert`를 호출하여 `field_name`과 `field_value`를 해쉬맵으로 이동시킨 후에는 더 이상 이 둘을 사용할 수 없습니다.\n\n만일 우리가 해쉬맵에 값들의 참조자들을 삽입한다면, 이 값들은 해쉬맵으로 이동되지 않을 것입니다. 하지만 참조자가 가리키고 있는 값은 해쉬맵이 유효할 때까지 계속 유효해야합니다. \n\n### 해쉬맵 내의 값 접근하기\n\nListing 4과 같이 해쉬맵의 `get` 메소드에 키를 제공하여 해쉬맵으로부터 값을 얻어올 수 있습니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet mut scores = HashMap::new();\n\nscores.insert(String::from(\"Blue\"), 10);\nscores.insert(String::from(\"Yellow\"), 50);\n\nlet team_name = String::from(\"Blue\");\nlet score = scores.get(&team_name);\n\n```\n\nListing 4: 해쉬맵 내에 저장된 블루 팀의 점수 접근하기\n\n여기서 `score`는 블루 팀과 연관된 값을 가지고 있을 것이고, 결과값은 `Some(&10)`일 것입니다. 결과값은 `Some`으로 감싸져 있는데 왜냐하면 `get`이 `Option<&V>`를 반환하기 때문입니다; 만일 해쉬맵 내에 해당 키에 대한 값이 없다면 `get`은 `None`을 반환합니다. 프로그램은  `Option`을 처리해야 할 것입니다.\n\n우리는 벡터에서 했던 방법과 유사한 식으로 `for` 루프를 이용하여 해쉬맵에서도 각각의 키/값 쌍에 대한 반복작업을 할 수 있습니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet mut scores = HashMap::new();\n\nscores.insert(String::from(\"Blue\"), 10);\nscores.insert(String::from(\"Yellow\"), 50);\n\nfor (key, value) in &scores {\n    println!(\"{}: {}\", key, value);\n}\n\n```\n\n이 코드는 각각의 쌍을 임의의 순서로 출력할 것입니다:\n\n```\n\nYellow: 50\nBlue: 10\n\n```\n\n### 해쉬맵 갱신하기\n\n키와 값의 개수가 증가할 수 있을지라도, 각각의 개별적인 키는 한번에 연관된 값 하나만을 가질 수 있습니다. 해쉬맵 내의 데이터를 변경하길 원한다면, 키에 이미 값이 할당되어 있을 경우에 대한 처리를 어떻게 할지 결정해야 합니다. 예전 값을 완전히 무시하면서 예전 값을 새 값으로 대신할 수도 있습니다. 혹은 예전 값을 계속 유지하면서 새 값은 무시하고, 해당 키에 값이 할당되지 *않을* 경우에만 새 값을 추가하는 방법을 선택할 수도 있습니다. 또는 예전 값과 새 값을 조합할 수도 있습니다. 각각의 경우를 어떻게 할지 살펴봅시다!\n\n### 값을 덮어쓰기\n\n만일 해쉬맵에 키와 값을 삽입하고, 그 후 똑같은 키에 다른 값을 삽입하면, 키에 연관지어진 값은 새 값으로 대신될 것입니다. 아래 Listing 5의 코드가 `insert`를 두 번 호출함에도, 해쉬맵은 딱 하나의 키/값 쌍을 담게 될 것인데 그 이유는 두 번 모두 블루 팀의 키에 대한 값을 삽입하고 있기 때문입니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet mut scores = HashMap::new();\n\nscores.insert(String::from(\"Blue\"), 10);\nscores.insert(String::from(\"Blue\"), 25);\n\nprintln!(\"{:?}\", scores);\n\n```\n\nListing 5: 특정한 키로 저장된 값을 덮어쓰기\n\n이 코드는 `{\"Blue\": 25}`를 출력할 것입니다. 원래의 값 10은 덮어써졌습니다.\n\n### 키에 할당된 값이 없을 경우에만 삽입하기\n\n특정 키가 값을 가지고 있는지 검사하고, 만일 가지고 있지 않다면 이 키에 대한 값을 삽입하고자 하는 경우는 흔히 발생합니다. 해쉬맵은 이를 위하여 `entry`라고 하는 특별한 API를 가지고 있는데, 이는 우리가 검사하고자 하는 키를 파라미터로 받습니다. `entry` 함수의 리턴값은 열거형 `Entry`인데, 해당 키가 있는지 혹은 없는지를 나타냅니다. 우리가 옐로우 팀에 대한 키가 연관된 값을 가지고 있는지 검사하고 싶어한다고 해봅시다. 만일 없다면, 값 50을 삽입하고, 블루팀에 대해서도 똑같이 하고 싶습니다. 엔트리 API를 사용한 코드는 아래의 Listing 6와 같습니다:\n\n```rust\n\nuse std::collections::HashMap;\n\nlet mut scores = HashMap::new();\nscores.insert(String::from(\"Blue\"), 10);\n\nscores.entry(String::from(\"Yellow\")).or_insert(50);\nscores.entry(String::from(\"Blue\")).or_insert(50);\n\nprintln!(\"{:?}\", scores);\n\n```\n\nListing 6: `entry` 메소드를 이용하여 어떤 키가 값을 이미 갖고 있지 않을 경우에만 추가하기\n\n`Entry`에 대한 `or_insert` 메소드는 해당 키가 존재할 경우 관련된 `Entry` 키에 대한 값을 반환하도록 정의되어 있고, 그렇지 않을 경우에는 파라미터로 주어진 값을 해당 키에 대한 새 값을 삽입하고 수정된 `Entry`에 대한 값을 반환합니다. 이 방법은 우리가 직접 로직을 작성하는 것보다 훨씬 깔끔하고, 게다가 빌림 검사기와 잘 어울려 동작합니다.\n\nListing 6의 코드를 실행하면 `{\"Yellow\": 50, \"Blue\": 10}`를 출력할 것입니다. 첫번째 `entry` 호출은 옐로우 팀에 대한 키에 대하여 값 50을 삽입하는데, 이는 옐로우 팀이 값을 가지고 있지 않기 떄문입니다. 두번째 `entry` 호출은 해쉬맵을 변경하지 않는데, 왜냐하면 블루 팀은 이미 값 10을 가지고 있기 때문입니다.\n\n### 예전 값을 기초로 값을 갱신하기\n\n해쉬맵에 대한 또다른 흔한 사용 방식은 키에 대한 값을 찾아서 예전 값에 기초하여 값을 갱신하는 것입니다. 예를 들어, Listing 7은 어떤 텍스트 내에 각 단어가 몇번이나 나왔는지를 세는 코드를 보여줍니다. 단어를 키로 사용하는 해쉬맵을 이용하여 해당 단어가 몇번이나 나왔는지를 유지하기 위해 값을 증가시켜 줍니다. 만일 어떤 단어를 처음 본 것이라면, 값 `0`을 삽입할 것입니다.\n\n```rust\n\nuse std::collections::HashMap;\n\nlet text = \"hello world wonderful world\";\n\nlet mut map = HashMap::new();\n\nfor word in text.split_whitespace() {\n    let count = map.entry(word).or_insert(0);\n    *count += 1;\n}\n\nprintln!(\"{:?}\", map);\n\n```\n\nListing 7: 단어와 횟수를 저장하는 해쉬맵을 사용하여 단어의 등장 횟수 세기\n\n이 코드는 `{\"world\": 2, \"hello\": 1, \"wonderful\": 1}`를 출력할 것입니다. `or_insert` 메소드는 실제로는 해당 키에 대한 값의 가변 참조자 (`&mut V`)를 반환합니다. 여기서는 `count` 변수에 가변 참조자를 저장하였고, 여기에 값을 할당하기 위해 먼저 애스터리스크 (`*`)를 사용하여 `count`를 역참조해야 합니다. 가변 참조자는 `for` 루프의 끝에서 스코프 밖으로 벗어나고, 따라서 모든 값들의 변경은 안전하며 빌림 규칙에 위배되지 않습니다.\n\n### 해쉬 함수\n\n기본적으로, `HashMap`은 서비스 거부 공격(Denial of Service(DoS) attack)에 저항 기능을 제공할 수 있는 암호학적으로 보안되는 해쉬 함수를 사용합니다. 이는 사용 가능한 가장 빠른 해쉬 알고리즘은 아니지만, 성능을 떨어트리면서 더 나은 보안을 취하는 거래는 가치가 있습니다. 만일 여러분이 여러분의 코드를 프로파일하여 기본 해쉬 함수가 여러분의 목표에 관해서는 너무 느리다면, 다른 *해쉬어(hasher)* 를 특정하여 다른 함수로 바꿀 수 있습니다. 해쉬어는 `BuildHasher` 트레잇을 구현한 타입을 말합니다. 여러분의 해쉬어를 바닥부터 새로 구현해야할 필요는 없습니다; [crates.io](https://crates.io/)에서는 많은 수의 범용적인 해쉬 알고리즘을 구현한 해쉬어를 제공하는 공유 라이브러리를 제공합니다.\n\n## 정리\n\n벡터, 스트링, 그리고 해쉬맵은 프로그램 내에서 여러분이 데이터를 저장하고, 접근하고, 수정하고 싶어하는 곳마다 필요한 수많은 기능들을 제공해줄 것입니다. 이제 여러분이 풀 준비가 되어있어야 할만한 몇가지 연습문제를 소개합니다:\n\n- 정수 리스트가 주어졌을 때, 벡터를 이용하여 이 리스트의 평균값(mean, average), 중간값(median, 정렬했을 때 가장 가운데 위치한 값), 그리고 최빈값(mode, 가장 많이 발생한 값; 해쉬맵이 여기서 도움이 될 것입니다)를 반환해보세요.\n- 스트링을 피그 라틴(pig Latin)으로 변경해보세요. 각 단어의 첫번째 자음은 단어의 끝으로 이동하고 “ay”를 붙이므로, “first”는 “irst-fay”가 됩니다. 모음으로 시작하는 단어는 대신 끝에 “hay”를 붙입니다. (“apple”은 “apple-hay”가 됩니다.) UTF-8 인코딩에 대해 기억하세요!\n- 해쉬맵과 벡터를 이용하여, 사용자가 회사 내의 부서에 대한 피고용인 이름을 추가할 수 있도록 하는 텍스트 인터페이스를 만들어보세요. 예를들어 “Add Sally to Engineering”이나 “Add Amir to Sales” 같은 식으로요. 그후 사용자가 각 부서의 모든 사람들에 대한 리스트나 알파벳 순으로 정렬된 부서별 모든 사람에 대한 리스트를 조회할 수 있도록 해보세요.\n\n표준 라이브러리 API 문서는 이 연습문제들에 대해 도움이 될만한 벡터, 스트링, 그리고 해쉬맵의 메소드들을 설명해줍니다!','2022-09-05 12:43:54.767000','해쉬맵',10),(11,'러스트의 핵심 기능은 바로 소유권입니다. 이 기능은 직관적으로 설명할 수 있지만, 언어의 나머지 부분에 깊은 영향을 끼칩니다.\n\n모든 프로그램은 실행하는 동안 컴퓨터의 메모리를 사용하는 방법을 관리해야 합니다. 몇몇 언어들은 프로그램이 실행될 때 더이상 사용하지 않는 메모리를 끊임없이 찾는 가비지 콜렉션을 갖고 있습니다; 다른 언어들에서는 프로그래머가 직접 명시적으로 메모리를 할당하고 해제해야 합니다. 러스트는 제 3의 접근법을 이용합니다: 메모리는 컴파일 타임에 컴파일러가 체크할 규칙들로 구성된 소유권 시스템을 통해 관리됩니다. 소유권 기능들의 어떤 것도 런타임 비용이 발생하지 않습니다.\n\n소유권이란 개념이 많은 프로그래머들에게 새로운 것이기 때문에, 이해하고 사용하는 데에는 약간의 시간이 걸립니다만, 좋은 소식은 여러분이 러스트와 소유권 시스템의 규칙에 더 많은 경험을 할수록, 여러분은 더 안전하고 더 효율적인 코드를 자연스럽게 개발할 수 있게될 것이라는 거죠. 견뎌내세요!\n\n여러분이 소유권을 이해했을 때, 여러분은 러스트를 유니크하게 만드는 기능들을 이해하기 위한 견고한 기초를 가지게 될 것입니다. 이 장에서, 여러분은 매우 흔한 데이터 구조인 문자열에 집중된 몇가지 예제를 통해 소유권에 대해 배우게 될 것입니다.\n\n### 소유권 규칙\n\n먼저, 소유권 규칙을 알아봅시다. 이것들을 설명할 예제들을 보는 내내 다음의 소유권 규칙들을 명심하세요:\n\n> 러스트의 각각의 값은 해당값의 오너(owner)라고 불리우는 변수를 갖고 있다.한번에 딱 하나의 오너만 존재할 수 있다.오너가 스코프 밖으로 벗어나는 때, 값은 버려진다(dropped).\n> \n\n### 변수의 스코프\n\n이제 과거의 기초 문법 형태로 돌아가서, `fn main() {` 코드를 예제에 붙이지 않을테니, 여러분들이 코드를 따라하려면 `main` 함수에 직접 예제들을 넣어야 할 겁니다. 결과적으로, 우리의 예제들은 좀더 간략해저셔 보일러 플레이트 코드에 비해 실제 디테일에 초점을 맞출 수 있도록 해줄 것입니다.\n\n소유권에 대한 첫 예제로서, 변수들의 스코프를 보겠습니다. 스코프란 프로그램 내에서 아이템이 유효함을 표시하기 위한 범위입니다. 아래처럼 생긴 변수가 있다고 해봅시다:\n\n```rust\n\nlet s = \"hello\";\n\n```\n\n변수 `s`는 스트링 리터럴을 나타내는데, 스트링 리터럴의 값은 우리의 프로그램의 텍스트 내에 하드코딩되어 있습니다. 변수는 선언된 시점부터 현재의 *스코프*가 끝날 때까지 유효합니다. 아래 예제 Listing 1은 변수 `s`가 유효한 지점을 주석으로 표시했습니다:\n\n```rust\n\n{                      // s는 유효하지 않습니다. 아직 선언이 안됐거든요.\n    let s = \"hello\";   // s는 이 지점부터 유효합니다.\n\n    // s를 가지고 뭔가 합니다.\n}                      // 이 스코프는 이제 끝이므로, s는 더이상 유효하지 않습니다.\n\n```\n\nListing 1: 변수와 이 변수가 유효한 스코프\n\n바꿔 말하면, 두가지 중요한 지점이 있습니다:\n\n1. 스코프 *안에서* `s`가 등장하면, 유효합니다.\n2. 이 유효기간은 스코프 *밖으로* 벗어날 때까지 지속됩니다.\n\n이 지점에서, 스코프와 변수가 유효한 시점 간의 관계는 다른 프로그래밍 언어와 비슷합니다. 이제 우리는 이에 대한 이해를 기초로 하여 `String` 타입을 소개함으로써 계속 쌓아나갈 것입니다.\n\n### `String` 타입\n\n소유권 규칙을 설명하기 위하여, 복잡한 데이터 타입이 필요합니다. 우리가 이전에 봐온 모든 데이터 타입들은 스택에 저장되었다가 스코프를 벗어날 때 스택으로부터 팝 됩니다만, 우리는 이제 힙에 저장되는 데이터를 관찰하고 러스트는 과연 어떻게 이 데이터를 비워내는지 설명할 필요가 있습니다.\n\n우리는 여기서 `String`을 예제로 활용하되, 소유권과 관련된 `String` 내용의 일부분에 집중할 것입니다. 이러한 관점은 표준 라이브러리나 여러분들이 만들 다른 복잡한 데이터 타입에도 적용됩니다. \n\n스트링 리터럴을 이미 봤는데, 이 값은 프로그램 안에 하드코딩 되어 있습니다. 문자열 값은 편리하지만, 여러분이 텍스트를 필요로 하는 모든 경우에 대해 항상 적절하진 않습니다. 그 중 한가지 이유로, 문자열 값은 불변입니다(immutable). 또다른 이유는 모든 문자열이 우리가 프로그래밍 하는 시점에서 다 알수 있는 것이 아니란 점입니다: 예를 들면, 사용자의 입력을 받아 저장하고 싶다면요? 이러한 경우들에 대해서, 러스트는 두번째 문자열 타입인 `String`을 제공합니다. 이 타입은 힙에 할당되고 그런고로 컴파일 타임에는 우리가 알 수 없는 양의 텍스트를 저장할 수 있습니다. 여러분은 스트링 리터럴로부터 `from`이라는 함수를 이용해서 `String`을 아래처럼 만들 수 있습니다:\n\n```rust\n\nlet s = String::from(\"hello\");\n\n```\n\n더블 콜론(`::`)은 우리가 `string_from`과 같은 이름을 쓰기 보다는 `String` 타입 아래의 `from` 함수를 특정지을 수 있도록 해주는 네임스페이스 연산자입니다.\n\n이러한 종류의 문자열은 변경 가능합니다:\n\n```rust\n\nlet mut s = String::from(\"hello\");\n\ns.push_str(\", world!\"); // push_str()은 해당 스트링 리터럴을 스트링에 붙여줍니다.\n\nprintln!(\"{}\", s); // 이 부분이 `hello, world!`를 출력할 겁니다.\n\n```\n\n그러니까, 여기서 어떤게 달라졌나요?, 왜 `String`은 변할 수 있는데 스트링 리터럴은 안될까요? 차이점은 두 타입이 메모리를 쓰는 방식에 있습니다.\n\n### 메모리와 할당\n\n스트링 리터럴의 경우, 우리는 내용물을 컴파일 타임에 알 수 있으므로 텍스트가 최종 실행파일에 직접 하드코딩 되었고, 이렇게 하면 스트링 리터럴이 빠르고 효율적이 됩니다. 그러나 이는 문자열이 변경되지 않는 것을 전재로 하는 특성입니다. 불행하게도, 우리는 컴파일 타임에 크기를 알 수 없는 경우 및 실행 중 크기가 변할 수도 있는 경우의 텍스트 조각을 바이너리 파일에 집어넣을 수 없습니다.\n\n`String` 타입은 변경 가능하고 커질 수 있는 텍스트를 지원하기 위해 만들어졌고, 우리는 힙에서 컴파일 타임에는 알 수 없는 어느 정도 크기의 메모리 공간을 할당받아 내용물을 저장할 필요가 있습니다. 이는 즉 다음을 의미합니다:\n\n1. 런타임에 운영체제로부터 메모리가 요청되어야 한다.\n2. `String`의 사용이 끝났을 때 운영체제에게 메모리를 반납할 방법이 필요하다.\n\n첫번째는 우리가 직접 수행합니다: 우리가 `String::from`을 호출하면, 구현부분에서 필요한 만큼의 메모리를 요청합니다. 이는 프로그래밍 언어들 사이에서 매우 일반적입니다.\n\n하지만, 두번째는 다릅니다. *가비지 콜렉터(GC)* 를 갖고 있는 언어들의 경우, GC가 더이상 사용하지 않는 메모리 조각을 계속해서 찾고 지워주며, 우리는 프로그래머로서 이와 관련한 생각을 안해도 됩니다. GC가 없을 경우, 할당받은 메모리가 더 필요없는 시점을 알아서 명시적으로 이를 반납하는 코드를 호출하는 것은 프로그래머의 책임입니다. 이를 올바르게 하는 것은 역사적으로 어려운 문제로 취급받았습니다. 우리가 잊어먹으면? 메모리를 낭비하는 것이죠. 너무 빨리 반납해버리면? 유효하지 않은 변수를 갖게 될 겁니다. 만일 반납을 두번하면? 이것도 버그죠. 우리는 딱 한번의 `allocate`와 한번의 `free` 쌍을 사용해야 합니다.\n\n러스트는 다른 방식으로 이 문제를 다룹니다: 메모리는 변수가 소속되어 있는 스코프 밖으로 벗어나는 순간 자동으로 반납됩니다. 여기 스트링 리터럴 대신 `String`을 사용한 Listing 1의 스코프 예제가 있습니다:\n\n```rust\n\n{\n    let s = String::from(\"hello\"); // s는 여기서부터 유효합니다\n\n    // s를 가지고 뭔가 합니다\n}                                  // 이 스코프는 끝났고, s는 더 이상\n                                   // 유효하지 않습니다\n\n```\n\n`String`이 요구한 메모리를 운영체제에게 반납하는 자연스러운 지점이 있죠: `s`가 스코프 밖으로 벗어날 때입니다. 변수가 스코프 밖으로 벗어나면, 러스트는 우리를 위해 특별한 함수를 호출합니다. 이 함수를 `drop`이라고 부르고, `String`의 개발자가 메모리를 반환하도록 하는 코드를 집어넣을 수 있습니다. 러스트는 `}` 괄호가 닫힐때 자동적으로 `drop`을 호출합니다.\n\n> 노트: C++에서는 이렇게 아이템의 수명주기의 끝나는 시점에 자원을 해제하는 패턴을 종종 자원 습득이 곧 초기화 (Resource Acquisition Is Initialization, RAII) 라고 부릅니다. 러스트의 drop 함수는 여러분이 RAII 패턴을 경험해본 적 있다면 익숙할 것입니다.\n> \n\n이 패턴은 러스트 코드가 작성되는 방법에 깊은 영향을 줍니다. 지금은 단순해 보이시겠지만, 우리가 힙에 할당시킨 데이터를 사용하는 여러 개의 변수를 사용하고자 할 경우와 같이 좀더 복잡한 상황에서, 코드의 동작은 예기치 못할 수 있습니다. 이제 그런 경우들을 좀더 탐험해봅시다.\n\n### 변수와 데이터가 상호작용하는 방법: 이동(move)\n\n여러 개의 변수들은 러스트에서 서로 다른 방식으로 같은 데이터에 대해 상호작용을 할 수 있습니다. Listing 2의 정수형을 이용한 예제를 한번 보겠습니다:\n\n```rust\n\nlet x = 5;\nlet y = x;\n\n```\n\nListing 2: 변수 `x`의 정수값을 `y`에 대입하기\n\n우리는 아마도 다른 언어들에서의 경험을 토대로 어떤 일이 벌어지는지 추측할 수 있습니다: “정수값 `5`를 `x`에 묶어놓고; `x`의 값의 복사본을 만들어 `y`에 묶는다.” 우리는 이제 `x`와 `y` 두 개의 변수를 갖게 되었고, 둘 다 `5`와 같습니다. 정수값이 결정되어 있는 고정된 크기의 단순한 값이고, `5`라는 값들이 스택에 푸쉬되기 때문에, 실제로도 이렇게 됩니다.\n\n이제 `String` 버전을 봅시다:\n\n```rust\n\nlet s1 = String::from(\"hello\");\nlet s2 = s1;\n\n```\n\n이 코드는 이전의 코드와 매우 유사해 보여서, 동작하는 방식도 동일할 것이라고 가정할지도 모르겠습니다: 즉, 두번째 줄이 `s1`의 복사본을 만들어서 `s2`에 묶어놓는 식으로 말이죠. 그렇지만 이는 실제 동작과 다른 생각입니다.\n\n좀 더 완전히 설명하기 위해, `String`이 Figure 3에서와 같이 생겼다는 것을 주목합시다. `String`은 그림의 왼쪽과 같이 세 개의 부분으로 이루어져 있습니다: 문자열의 내용물을 담고 있는 메모리의 포인터, 길이, 그리고 용량입니다. 이 데이터의 그룹은 스택에 저장됩니다. 내용물을 담은 오른쪽의 것은 힙 메모리에 있습니다.\n\n![https://rinthel.github.io/rust-lang-book-ko/img/trpl04-01.svg](https://rinthel.github.io/rust-lang-book-ko/img/trpl04-01.svg)\n\nFigure 3: `s1` 변수에 `\"hello\"`값이 저장된 `String`의 메모리 구조\n\n길이값은 바이트 단위로 `String`의 내용물이 얼마나 많은 메모리를 현재 사용하고 있는지를 말합니다. 용량값은 바이트 단위로 `String`이 운영체제로부터 얼마나 많은 양의 메모리를 할당 받았는지를 말합니다. 길이와 용량의 차이는 중요합니다만, 이번 내용에서는 아닙니다. 그러니까 현재로서는 용량값을 무시하셔도 좋겠습니다.\n\n`s2`에 `s1`을 대입하면, `String` 데이터가 복사되는데, 이는 스택에 있는 포인터, 길이값, 그리고 용량값이 복사된다는 의미입니다. 포인터가 가리키고 있는 힙 메모리 상의 데이터는 복사되지 않습니다. 달리 말하면, 메모리 내의 데이터 구조는 Figure 4와 같이 됩니다.\n\n![https://rinthel.github.io/rust-lang-book-ko/img/trpl04-02.svg](https://rinthel.github.io/rust-lang-book-ko/img/trpl04-02.svg)\n\nFigure 4: `s1`의 포인터, 길이값, 용량값이 복사된 `s2` 변수의 메모리 구조\n\n메모리 구조는 Figure 5와 같지 *않는데*, 이 그림은 러스트가 힙 메모리 상의 데이터까지도 복사한다면 벌어질 일입니다. 만일 러스트가 이렇게 동작한다면, 힙 안의 데이터가 클 경우 `s2 = s1` 연산은 런타임 상에서 매우 느려질 가능성이 있습니다.\n\n![https://rinthel.github.io/rust-lang-book-ko/img/trpl04-03.svg](https://rinthel.github.io/rust-lang-book-ko/img/trpl04-03.svg)\n\nFigure 5: 러스트가 힙 데이터까지 복사하게 될 경우 `s2 = s1`가 만들 또다른 가능성\n\n앞서 우리는 변수가 스코프 밖으로 벗어날 때, 러스트는 자동적으로 `drop`함수를 호출하여 해당 변수가 사용하는 힙 메모리를 제거한다고 했습니다. 하지만 Figure 4에서는 두 데이터 포인터가 모두 같은 곳을 가리키고 있는 것이 보입니다. 이는 곧 문제가 됩니다: `s2`와 `s1`이 스코프 밖으로 벗어나게 되면, 둘 다 같은 메모리를 해제하려 할 것입니다. 이는 *두번 해제* (*double free*) 오류라고 알려져 있으며 이전에 언급한 바 있는 메모리 안정성 버그들 중 하나입니다. 메모리를 두번 해제하는 것은 메모리 손상(memory corruption)의 원인이 되는데, 이는 보안 취약성 문제를 일으킬 가능성이 있습니다.\n\n메모리 안정성을 보장하기 위해서, 러스트에서는 이런 경우 어떤 일이 일어나는지 한가지 더 디테일이 있습니다. 할당된 메모리를 복사하는 것을 시도하는 대신, 러스트에서는 `s1`이 더이상 유효하지 않다고 간주하고, 그러므로 러스트는 `s1`가 스코프 밖으로 벗어났을 때 이무것도 해제할 필요가 없어집니다. `s1`을 `s2`가 만들어진 후에 사용하려고 할때 어떤 일이 벌어지는지 확인해 봅시다:\n\n```rust\n\nlet s1 = String::from(\"hello\");\nlet s2 = s1;\n\nprintln!(\"{}, world!\", s1);\n\n```\n\n여러분은 아래와 같은 에러 메세지를 보게 될텐데, 그 이유는 러스트가 여러분으로부터 유효하지 않은 참조자를 사용하는 것을 막기 때문입니다:\n\n```\n\nerror[E0382]: use of moved value: `s1`\n --> src/main.rs:4:27\n  |\n3 |     let s2 = s1;\n  |         -- value moved here\n4 |     println!(\"{}, world!\", s1);\n  |                            ^^ value used here after move\n  |\n  = note: move occurs because `s1` has type `std::string::String`,\nwhich does not implement the `Copy` trait\n\n```\n\n만일 여러분이 다른 언어로 프로그래밍 하는 동안 “얕은 복사(shallow copy)”와 “깊은 복사(deep copy)”라는 용어를 들어보셨다면, 데이터의 복사 없이 포인터와 길이값 및 용량값만 복사한다는 개념이 얕은 복사와 비슷하게 들릴지도 모르겠습니다. 하지만 러스트는 첫번째 변수를 무효화 시키기도 하기 때문에, 이를 얕은 복사라고 부르는 대신 *이동*(*move*)이라 말합니다. 여기서 우리는 `s1`이 `s2`로 *이동되었다*라고 말하는 식으로 위 코드를 읽을 것입니다. 그러므로 실제로 일어낸 일은 Figure 6과 같습니다.\n\n![https://rinthel.github.io/rust-lang-book-ko/img/trpl04-04.svg](https://rinthel.github.io/rust-lang-book-ko/img/trpl04-04.svg)\n\nFigure 6: `s1`이 무효화된 후의 메모리 구조\n\n이것이 우리 문제를 해결해줍니다! 오직 `s2`만 유효한 상황에서, 스코프 밖으로 벗어나면 혼자 메모리를 해제할 것이고, 일이 잘 처리되겠습니다.\n\n여기에 더해서, 이러한 경우가 함축하는 디자인 선택이 있습니다: 러스트는 결코 자동적으로 여러분의 데이터에 대한 “깊은” 복사본을 만들지 않을 것입니다. 그러므로, 어떠한 *자동적인* 복사라도 런타임 실행 과정에서 효율적일 것이라 가정할 수 있습니다.\n\n### 변수와 데이터가 상호작용하는 방법: 클론\n\n만일 `String`의 스택 데이터 만이 아니라, 힙 데이터를 깊이 복사하기를 정말 원한다면, `clone`이라 불리우는 공용 메소드를 사용할 수 있습니다. 이 메소드가 많은 프로그래밍 언어들 사이에서 흔한 특성이기 때문에, 여려분은 아마도 전에 이런 것들을 본적이 있을지도 모르겠습니다.\n\n`clone` 메소드가 동작하는 예제를 보겠습니다:\n\n```rust\n\nlet s1 = String::from(\"hello\");\nlet s2 = s1.clone();\n\nprintln!(\"s1 = {}, s2 = {}\", s1, s2);\n\n```\n\n이 코드는 잘 동작하고 Figure 5가 나타내는, 즉 힙 데이터가 *정말로* 복사되는 동작을 여러분이 명시적으로 만들어낼 수 있는 방법입니다.\n\n`clone`을 호출하는 부분을 보면, 어떤 비용이 많이 들어갈지도 모르는 코드가 실행되는 중이란 것을 알 수 있게 됩니다. 이는 무언가 다른 동작이 수행되는 것을 알려주는 시각적인 지시자입니다.\n\n### 스택에만 있는 데이터: 복사\n\n우리가 아직 다루지 않은 또다른 부분이 있습니다. 아래 코드는 앞서 Listing 2에서 본 정수값을 이용하는 코드로, 잘 동작하며 유효합니다:\n\n```rust\n\nlet x = 5;\nlet y = x;\n\nprintln!(\"x = {}, y = {}\", x, y);\n\n```\n\n하지만 이 코드는 우리가 방금 배운 것과 대립되는 것처럼 보입니다: `clone`을 호출하지 않았지만, `x`도 유효하며 `y`로 이동하지도 않았지요.\n\n그 이유는 정수형과 같이 컴파일 타임에 결정되어 있는 크기의 타입은 스택에 모두 저장되기 때문에, 실제 값의 복사본이 빠르게 만들어질 수 있습니다. 이는 변수 `y`가 생성된 후에 `x`가 더 이상 유효하지 않도록 해야할 이유가 없다는 뜻입니다. 바꿔 말하면, 여기서는 깊은 복사와 얕은 복사 간의 차이가 없다는 것으로, `clone`을 호출하는 것이 보통의 얕은 복사와 아무런 차이점이 없어 우리는 이를 그냥 버릴 수 있다는 것입니다.\n\n러스트는 정수형과 같이 스택에 저장할 수 있는 타입에 대해 달수 있는 `Copy` 트레잇이라고 불리우는 특별한 어노테이션(annotation)을 가지고 있습니다. 만일 어떤 타입이 `Copy` 트레잇을 갖고 있다면, 대입 과정 후에도 예전 변수를 계속 사용할 수 있습니다. 러스트는 만일 그 타입 혹은 그 타입이 가지고 있는 부분 중에서 `Drop` 트레잇을 구현한 것이 있다면 `Copy` 트레잇을 어노테이션 할 수 없게끔 합니다. 만일 어떤 타입이 스코프 밖으로 벗어났을 때 어떤 특수한 동작을 필요로 하고 우리가 그 타입에 대해 `Copy` 어노테이션을 추가한다면, 컴파일 타임 오류를 보게 됩니다. `Copy` 어노테이션을 여러분의 타입에 어떤 식으로 추가하는지 알고 싶다면, 부록 C의 파생 가능한 트레잇(Derivable Traits)을 보세요.\n\n그래서 어떤 타입이 `Copy`가 될까요? 여러분은 주어진 타입에 대해 확신을 하기 위해 문서를 확인할 수도 있겠지만, 일반적인 규칙으로서 단순한 스칼라 값들의 묶음은 `Copy`가 가능하고, 할당이 필요하거나 어떤 자원의 형태인 경우 `Copy`를 사용할 수 없습니다. `Copy`가 가능한 몇가지 타입을 나열해 보겠습니다:\n\n- `u32`와 같은 모든 정수형 타입들\n- `true`와 `false`값을 갖는 부울린 타입 `bool`\n- `f64`와 같은 모든 부동 소수점 타입들\n- `Copy`가 가능한 타입만으로 구성된 튜플들. `(i32, i32)`는 `Copy`가 되지만, `(i32, String)`은 안됩니다.\n\n### 소유권과 함수\n\n함수에게 값을 넘기는 의미론(semantics)은 값을 변수에 대입하는 것과 유사합니다. 함수에게 변수를 넘기는 것은 대입과 마찬가지로 이동하거나 복사될 것입니다. Listing 7은 변수가 스코프 안으로 들어갔다 밖으로 벗어나는 것을 주석과 함께 보여주는 예입니다:\n\n```rust\n\nfn main() {\n    let s = String::from(\"hello\");  // s가 스코프 안으로 들어왔습니다.\n\n    takes_ownership(s);             // s의 값이 함수 안으로 이동했습니다...\n                                    // ... 그리고 이제 더이상 유효하지 않습니다.\n    let x = 5;                      // x가 스코프 안으로 들어왔습니다.\n\n    makes_copy(x);                  // x가 함수 안으로 이동했습니다만,\n                                    // i32는 Copy가 되므로, x를 이후에 계속\n                                    // 사용해도 됩니다.\n\n} // 여기서 x는 스코프 밖으로 나가고, s도 그 후 나갑니다. 하지만 s는 이미 이동되었으므로,\n  // 별다른 일이 발생하지 않습니다.\n\nfn takes_ownership(some_string: String) { // some_string이 스코프 안으로 들어왔습니다.\n    println!(\"{}\", some_string);\n} // 여기서 some_string이 스코프 밖으로 벗어났고 `drop`이 호출됩니다. 메모리는\n  // 해제되었습니다.\n\nfn makes_copy(some_integer: i32) { // some_integer이 스코프 안으로 들어왔습니다.\n    println!(\"{}\", some_integer);\n} // 여기서 some_integer가 스코프 밖으로 벗어났습니다. 별다른 일은 발생하지 않습니다.\n\n```\n\nListing 7: 소유권과 스코프에 대한 설명이 주석으로 달린 함수들\n\n만일 우리가 `s`를 `takes_ownership` 함수를 호출한 이후에 사용하려 한다면, 러스트는 컴파일 타임 오류를 낼 것입니다. 이러한 정적 확인은 여러 실수들을 방지해 줍니다. 이후에 변수들을 사용할 수 있는지, 그리고 그러한 것을 소유권 규칙이 막아주는지를 확인해보려면 `main` 안에 `s`와 `x`에 관한 코드를 추가해보세요.\n\n### 반환 값과 스코프\n\n값의 반환 또한 소유권을 이동시킵니다. Listing 7과 비슷한 주석이 달린 예제를 하나 봅시다:\n\n```rust\n\nfn main() {\n    let s1 = gives_ownership();         // gives_ownership은 반환값을 s1에게\n                                        // 이동시킵니다.\n\n    let s2 = String::from(\"hello\");     // s2가 스코프 안에 들어왔습니다.\n\n    let s3 = takes_and_gives_back(s2);  // s2는 takes_and_gives_back 안으로\n                                        // 이동되었고, 이 함수가 반환값을 s3으로도\n                                        // 이동시켰습니다.\n\n} // 여기서 s3는 스코프 밖으로 벗어났으며 drop이 호출됩니다. s2는 스코프 밖으로\n  // 벗어났지만 이동되었으므로 아무 일도 일어나지 않습니다. s1은 스코프 밖으로\n  // 벗어나서 drop이 호출됩니다.\n\nfn gives_ownership() -> String {             // gives_ownership 함수가 반환 값을\n                                             // 호출한 쪽으로 이동시킵니다.\n\n    let some_string = String::from(\"hello\"); // some_string이 스코프 안에 들어왔습니다.\n\n    some_string                              // some_string이 반환되고, 호출한 쪽의\n                                             // 함수로 이동됩니다.\n}\n\n// takes_and_gives_back 함수는 String을 하나 받아서 다른 하나를 반환합니다.\nfn takes_and_gives_back(a_string: String) -> String { // a_string이 스코프\n                                                      // 안으로 들어왔습니다.\n\n    a_string  // a_string은 반환되고, 호출한 쪽의 함수로 이동됩니다.\n}\n\n```\n\n변수의 소유권은 모든 순간 똑같은 패턴을 따릅니다: 어떤 값을 다른 변수에 대입하면 값이 이동됩니다. 힙에 데이터를 갖고 있는 변수가 스코프 밖으로 벗어나면, 해당 값은 데이터가 다른 변수에 의해 소유되도록 이동하지 않는한 `drop`에 의해 제거될 것입니다.\n\n모든 함수가 소유권을 가졌다가 반납하는 것은 조금 지루해 보입니다. 만일 함수에게 값을 사용할 수 있도록 하되 소유권은 갖지 않도록 하고 싶다면요? 함수의 본체로부터 얻어진 결과와 더불어 우리가 넘겨주고자 하는 어떤 값을 다시 쓰고 싶어서 함께 반환받아야 한다면 꽤나 짜증나겠지요.\n\n이게 아래와 같이 튜플을 이용하여 여러 값을 돌려받는 식으로 가능하긴 합니다:\n\n```rust\n\nfn main() {\n    let s1 = String::from(\"hello\");\n\n    let (s2, len) = calculate_length(s1);\n\n    println!(\"The length of \'{}\' is {}.\", s2, len);\n}\n\nfn calculate_length(s: String) -> (String, usize) {\n    let length = s.len(); // len()함수는 문자열의 길이를 반환합니다.\n\n    (s, length)\n}\n\n```\n\n하지만 이건 너무 많이 나간 의례절차고 일반적인 개념로서는 과한 작업이 됩니다. 운좋게도, 러스트는 이를 위한 기능을 갖고 있으며, *참조자*(*references*)라고 부릅니다.','2022-09-05 12:46:28.191000','소유권',11),(12,'앞 절의 마지막에 등장한 튜플을 이용하는 이슈는 `String`을 호출하는 함수 쪽으로 반환함으로써 `calculate_length`를 호출한 이후에도 여전히 `String`을 이용할 수 있도록 하는 것인데, 그 이유는 `String`이 `calculate_length` 안쪽으로 이동되었기 때문입니다.\n\n여기 값의 소유권을 넘기는 대신 개체에 대한 *참조자*(*reference*)를 인자로 사용하는 `calculate_length` 함수를 정의하고 이용하는 방법이 있습니다:\n\n```rust\n\nfn main() {\n    let s1 = String::from(\"hello\");\n\n    let len = calculate_length(&s1);\n\n    println!(\"The length of \'{}\' is {}.\", s1, len);\n}\n\nfn calculate_length(s: &String) -> usize {\n    s.len()\n}\n\n```\n\n첫번째로, 변수 선언부와 함수 반환값에 있던 튜플 코드가 모두 없어진 것에 주목하세요. 두번째로, `calculate_length` 함수에 `&s1`를 넘기고, 함수의 정의 부분에는 `String`이 아니라 `&String`을 이용했다는 점을 기억하세요.\n\n이 엠퍼센드(&) 기호가 *참조자*이며, 이는 여러분이 어떤 값을 소유권을 넘기지 않고 참조할수 있도록 해줍니다. Figure 1은 이에 대한 다이어그램입니다.\n\n![https://rinthel.github.io/rust-lang-book-ko/img/trpl04-05.svg](https://rinthel.github.io/rust-lang-book-ko/img/trpl04-05.svg)\n\nFigure 1: `String s1`을 가리키고 있는 `&String s`\n\n함수 호출 부분을 좀 더 자세히 봅시다:\n\n```rust\n\nlet s1 = String::from(\"hello\");\n\nlet len = calculate_length(&s1);\n\n```\n\n`&s1` 문법은 우리가 `s1`의 값을 *참조*하지만 소유하지는 않는 참조자를 생성하도록 해줍니다. 소유권을 갖고 있지는 않기 때문에, 이 참조자가 가리키는 값은 참조자가 스코프 밖으로 벗어났을 때도 메모리가 반납되지 않을 것입니다.\n\n비슷한 이치로, 함수 시그니처도 `&`를 사용하여 인자 `s`의 타입이 참조자라는 것을 나타내고 있습니다. 설명을 위한 주석을 달아봅시다:\n\n```rust\n\nfn calculate_length(s: &String) -> usize { // s는 String의 참조자입니다\n    s.len()\n} // 여기서 s는 스코프 밖으로 벗어났습니다. 하지만 가리키고 있는 값에 대한 소유권이 없기\n  // 때문에, 아무런 일도 발생하지 않습니다.\n\n```\n\n변수 `s`가 유효한 스코프는 여느 함수의 파라미터의 스코프와 동일하지만, 소유권을 갖고 있지 않으므로 이 참조자가 스코프 밖으로 벗어났을 때 참조자가 가리키고 있는 값은 버리지 않습니다. 또한 실제 값 대신 참조자를 파라미터로 갖고 있는 함수는 소유권을 갖고 있지 않기 때문에 소유권을 되돌려주기 위해 값을 다시 반환할 필요도 없다는 뜻이 됩니다.\n\n함수의 파라미터로 참조자를 만드는 것을 *빌림*이라고 부릅니다. 실제 생활에서 만일 어떤 사람이 뭔가를 소유하고 있다면, 여러분은 그걸 빌릴 수 있습니다. 여러분의 용무가 끝났을 때는 그것을 돌려주어야 합니다.\n\n그러니까 만일 우리가 빌린 무언가를 고치려고 시도한다면 무슨 일이 생길까요? Listing 2의 코드를 시험해보세요. 스포일러 경고: 작동이 안될겁니다!\n\n```rust\n\nfn main() {\n    let s = String::from(\"hello\");\n\n    change(&s);\n}\n\nfn change(some_string: &String) {\n    some_string.push_str(\", world\");\n}\n\n```\n\nListing 2: 빌린 값을 고치려 해보기\n\n여기 오류를 보시죠:\n\n```\n\nerror: cannot borrow immutable borrowed content `*some_string` as mutable\n --> error.rs:8:5\n  |\n8 |     some_string.push_str(\", world\");\n  |     ^^^^^^^^^^^\n\n```\n\n변수가 기본적으로 불변인 것처럼, 참조자도 마찬가지입니다. 우리가 참조하는 어떤 것을 변경하는 것은 허용되지 않습니다.\n\n### [가변 참조자(Mutable References)](https://rinthel.github.io/rust-lang-book-ko/ch04-02-references-and-borrowing.html#%EA%B0%80%EB%B3%80-%EC%B0%B8%EC%A1%B0%EC%9E%90mutable-references)\n\nListing 2의 코드를 살짝만 바꾸면 오류를 고칠 수 있습니다:\n\n```rust\n\nfn main() {\n    let mut s = String::from(\"hello\");\n\n    change(&mut s);\n}\n\nfn change(some_string: &mut String) {\n    some_string.push_str(\", world\");\n}\n\n```\n\n먼저 `s`를 `mut`로 바꿔야 합니다. 그리고 `&mut s`로 가변 참조자를 생성하고 `some_string: &mut String`으로 이 가변 참조자를 받아야 합니다.\n\n하지만 가변 참조자는 딱 한가지 큰 제한이 있습니다: 특정한 스코프 내에 특정한 데이터 조각에 대한 가변 참조자를 딱 하나만 만들 수 있다는 겁니다. 아래 코드는 실패할 겁니다:\n\n```rust\n\nlet mut s = String::from(\"hello\");\n\nlet r1 = &mut s;\nlet r2 = &mut s;\n\n```\n\n여기 오류를 보시죠:\n\n```\n\nerror[E0499]: cannot borrow `s` as mutable more than once at a time\n --> borrow_twice.rs:5:19\n  |\n4 |     let r1 = &mut s;\n  |                   - first mutable borrow occurs here\n5 |     let r2 = &mut s;\n  |                   ^ second mutable borrow occurs here\n6 | }\n  | - first borrow ends here\n\n```\n\n이 제한 사항은 가변을 허용하긴 하지만 매우 통제된 형식으로 허용합니다. 이것이 새로운 러스트인들이 힘들어하는 부분인데, 대부분의 언어들은 여러분이 원하는대로 값을 변형하도록 해주기 때문입니다. 하지만 이러한 제한이 가지는 이점은 바로 러스트가 컴파일 타임에 데이터 레이스(data race)를 방지할 수 있도록 해준다는 것입니다.\n\n*데이터 레이스*는 아래에 정리된 세 가지 동작이 발생했을때 나타나는 특정한 레이스 조건입니다:\n\n1. 두 개 이상의 포인터가 동시에 같은 데이터에 접근한다.\n2. 그 중 적어도 하나의 포인터가 데이터를 쓴다.\n3. 데이터에 접근하는데 동기화를 하는 어떠한 메커니즘도 없다.\n\n데이터 레이스는 정의되지 않은 동작을 일으키고 런타임에 이를 추적하고자 할 때는 이를 진단하고 고치기 어려울 수 있습니다; 러스트는 데이터 레이스가 발생할 수 있는 코드가 컴파일 조차 안되기 때문에 이 문제의 발생을 막아버립니다!\n\n항상 우리는 새로운 스코프를 만들기 위해 중괄호를 사용하는데, 이는 그저 *동시*에 만드는 것이 아니게 해줌으로써, 여러 개의 가변 참조자를 만들 수 있도록 해줍니다.\n\n```rust\n\nlet mut s = String::from(\"hello\");\n\n{\n    let r1 = &mut s;\n\n} // 여기서 r1은 스코프 밖으로 벗어났으므로, 우리는 아무 문제 없이 새로운 참조자를 만들 수 있습니다.\n\nlet r2 = &mut s;\n\n```\n\n가변 참조자와 불변 참조자를 혼용할 경우에 대한 비슷한 규칙이 있습니다. 아래 코드는 컴파일 오류가 발생합니다:\n\n```rust\n\nlet mut s = String::from(\"hello\");\n\nlet r1 = &s; // 문제 없음\nlet r2 = &s; // 문제 없음\nlet r3 = &mut s; // 큰 문제\n\n```\n\n여기 오류 메세지를 보시죠:\n\n```\n\nerror[E0502]: cannot borrow `s` as mutable because it is also borrowed as\nimmutable\n --> borrow_thrice.rs:6:19\n  |\n4 |     let r1 = &s; // 문제 없음\n  |               - immutable borrow occurs here\n5 |     let r2 = &s; // 문제 없음\n6 |     let r3 = &mut s; // 큰 문제\n  |                   ^ mutable borrow occurs here\n7 | }\n  | - immutable borrow ends here\n\n```\n\n어휴! 우리는 불변 참조자를 가지고 있을 동안에도 *역시* 가변 참조자를 만들 수 없습니다. 불변 참조자의 사용자는 사용중인 동안에 값이 값자기 바뀌리라 예상하지 않습니다! 하지만 여러 개의 불변 참조자는 만들 수 있는데, 데이터를 그냥 읽기만하는 것은 다른 것들이 그 데이터를 읽는데에 어떠한 영향도 주지 못하기 때문입니다.\n\n때때로 이러한 오류들이 여러분을 좌절시킬지라도, 이것이 러스트 컴파일러가 (런타임이 아니라 컴파일 타임에) 일찌감치 잠재된 버그를 찾아내고, 왜 여러분의 데이터가 여러분 생각대로의 값을 갖고 있지 않은지 추적해 내려가는 대신 어느 지점이 문제인지를 정확히 보여주는 기능이란 점을 기억하세요.\n\n### 댕글링 참조자(Dangling References)\n\n포인터가 있는 언어에서는 자칫 잘못하면 *댕글링 포인터(dangling pointer)* 를 만들기 쉬운데, 댕글링 포인터란 어떤 메모리를 가리키는 포인터를 보존하는 동안, 그 메모리를 해제함으로써 다른 개체에게 사용하도록 줘버렸을 지도 모를 메모리를 참조하고 있는 포인터를 말합니다. 이와는 반대로, 러스트에서는 컴파일러가 모든 참조자들이 댕글링 참조자가 되지 않도록 보장해 줍니다: 만일 우리가 어떤 데이터의 참조자를 만들었다면, 컴파일러는 그 참조자가 스코프 밖으로 벗어나기 전에는 데이터가 스코프 밖으로 벗어나지 않을 것임을 확인해 줄 것입니다.\n\n댕글링 참조자를 만드는 시도를 해봅시다:\n\n```rust\n\nfn main() {\n    let reference_to_nothing = dangle();\n}\n\nfn dangle() -> &String {\n    let s = String::from(\"hello\");\n\n    &s\n}\n\n```\n\n위 코드의 오류 메세지입니다:\n\n```\n\nerror[E0106]: missing lifetime specifier\n --> dangle.rs:5:16\n  |\n5 | fn dangle() -> &String {\n  |                ^^^^^^^\n  |\n  = help: this function\'s return type contains a borrowed value, but there is no\n    value for it to be borrowed from\n  = help: consider giving it a \'static lifetime\n\nerror: aborting due to previous error\n\n```\n\n이 오류 메세지는 우리가 아직 다루지 못한 특성을 인용하고 있습니다: 바로 *라이프타임(lifetime)* 입니다. 라이프타임에 대한 것은 10장에서 자세히 다룰 것입니다. 하지만 여러분이 라이프타임에 대한 부분을 무시한다면, 이 메세지는 이 코드가 왜 문제인지를 알려줄 열쇠를 쥐고 있습니다:\n\n```\n\nthis function\'s return type contains a borrowed value, but there is no value\nfor it to be borrowed from.\n(해석: 이 함수의 반환 타입은 빌린 값을 포함하고 있는데, 빌려온 실제 값은 없습니다.)\n\n```\n\n`dangle` 코드 부분의 각 단계에서 어떤 일이 벌어지는지 더 면밀히 들여다봅시다:\n\n```rust\n\nfn dangle() -> &String { // dangle은 String의 참조자를 반환합니다\n\n    let s = String::from(\"hello\"); // s는 새로운 String입니다\n\n    &s // 우리는 String s의 참조자를 반환합니다.\n} // 여기서 s는 스코프를 벗어나고 버려집니다. 이것의 메모리는 사라집니다.\n  // 위험하군요!\n\n```\n\n`s`가 `dangle`안에서 만들어졌기 때문에, `dangle`의 코드가 끝이나면 `s`는 할당 해제됩니다. 하지만 우리는 이것의 참조자를 반환하려고 했습니다. 이는 곧 이 참조자가 어떤 무효화된 `String`을 가리키게 될 것이란 뜻이 아닙니까! 별로 안 좋죠. 러스트는 우리가 이런 짓을 못하게 합니다.\n\n여기서의 해법은 `String`을 직접 반환하는 것입니다:\n\n```rust\n\nfn no_dangle() -> String {\n    let s = String::from(\"hello\");\n\n    s\n}\n\n```\n\n이 코드는 아무런 문제없이 동작합니다. 소유권이 밖으로 이동되었고, 아무것도 할당 해제되지 않습니다.\n\n### 참조자의 규칙\n\n우리가 참조자에 대해 논의한 것들을 정리해 봅시다:\n\n1. 어떠한 경우이든 간에, 여러분은 아래 둘 다는 아니고 *둘 중 하나만* 가질 수 있습니다:\n    - 하나의 가변 참조자\n    - 임의 개수의 불변 참조자들\n2. 참조자는 항상 유효해야만 한다.','2022-09-05 12:48:05.726000','참조자와 빌림',12),(13,'참조자에 대한 이야기를 할 때, 중요한 디테일을 한 가지 남겨두었습니다: 러스트에서 모든 참조자는 *라이프타임(lifetime)* 을 갖는데, 이는 해당 참조자가 유효한 스코프입니다. 대부분의 경우에서 타입들이 추론되는 것과 마찬가지로, 대부분의 경우에서 라이프타임 또한 암묵적이며 추론됩니다. 여러 가지 타입이 가능하기 때문에 우리가 타입을 명시해야 하는 때와 비슷하게, 참조자의 라이프타임이 몇몇 다른 방식으로 연관될 수 있는 경우들이 있으므로, 러스트는 우리에게 제네릭 라이프타임 파라미터를 이용하여 이 관계들을 명시하길 요구하여 런타임에 실제 참조자가 확실히 유효하도록 확신할 수 있도록 합니다.\n\n네 그렇습니다. 이러한 개념은 다소 흔치 않으며, 여러분들이 다른 프로그래밍 언어에서 사용해온 도구들과는 다른 것입니다. 몇 가지 측면에서, 라이프타임은 러스트의 가장 독특한 기능입니다.\n\n라이프타임은 이 장에서 전체를 다룰 수 없는 큰 주제이므로, 이 장에서는 여러분이 이 개념에 친숙해질 수 있도록 여러분이 라이프타임 문법을 맞닥뜨릴 흔한 경우에 대해 다룰 것입니다. \n\n### 라이프타임은 댕글링 참조자를 방지합니다\n\n라이프타임의 주목적은 댕글링 참조자(dangling reference)를 방지하는 것인데, 댕글링 참조자는 프로그램이 우리가 참조하기로 의도한 데이터가 아닌 다른 데이터를 참조하는 원인이 됩니다. Listing 1의 프로그램과 같이 외부 스코프와 내부 스코프를 가진 프로그램을 생각해봅니다. 외부 스코프는 `r`이라는 이름의 변수를 초기값 없이 선언하였고, 내부 스코프는 `x`라는 이름의 변수를 초기값 5와 함께 선언했습니다. 내부 스코프 내에서, `x`의 참조자를 `r`에 대입하도록 시도했습니다. 그 후 내부 스코프는 끝났고, `r`의 값을 출력하도록 시도했습니다:\n\n```rust\n\n{\n    let r;\n\n    {\n        let x = 5;\n        r = &x;\n    }\n\n    println!(\"r: {}\", r);\n}\n\n```\n\nListing 1: 스코프 밖으로 벗어난 값에 대한 참조자를 사용하는 시도\n\n> 초기화되지 않은 변수는 사용할 수 없습니다\n> \n> \n> 다음에 나올 몇 가지 예제는 초기값을 주지 않고 변수를 선언하고 있으며, 따라서 해당 변수의 이름이 외부 스코프에 존재하고 있습니다. 이는 러스트가 널(null) 값을 갖지 않는다는 개념과 충돌을 일으키는 것처럼 보일지도 모릅니다. 그러나, 우리가 값을 제공하기 전에 변수를 사용하고자 시도하면, 컴파일 에러가 나올 것입니다. 시도해 보세요!\n> \n\n이 코드를 컴파일하면, 다음과 같은 에러가 나타날 것입니다:\n\n```text\n\nerror: `x` does not live long enough\n   |\n6  |         r = &x;\n   |              - borrow occurs here\n7  |     }\n   |     ^ `x` dropped here while still borrowed\n...\n10 | }\n   | - borrowed value needs to live until here\n\n```\n\n변수 `x`는 \"충분히 오래 살지 못한다(does not live long enough)\"고 합니다. 왜 안될까요? `x`는 7번 라인의 닫는 중괄호 기호에 도달했을 때 내부 스코프가 끝나면서 스코프 밖으로 벗어날 것입니다. 그러나 `r`은 외부 스코프에 대해 유효합니다; 이쪽의 스코프가 더 크고 우리는 이쪽이 \"더 오래 산다\"라고 말합니다. 만일 러스트가 이 코드를 작동하도록 허용한다면, `r`은 `x`가 스코프 밖으로 벗어났을 때 할당이 해제되는 메모리를 참조하게 될 것이고, `r`을 가지고 시도하려 했던 어떤 것이든 정확히 동작하지 않게 될 것입니다. 그렇다면 러스트는 이 코드가 허용되어서는 안 된다는 것을 어떻게 결정할까요?\n\n### 빌림 검사기(Borrow checker)\n\n*빌림 검사기(borrow checker)* 라고 불리는 컴파일러의 부분이 모든 빌림이 유효한지를 결정하기 위해 스코프를 비교합니다. Listing 2은 변수들의 라이프타임을 보여주는 주석과 함께 Listing 1과 동일한 예제를 보여줍니다:\n\n```rust\n\n{\n    let r;         // -------+-- \'a\n                   //        |\n    {              //        |\n        let x = 5; // -+-----+-- \'b\n        r = &x;    //  |     |\n    }              // -+     |\n                   //        |\n    println!(\"r: {}\", r); // |\n                   //        |\n                   // -------+\n}\n\n```\n\nListing 2: 각각 `\'a`과 `\'b`로 명명된 `r`과 `x`의 라이프타임에 대한 주석\n\n우리는 `r`의 라이프타임을 `\'a`라고 명명하였고, `x`의 라이프타임을 `\'b`라고 명명하였습니다. 보시다시피, 내부의 `\'b` 블록은 외부의 `\'a` 라이프타임 블록에 비해 훨씬 작습니다. 컴파일 타임에서, 러스트는 두 라이프타임의 크기를 비교하고 `r`이 `\'a` 라이프타임을 가지고 있지만, `\'b` 라이프타임을 가지고 있는 어떤 오브젝트를 참조하고 있음을 보게 됩니다. `\'b` 라이프타임이 `\'a` 라이프타임에 비해 작기 때문에 러스트 컴파일러는 이 프로그램을 거부합니다: 참조자의 주체가 참조자만큼 오래 살지 못하고 있으니까요.\n\n댕글링 참조자를 만드는 시도가 없고 에러 없이 컴파일되는 Listing 3의 예제를 살펴봅시다:\n\n```rust\n\n{\n    let x = 5;            // -----+-- \'b\n                          //      |\n    let r = &x;           // --+--+-- \'a\n                          //   |  |\n    println!(\"r: {}\", r); //   |  |\n                          // --+  |\n}                         // -----+\n\n```\n\nListing 3: 데이터가 참조자에 비해 더 긴 라이프타임을 갖고 있기 때문에 유효한 참조자\n\n여기서 `x`는 라이프타임 `\'b`를 갖고 있는데, 위의 경우 `\'a`에 비해 더 큽니다. 이는 `r`이 `x`를 참고할 수 있음을 의미합니다: 러스트는 `r`의 참조자가 `x`가 유효한 동안 언제나 유효할 것이라는 점을 알고 있습니다.\n\n지금까지 참조자의 라이프타임이 구체적인 예제 어디에 나오는지를 보았고 러스트가 어떻게 라이프타임을 분석하여 참조자가 항상 유효하도록 확신시키는지를 논의했으니, 이제 함수의 내용물 내에 있는 파라미터와 반환 값에 대한 제네릭 라이프타임에 대하여 이야기해 봅시다.\n\n### 함수에서의 제네릭 라이프타임\n\n두 스트링 슬라이스 중에서 긴 쪽을 반환하는 함수를 작성해 봅시다. 이 함수에 두 개의 스트링 슬라이스를 넘겨서 호출할 수 있기를 원하고, 스트링 슬라이스를 반환하기를 원합니다. Listing 4의 코드는 `longest` 함수를 구현하면 `The longest string is abcd`를 출력해야 합니다:\n\n```rust\n\nfn main() {\n    let string1 = String::from(\"abcd\");\n    let string2 = \"xyz\";\n\n    let result = longest(string1.as_str(), string2);\n    println!(\"The longest string is {}\", result);\n}\n\n```\n\nListing 4: 두 스트링 슬라이스 중 긴 쪽을 찾기 위해 `longest` 함수를 호출하는 `main` 함수\n\n`longest` 함수가 인자의 소유권을 얻는 것을 원치 않기 때문에 스트링 슬라이스들을 파라미터로서 갖는 함수를 원한다는 점을 주목하세요. 우리는 함수가 `String`의 슬라이스 (이는 변수 `string1`의 타입입니다)는 물론 스트링 리터럴 (이는 변수 `string2`가 담고 있는 것이지요) 또한 받아들일 수 있기를 원하고 있습니다.\n\n만일 Listing 5에서 보는 바와 같이 `longest` 함수를 구현하는 시도를 한다면, 이는 컴파일되지 않을 것입니다:\n\n```rust\n\nfn longest(x: &str, y: &str) -> &str {\n    if x.len() > y.len() {\n        x\n    } else {\n        y\n    }\n}\n\n```\n\nListing 5: 두 스트링 슬라이스 중 긴 쪽을 반환하는 `longest` 함수의 구현체, 그러나 아직 컴파일되지 않음\n\n대신 우리는 라이프타임에 대해 이야기하는 다음과 같은 에러를 얻습니다:\n\n```text\n\nerror[E0106]: missing lifetime specifier\n   |\n1  | fn longest(x: &str, y: &str) -> &str {\n   |                                 ^ expected lifetime parameter\n   |\n   = help: this function\'s return type contains a borrowed value, but the\n   signature does not say whether it is borrowed from `x` or `y`\n\n```\n\n이 도움말은 반환 타입에 대하여 제네릭 라이프타임 파라미터가 필요하다는 것을 말해주고 있는데, 왜냐하면 반환되는 참조자가 `x`를 참조하는지 혹은 `y`를 참조하는지를 러스트가 말할 수 없기 때문입니다. 사실, 우리 또한 모르는데, 이 함수의 본체 내의 `if` 블록은 `x`의 참조자를 반환하고 `else` 블록은 `y`의 참조자를 반환하기 때문입니다!\n\n우리가 이 함수를 정의하고 있는 시점에서, 우리는 이 함수에 넘겨지게 될 구체적인 값을 모르므로, `if` 케이스가 실행될지 혹은 `else` 케이스가 실행될지는 알 수 없습니다. 또한 함수에 넘겨지게 될 참조자의 구체적인 라이프타임을 알지 못하므로, 우리가 반환하는 참조자가 항상 유효한지를 결정하기 위해서 Listing 2과 3에서 했던 것과 같이 스코프를 살펴볼 수도 없습니다. 빌림 검사기 또한 이를 결정할 수 없는데, 그 이유는 `x`와 `y`의 라이프타임이 반환 값의 라이프타임과 어떻게 연관되어 있는지 알지 못하기 때문입니다. 우리는 참조자들 간의 관계를 정의하는 제네릭 라이프타임 파라미터를 추가하여 빌림 검사기가 분석을 수행할 수 있도록 할 것입니다.\n\n### 라이프타임 명시 문법\n\n라이프타임 명시는 연관된 참조자가 얼마나 오랫동안 살게 되는지를 바꾸지는 않습니다. 함수의 시그니처가 제네릭 타입 파라미터를 특정할 때 이 함수가 어떠한 타입이든 허용할 수 있는 것과 같은 방식으로, 함수의 시그니처가 제네릭 라이프타임 파라미터를 특정할 때라면 이 함수는 어떠한 라이프타임을 가진 참조자라도 허용할 수 있습니다. 라이프타임 명시가 하는 것은 여러 개의 참조자에 대한 라이프타임들을 서로 연관 짓도록 하는 것입니다.\n\n라이프타임 명시는 약간 독특한 문법을 갖고 있습니다: 라이프타임 파라미터의 이름은 어퍼스트로피 `\'`로 시작해야 합니다. 라이프타임 파라미터의 이름은 보통 모두 소문자이며, 제네릭 타입과 비슷하게 그들의 이름은 보통 매우 짧습니다. `\'a`는 대부분의 사람들이 기본적으로 사용하는 이름입니다. 라이프타임 파라미터 명시는 참조자의 `&` 뒤에 오며, 공백 문자가 라이프타임 명시와 참조자의 타입을 구분해줍니다.\n\n여기 몇 가지 예제가 있습니다: 라이프타임 파라미터가 없는 `i32`에 대한 참조자, `\'a`라고 명명된 라이프타임 파라미터를 가지고 있는 `i32`에 대한 참조자, 그리고 역시 라이프타임 `\'a`를 갖고 있는 `i32`에 대한 가변 참조자입니다:\n\n```text\n\n&i32        // a reference\n&\'a i32     // a reference with an explicit lifetime\n&\'a mut i32 // a mutable reference with an explicit lifetime\n\n```\n\n스스로에 대한 하나의 라이프타임 명시는 큰 의미를 가지고 있지 않습니다: 라이프타임 명시는 러스트에게 여러 개의 참조자에 대한 제네릭 라이프타임 파라미터가 서로 어떻게 연관되는지를 말해줍니다. 만일 라이프타임 `\'a`를 가지고 있는 `i32`에 대한 참조자인 `first`를 파라미터로, 그리고 또한 라이프타임 `\'a`를 가지고 있는 `i32`에 대한 또 다른 참조자인 `second`를 또 다른 파라미터로 가진 함수가 있다면, 이 두 개의 같은 이름을 가진 라이프타임 명시는 참조자 `first`와 `second`가 돌다 동일한 제네릭 라이프타임만큼 살아야 한다는 것을 가리킵니다.\n\n### 함수 시그니처 내의 라이프타임 명시\n\n우리가 작업하고 있던 `longest` 함수의 내용 중에서 라이프타임 명시 부분을 살펴봅시다. 제네릭 타입 파라미터와 마찬가지로, 제네릭 라이프타임 파라미터도 함수 이름과 파라미터 리스트 사이에 꺾쇠괄호를 쓰고 그 안에 정의가 되어야 합니다. 우리가 파라미터들과 반환 값에서의 참조자들에 대해 러스트에게 말해주고 싶은 제약사항은 그들이 모두 동일한 라이프타임을 갖고 있어야 한다는 것인데, 이는 Listing 6에서 보는 바와 같이 우리가 `\'a`라고 명명하여 각각의 참조자에 추가할 것입니다:\n\n```rust\n\nfn longest<\'a>(x: &\'a str, y: &\'a str) -> &\'a str {\n    if x.len() > y.len() {\n        x\n    } else {\n        y\n    }\n}\n\n```\n\nListing 6: 시그니처 내의 모든 참조자들이 동일한 라이프타임 `\'a`를 가지고 있어야 함을 특정한 `longest` 함수 정의\n\n이는 컴파일될 것이고 Listing 4에 있는 `main` 함수에서 사용되었을 때 우리가 원하는 결과를 만들어줄 것입니다.\n\n이 함수 시그니처는 이제 어떤 라이프타임 `\'a`에 대하여, 이 함수는 두 개의 파라미터를 갖게 될 것인데, 두 개 모두 적어도 라이프타임 `\'a`만큼 살아있는 스트링 슬라이스임을 말해줍니다. 이 함수는 또한 적어도 라이프타임 `\'a`만큼 살아있는 스트링 슬라이스를 반환할 것입니다. 이는 러스트에게 우리가 강제하고 싶은 것을 말해주는 계약입니다.\n\n이 함수 시그니처 내에 라이프타임 파라미터를 특정함으로써, 우리는 함수에 넘겨지거나 반환되는 어떠한 값들의 라이프타임도 바꾸지 않지만, 이 계약에 부합하지 않는 어떠한 값들도 빌림 검사기에 의해 거부되어야 함을 말해주는 것입니다. 이 함수는 `x`와 `y`가 정확히 얼마나 오래 살게 될지 알지 못하지만 (혹은 알 필요가 없지만), 다만 이 시그니처를 만족시킬 `\'a`에 대입될 수 있는 어떤 스코프가 있음을 알아야 할 필요가 있을 뿐입니다.\n\n함수 안에 라이프타임을 명시할 때, 이 명시는 함수 시그니처에 붙어 있으며, 함수의 본체 내에의 어떠한 코드에도 붙어있지 않습니다. 이는 러스트가 다른 도움 없이 함수 내의 코드를 분석할 수 있지만, 함수가 그 함수 밖의 코드에서의 참조자를 가지고 있을 때, 인자들 혹은 반환 값들의 라이프타임이 함수가 호출될 때마다 달라질 가능성이 있기 때문입니다. 이는 러스트가 발견해내기에는 너무나 비용이 크고 종종 불가능할 것입니다. 이 경우, 우리는 스스로 라이프타임을 명시할 필요가 있습니다.\n\n구체적인 참조자들이 `longest`로 넘겨질 때, `\'a`에 대입되게 되는 구체적인 라이프타임은 `y`의 스코프와 겹치는 `x` 스코프의 부분입니다. 스코프는 언제나 중첩되기 때문에, 이것이 제네릭 라이프타임 `\'a`이다라고 말하는 또 다른 방법은 `x`와 `y`의 라이프타임 중에서 더 작은 쪽과 동일한 구체적인 라이프타임을 구하는 것일 겁니다. 반환되는 참조자에 대해서도 같은 라이프타임 파라미터인 `\'a`를 명시했으므로, 반환되는 참조자도 `x` 와 `y`의 라이프타임 중 짧은 쪽만큼은 길게 유효함을 보장할 것입니다.\n\n서로 다른 구체적인 라이프타임을 가진 참조자들을 넘김으로써 이것이 `longest` 함수의 사용을 어떻게 제한하는지 봅시다. Listing 7는 아무 언어에서나 여러분의 직관에 부합될 간단한 예제입니다: `string1`은 외부 스코프가 끝날 때까지 유효하고 `string2`는 내부 스코프가 끝날 때까지 유효하며, `result`는 내부 스코프가 끝날 때까지 유효한 무언가를 참조합니다. 빌림 검사기는 이 코드를 승인합니다; 이는 컴파일되며 실행했을 때 `The longest string is long string is long`를 출력합니다:\n\n```rust\n\nfn main() {\n    let string1 = String::from(\"long string is long\");\n\n    {\n        let string2 = String::from(\"xyz\");\n        let result = longest(string1.as_str(), string2.as_str());\n        println!(\"The longest string is {}\", result);\n    }\n}\n\n```\n\nListing 7: 서로 다른 구체적인 라이프타임을 가진 `String` 값의 참조자들을 이용한 `longest` 함수의 사용\n\n다음으로, `result`의 참조자의 라이프타임이 두 인자들의 라이프타임보다 작아야 함을 보여줄 예제를 시도해봅시다. 우리는 `result`의 선언부를 내부 스코프 밖으로 옮길 것이지만, `result` 변수에 대한 값의 대입은 `string2`가 있는 스코프 내에 남겨둘 것입니다. 다음으로, `result`를 이용하는 `println!` 구문을 내부 스코프 바깥에, 내부 스코프가 끝나는 시점으로 옮기겠습니다. 이렇게 수정한 Listing 8의 코드는 컴파일되지 않을 것입니다:\n\n```rust\n\nfn main() {\n    let string1 = String::from(\"long string is long\");\n    let result;\n    {\n        let string2 = String::from(\"xyz\");\n        result = longest(string1.as_str(), string2.as_str());\n    }\n    println!(\"The longest string is {}\", result);\n}\n\n```\n\nListing 8: `string2`가 스코프 밖으로 벗어난 후에 `result`를 사용하고자 하는 시도는 컴파일되지 않습니다\n\n만일 이를 컴파일하고자 시도하면, 다음과 같은 에러를 얻습니다:\n\n```text\n\nerror: `string2` does not live long enough\n   |\n6  |         result = longest(string1.as_str(), string2.as_str());\n   |                                            ------- borrow occurs here\n7  |     }\n   |     ^ `string2` dropped here while still borrowed\n8  |     println!(\"The longest string is {}\", result);\n9  | }\n   | - borrowed value needs to live until here\n\n```\n\n이 에러는 `result`가 `println!`에서 유효하기 위해서는. `string2`가 외부 스코프의 끝까지 유효할 필요가 있음을 말해줍니다. 러스트는 이를 알고 있는데, 그 이유는 우리가 함수의 파라미터들과 반환 값에 대해 동일한 라이프타임 파라미터 `\'a`를 명시했기 때문입니다.\n\n우리는 인간으로서 이 코드를 살펴볼 수 있고 `string1`이 더 길기 때문에 `result`는 `string1`의 참조자를 담게 될 것이라는 점을 알 수 있습니다. `string1`이 스코프 밖으로 아직 벗어나지 않았기 때문에, `string1`의 참조자는 `println!` 구문에서 여전히 유효할 것입니다. 그렇지만, 우리가 러스트에게 라이프타임 파라미터를 가지고 말해준 것은 `longest` 함수에 의해 반환되는 참조자의 라이프타임이 인자로 넘겨준 라이프타임들 중 작은 쪽과 동일하다는 것이었지요. 따라서, 빌림 검사기는 잠재적으로 유효하지 않은 참조자를 가질 수 있는 문제로 인해 Listing 8의 코드를 허용하지 않습니다.\n\n`longest` 함수에 넘겨질 참조자들의 값과 라이프타임들, 그리고 반환된 참조자를 어떻게 이용하는지를 다양화하여 더 많은 실험들을 디자인해 시도해보세요. 컴파일하기 전에 여러분의 실험이 빌림 검사기를 통과할지 안 할지에 대한 가설을 세워보고, 여러분이 맞았는지 확인해보세요!\n\n### 라이프타임의 측면에서 생각하기\n\n라이프타임 파라미터를 특정하는 정확한 방법은 여러분의 함수가 어떤 일을 하고 있는가에 따라 달린 문제입니다. 예를 들면, `longest` 함수의 구현을 제일 긴 스트링 슬라이스 대신 항상 첫 번째 인자를 반환하도록 바꾸었다면, `y` 파라미터에 대한 라이프타임을 특정할 필요는 없을 것입니다. 아래 코드는 컴파일됩니다:\n\n```rust\n\nfn longest<\'a>(x: &\'a str, y: &str) -> &\'a str {\n    x\n}\n\n```\n\n이 예제에서, 파라미터 `x`와 반환 값에 대한 라이프타임 파라미터 `\'a`는 특정하였지만, 파라미터 `y`는 특정하지 않았는데, 그 이유는 `y`의 라이프타임이 `x` 혹은 반환 값의 라이프타임과 어떠한 관련도 없기 때문입니다.\n\n함수로부터 참조자를 반환할 때, 반환 타입에 대한 라이프타임 파라미터는 인자 중 하나의 라이프타임 파라미터와 일치할 필요가 있습니다. 만일 반환되는 참조가 인자들 중 하나를 참조하지 *않는다면*, 다른 유일한 가능성은 이 함수 내에서 생성된 값을 참조하는 경우인데, 이 값은 함수가 끝나는 시점에서 스코프 밖으로 벗어나기 때문에 댕글링 참조자가 될 것입니다. `longest` 함수에 대한 아래와 같은 구현 시도는 컴파일되지 않습니다:\n\n```rust\n\nfn longest<\'a>(x: &str, y: &str) -> &\'a str {\n    let result = String::from(\"really long string\");\n    result.as_str()\n}\n\n```\n\n우리가 반환 타입에 대해 라이프타임 파라미터 `\'a`를 특정했을지라도, 이러한 구현은 컴파일에 실패하게 되는데 이는 반환되는 값의 라이프타임이 파라미터의 라이프타임과 아무런 관련이 없기 때문입니다. 여기 우리가 얻게 되는 에러 메시지를 보시죠:\n\n```text\n\nerror: `result` does not live long enough\n  |\n3 |     result.as_str()\n  |     ^^^^^^ does not live long enough\n4 | }\n  | - borrowed value only lives until here\n  |\nnote: borrowed value must be valid for the lifetime \'a as defined on the block\nat 1:44...\n  |\n1 | fn longest<\'a>(x: &str, y: &str) -> &\'a str {\n  |                                             ^\n\n```\n\n문제는 `result`가 `longest` 함수가 끝나는 지점에서 스코프 밖으로 벗어나게 되어 메모리 해제가 일어나게 되는데, 이 함수로부터 `result`의 참조자를 반환하려는 시도를 한다는 점입니다. 이 댕글링 참조자를 변경시킬 라이프타임 파라미터를 특정할 방법은 없으며, 러스트는 우리가 댕글링 참조자를 만들게끔 놔두지 않습니다. 이 경우, 가장 좋은 수정 방법은 참조자보다는 차라리 값을 소유한 데이터 타입을 리턴하도록 하여 호출하는 함수가 값을 할당 해제하도록 하는 것입니다.\n\n궁극적으로, 라이프타임 문법은 함수들의 다양한 인자들과 반환 값 사이를 연결하는 것에 대한 것입니다. 이들이 일단 연결되고 나면, 러스트는 메모리에 안전한 연산들을 허용하고 댕글링 포인터를 생성하거나 그렇지 않은 경우 메모리 안전을 위배하게 될 연산들을 배제하기에 충분한 정보를 갖게 됩니다.\n\n### 구조체 정의 상에서의 라이프타임 명시\n\n현재까지 우리는 소유권 있는 타입만 들고 있는 구조체들만 정의해왔습니다. 구조체가 참조자를 들고 있도록 할 수 있지만, 구조체 정의 내의 모든 참조자들에 대하여 라이프타임을 표시할 필요가 있습니다. Listing 9에 스트링 슬라이스를 들고 있는 `ImportantExcerpt`라고 명명된 구조체가 있습니다:\n\n```rust\n\nstruct ImportantExcerpt<\'a> {\n    part: &\'a str,\n}\n\nfn main() {\n    let novel = String::from(\"Call me Ishmael. Some years ago...\");\n    let first_sentence = novel.split(\'.\')\n        .next()\n        .expect(\"Could not find a \'.\'\");\n    let i = ImportantExcerpt { part: first_sentence };\n}\n\n```\n\nListing 9: 참조자를 들고 있는 구조체, 따라서 정의 부분에 라이프타임 명시가 필요합니다\n\n이 구조체는 스트링 슬라이스를 담을 수 있는 `part`라는 하나의 필드를 갖고 있는데, 이것이 참조자입니다. 제네릭 데이터 타입과 마찬가지로, 제네릭 라이프타임 파라미터의 이름을 구조체의 이름 뒤편에 꺾쇠괄호 안에다 선언하여 구조체 정의의 본체 내에서 이 라이프타임 파라미터를 이용할 수 있도록 해야 합니다.\n\n여기 이 `main` 함수는 변수 `novel`이 소유하고 있는 `String`의 첫 문장에 대한 참조자를 들고 있는 `ImportantExcerpt` 구조체의 인스턴스를 생성합니다.\n\n### 라이프타임 생략\n\n이 절에서, 우리는 모든 참조자가 라이프타임을 가지고 있으며, 참조자를 사용하는 함수나 구조체에 대하여 라이프타임 파라미터를 특정할 필요가 있다고 배웠습니다. 하지만, Listing 10에서 다시 보여주듯이 \"스트링 슬라이스\"절의 함수는 라이프타임 명시 없이도 컴파일이 됐었지요:\n\n```rust\n\nfn first_word(s: &str) -> &str {\n    let bytes = s.as_bytes();\n\n    for (i, &item) in bytes.iter().enumerate() {\n        if item == b\' \' {\n            return &s[0..i];\n        }\n    }\n\n    &s[..]\n}\n\n```\n\nListing 10: 파라미터와 반환 값의 타입이 참조자임에도 불구하고 라이프타임 명시 없이 컴파일되었던 함수\n\n이 함수가 라이프타임 없이 컴파일되는 이유는 역사가 있습니다: 1.0 이전 시절의 러스트에서는 이 코드가 실제로 컴파일되지 않았습니다. 모든 참조자들은 명시적인 라이프타임이 필요했지요. 그 시절, 함수 시그니처는 아래와 같이 작성되었습니다:\n\n```rust\n\nfn first_word<\'a>(s: &\'a str) -> &\'a str {\n\n```\n\n수많은 러스트 코드를 작성하고 난 후, 러스트 팀은 러스트 프로그래머들이 특정한 상황에서 똑같은 라이프타임 명시를 계속하여 타이핑하고 있다는 사실을 발견하게 되었습니다. 이 상황들은 예측 가능하며 몇 가지 결정론적인 패턴을 따르고 있었습니다. 그리하여 러스트 팀은 러스트 컴파일러 코드 내에 이 패턴들을 프로그래밍하여 이러한 상황 내에서는 프로그래머가 명시적으로 라이프타임 명시를 추가하도록 강제하지 않고 빌림 검사기가 라이프타임을 추론할 수 있도록 하였습니다.\n\n더 많은 결정론적인 패턴들이 출현하여 컴파일러 내에 추가될 가능성이 충분하기에 이러한 러스트의 역사에 대해 언급하였습니다. 나중에는 더욱 적은 라이프타임 명시만이 필요할지도 모르지요.\n\n참조자에 대한 러스트의 분석 기능 내에 프로그래밍된 패턴들을 일컬어 *라이프타임 생략 규칙(lifetime elision rules)* 이라고 합니다. 이들은 프로그래머가 따라야 하는 규칙들이 아닙니다; 이 규칙들은 컴파일러가 고려할 특정한 경우의 집합이고, 여러분의 코드가 이러한 경우에 들어맞으면, 여러분은 명시적으로 라이프타임을 작성할 필요가 없어집니다.\n\n생략 규칙들은 모든 추론을 제공하지는 않습니다: 만일 러스트가 결정론적으로 이 규칙들을 적용했지만 여전히 참조자들이 어떤 라이프타임을 가지고 있는지에 대하여 모호하다면, 해당하는 남은 참조자들의 라이프타임이 어떻게 되어야 하는지에 대해 추측하지 않을 것입니다. 이러한 경우, 컴파일러는 여러분에게 이 참조자들이 서로 어떻게 연관되는지에 대하여 여러분의 의도에 맞게끔 라이프타임을 추가함으로써 해결 가능한 에러를 표시할 것입니다.\n\n먼저 몇 가지 정의들을 봅시다: 함수나 메소드의 파라미터에 대한 라이프타임을 *입력 라이프타임(input lifetime)* 이라고 하며, 반환 값에 대한 라이프타임을 *출력 라이프타임(output lifetime)* 이라고 합니다.\n\n이제 명시적인 라이프타임이 없을 때 참조자가 어떤 라이프타임을 가져야 하는지 알아내기 위해서 컴파일러가 사용하는 규칙들을 봅시다. 첫 번째 규칙은 입력 라이프타임에 적용되고, 다음의 두 규칙들은 출력 라이프타임에 적용됩니다. 만일 컴파일러가 이 세 가지 규칙의 끝에 도달하고 여전히 라이프타임을 알아낼 수 없는 참조자가 있다면, 컴파일러는 에러와 함께 멈출 것입니다.\n\n1. 참조자인 각각의 파라미터는 고유한 라이프타임 파라미터를 갖습니다. 바꿔 말하면, 하나의 파라미터를 갖는 함수는 하나의 라이프타임 파라미터를 갖고: `fn foo<\'a>(x: &\'a i32)`, 두 개의 파라미터를 갖는 함수는 두 개의 라이프타임 파라미터를 따로 갖고: `fn foo<\'a, \'b>(x: &\'a i32, y: &\'b i32)`, 이와 같은 식입니다.\n2. 만일 정확히 딱 하나의 라이프타임 파라미터만 있다면, 그 라이프타임이 모든 출력 라이프타임 파라미터들에 대입됩니다: `fn foo<\'a>(x: &\'a i32) -> &\'a i32`.\n3. 만일 여러 개의 입력 라이프타임 파라미터가 있는데, 메소드라서 그중 하나가 `&self` 혹은 `&mut self`라고 한다면, `self`의 라이프타임이 모든 출력 라이프타임 파라미터에 대입됩니다. 이는 메소드의 작성을 더욱 멋지게 만들어줍니다.\n\n우리가 직접 컴파일러가 된 척하여 Listing 10의 `first_word` 함수의 시그니처에 있는 참조자들의 라이프타임이 무엇인지 알아내기 위해 이 규칙들을 적용해 봅시다. 이 시그니처는 참조자들과 관련된 아무런 라이프타임도 없이 시작합니다:\n\n```rust\n\nfn first_word(s: &str) -> &str {\n\n```\n\n그러면 (컴파일러로서의) 우리는 첫 번째 규칙을 적용하는데, 이는 각각의 파라미터가 고유의 라이프타임을 갖는다고 말해주고 있습니다. 우리는 이를 평범하게 `\'a`라고 명명할 것이며, 따라서 이제 시그니처는 다음과 같습니다:\n\n```rust\n\nfn first_word<\'a>(s: &\'a str) -> &str {\n\n```\n\n두 번째 규칙 상에 놓이게 되는데, 이는 정확히 단 하나의 입력 라이프타임만 존재하기 때문에 적용됩니다. 두 번째 규칙은 그 하나의 입력 파라미터에 대한 라이프타임이 출력 라이프타임에 대입된다고 말하고 있으므로, 이제 시그니처는 다음과 같아집니다:\n\n```rust\n\nfn first_word<\'a>(s: &\'a str) -> &\'a str {\n\n```\n\n이제 이 함수 시그니처의 모든 참조자들이 라이프타임을 갖게 되었고, 컴파일러는 프로그래머에게 이 함수 시그니처 내의 라이프타임을 명시하도록 요구하지 않고도 분석을 계속할 수 있게 되었습니다.\n\n또 다른 예제를 해보려는데, 이번에는 Listing 5에서와 같이 우리가 처음 시작할 때의 아무런 라이프타임 파라미터도 가지고 있지 않은 `longest` 함수를 가지고 해 봅시다:\n\n```rust\n\nfn longest(x: &str, y: &str) -> &str {\n\n```\n\n다시 한번 우리가 컴파일러가 된 척하여, 첫 번째 규칙을 적용해봅시다: 각각의 파라미터는 고유의 라이프타임을 갖습니다. 이번에는 두 개의 파라미터들이 있으므로, 두 개의 라이프타임을 갖게 됩니다:\n\n```rust\n\nfn longest<\'a, \'b>(x: &\'a str, y: &\'b str) -> &str {\n\n```\n\n두 번째 규칙을 살펴봤을 때, 하나 이상의 입력 라이프타임이 있으므로 적용되지 않습니다. 세번째 규칙을 살펴봤을 때, 이 또한 적용되지 않는데 이는 이것이 메소드가 아니라 함수이고, 따라서 어떠한 파라미터도 `self`가 아니기 때문입니다. 따라서 규칙이 더 이상 남아있지 않은데, 우리는 아직 반환 다임의 라이프타임이 무엇인지 알아내지 못했습니다. 이것이 바로 Listing 5의 코드를 컴파일하려 시도했을 때 에러가 발생한 이유입니다: 컴파일러는 자신이 알고 있는 라이프타임 생략 규칙들을 통해 작업을 수행했지만, 여전히 이 시그니처의 참조자들에 대한 모든 라이프타임을 알아낼 수 없으니까요.\n\n세번째 규칙이 오직 메소드 시그니처에 대해서만 실제로 적용되므로, 이제 그러한 경우에서의 라이프타임을 살펴보고, 어째서 세번서 규칙이 메소드 시그니처의 라이프타임을 매우 흔하게 생략해도 된다는 것을 의미하는지 알아봅시다.\n\n### 메소드 정의 내에서의 라이프타임 명시\n\n라이프타임을 가진 구조체에 대한 메소드를 구현할 때, 문법은 제네릭 타입 파라미터의 그것과 같습니다: 라이프타임 파라미터가 선언되고 사용되는 곳은 라이프타임 파라미터가 구조체의 필드들 혹은 메소드 인자와 반환 값과 연관이 있는지 없는지에 따라 달린 문제입니다.\n\n구조체 필드를 위한 라이프타임 이름은 언제나 `impl` 키워드 뒤에 선언되어야 하며, 그러고 나서 구조체의 이름 뒤에 사용되어야 하는데, 이 라이프타임들은 구조체 타입의 일부이기 때문입니다.\n\n`impl` 블록 안에 있는 메소드 시그니처에서, 참조자들이 구조체 필드에 있는 참조자들의 라이프타임과 묶일 수도 있고, 혹은 서로 독립적일 수도 있습니다. 여기에 더해, 라이프타임 생략 규칙이 종종 적용되어 메소드 시그니처 내에 라이프타임 명시를 할 필요가 없습니다. Listing 9에서 정의했던 `ImportantExcerpt`라는 이름의 구조체를 이용한 몇 가지 예제를 봅시다.\n\n먼저, 여기 `level`라는 이름의 메소드가 있습니다. 파라미터는 오직 `self`에 대한 참조자이며, 반환 값은 무언가에 대한 참조자가 아닌, 그냥 `i32`입니다:\n\n```rust\n\nimpl<\'a> ImportantExcerpt<\'a> {\n    fn level(&self) -> i32 {\n        3\n    }\n}\n\n```\n\n`impl`뒤의 라이프타임 파라미터 선언부와 타입 이름 뒤에서 이를 사용하는 것이 필요하지만, 첫 번째 생략 규칙때문에 `self`로의 참조자의 라이프타임을 명시할 필요는 없습니다.\n\n아래는 세번째 라이프타임 생략 규칙이 적용되는 예제입니다:\n\n```rust\n\nimpl<\'a> ImportantExcerpt<\'a> {\n    fn announce_and_return_part(&self, announcement: &str) -> &str {\n        println!(\"Attention please: {}\", announcement);\n        self.part\n    }\n}\n\n```\n\n두 개의 입력 라이프타임이 있으므로, 러스트는 첫 번째 라이프타임 생략 규칙을 적용하여 `&self`와 `announcement`에게 각각 라이프타임을 부여합니다. 그다음, 파라미터 중 하나가 `&self`이므로, 반환 타입은 `&self`의 라이프타임을 얻고, 모든 라이프타임들이 추론되었습니다.\n\n### 정적 라이프타임(Static lifetime)\n\n우리가 논의할 필요가 있는 특별한 라이프타임이 *딱 하나* 있습니다: 바로 `\'static`입니다. `\'static` 라이프타임은 프로그램의 전체 생애주기를 가리킵니다. 모든 스트링 리터럴은 `\'static` 라이프타임을 가지고 있는데, 아래와 같이 명시하는 쪽을 선택할 수 있습니다:\n\n```rust\n\nlet s: &\'static str = \"I have a static lifetime.\";\n\n```\n\n이 스트링의 텍스트는 여러분의 프로그램의 바이너리 내에 직접 저장되며 여러분 프로그램의 바이너리는 항상 이용이 가능하지요. 따라서, 모든 스트링 리터럴의 라이프타임은 `\'static`입니다.\n\n여러분은 어쩌면 에러 메시지 도움말에서 `\'static` 라이프타임을 이용하라는 제안을 보셨을지도 모릅니다만, 참조자의 라이프타임으로서 `\'static`으로 특정하기 전에, 여러분이 가지고 있는 참조자가 실제로 여러분 프로그램의 전체 라이프타임 동안 사는 것인지 대해 생각해보세요 (혹은 가능하다면 그렇게 오래 살게끔 하고 싶어 할지라도 말이죠). 대부분의 경우, 코드 내의 문제는 댕글링 참조자를 만드는 시도 혹은 사용 가능한 라이프타임들의 불일치이며, 해결책은 이 문제들을 해결하는 것이지 `\'static` 라이프타임으로 특정하는 것이 아닙니다.\n\n### 제네릭 타입 파라미터, 트레잇 바운드, 라이프타임을 함께 써보기\n\n그럼 제네릭 타입 파라미터, 트레잇 바운드, 그리고 라이프타임이 하나의 함수에 모두 특정된 문법을 간단하게 살펴봅시다!\n\n```rust\n\nuse std::fmt::Display;\n\nfn longest_with_an_announcement<\'a, T>(x: &\'a str, y: &\'a str, ann: T) -> &\'a str\n    where T: Display\n{\n    println!(\"Announcement! {}\", ann);\n    if x.len() > y.len() {\n        x\n    } else {\n        y\n    }\n}\n\n```\n\n이것은 Listing 6에 나온 바 있는 두 스트링 슬라이스 중 긴 쪽을 반환하는 `longest` 함수지만, `ann`이라는 이름의 추가 인자를 가지고 있습니다. `ann`의 타입은 제네릭 타입 `T`인데, `where` 절을 가지고 특정한 바와 같이 `Display` 트레잇을 구현한 어떤 타입으로도 채워질 수 있습니다. 이 추가 인자는 함수가 스트링 슬라이스들의 길이를 비교하기 전 출력될 것인데, 이것이 `Display` 트레잇 바운드가 필요한 이유지요. 라이프타임이 제네릭의 한 종류이므로, 라이프타임 파라미터 `\'a`와 제네릭 타입 파라미터 `T` 둘 모두에 대한 선언이 함수 이름 뒤 꺾쇠괄호 내에 나열되어 있습니다.\n\n## 정리\n\n이번 절에서 참 많은 것을 다루었습니다! 이제 여러분은 제네릭 타입 파라미터, 트레잇과 트레잇 바운드, 그리고 제네릭 라이프타임 파라미터에 대해 알게되었으니, 여러분은 중복되지 않지만 많은 서로 다른 상황들에서 사용 가능한 코드를 작성할 준비가 되었습니다. 제네릭 타입 파라미터는 코드가 서로 다른 타입에 대해서 적용될 수 있음을 의미합니다. 트레잇과 트레잇 바운드는 그 타입이 제네릭일지라도 해당 타입들이 코드에 필요한 동작을 할 수 있음을 보장합니다. 라이프타임 명시에 의해 특정된 참조자들의 라이프타임 간의 관계는 이 유연한 코드가 어떠한 댕글링 참조자도 만들지 않을 것임을 확신시켜줍니다. 그리고 이 모든 것들이 컴파일 타임에 이루어지므로 런타임 성능에는 영향을 주지 않지요!','2022-09-05 12:56:31.093000','라이프타임',13),(14,'조건의 상태가 참인지에 따라 어떤 코드의 실행 여부를 결정하거나 조건이 만족되는 동안 반복 수행을 하는 것은 대부분의 프로그래밍 언어의 기초 문법입니다. 우리가 실행 흐름을 제어할 수 있는 가장 보편적인 작성 방식은 `if`표현식과 반복문 입니다.\n\n### `if`표현식\n\n`if`표현식은 우리의 코드가 조건에 따라 분기할 수 있게 합니다. 우리가 조건을 제공하는 것은 다음 서술과 같죠. “만약 조건이 충족되면, 이 코드 블럭을 실행하세요. 만약 충족되지 않았다면 코드 블럭을 실행하지 마세요.\"\n\n*branches*로 명명된 새 프로젝트를 우리의 *projects* 디렉토리에 생성하고 `if`식을 탐구합시다.  다음의 내용을 기입하세요:\n\n```rust\n\nfn main() {\n    let number = 3;\n\n    if number < 5 {\n        println!(\"condition was true\");\n    } else {\n        println!(\"condition was false\");\n    }\n}\n\n```\n\n모든 `if`표현식은 `if`란 키워드로 시작하며 뒤이어 조건이 옵니다. 이번 경우에 조건은 변수 `number`가 5보다 작은 값을 가지는지 여부가 됩니다. 조건이 참일 때 실행하는 코드 블록은 조건 바로 뒤 중괄호로 된 블록에 배치됩니다. `if`식의 조건과 관련된 코드 블럭은 `match`식의 갈래(arms)와 마찬가지로 *갈래(arms)* 로 불립니다. 선택적으로, 우리는 이번 경우에서 처럼 `else`식을 포함시킬 수 있는데, 이는 조건이 거짓으로 산출될 경우 실행시킬 코드 블럭을 프로그램에 제공합니다. 당신이 `else`식을 제공하지 않는데 조건이 거짓이 되면, 프로그램은 `if`블록을 생략하고 다음 순서의 코드를 실행하게 될 겁니다.\n\n이 코드를 실행해보세요; 다음과 같은 결과를 얻을 수 있을 겁니다:\n\n```text\n\n$ cargo run\n   Compiling branches v0.1.0 (file:///projects/branches)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/branches`\ncondition was true\n\n```\n\n`number`의 값을 조건을 `거짓`으로 만들 값으로 변경하면 무슨 일이 일어날지 살펴보도록 합시다:\n\n```rust\n\nlet number = 7;\n\n```\n\n프로그램을 다시 실행시키면, 다음과 같은 결과를 보게 됩니다:\n\n```text\n\n$ cargo run\n   Compiling branches v0.1.0 (file:///projects/branches)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/branches`\ncondition was false\n\n```\n\n주의해야 할 중요한 점은 이번 코드의 조건은 *반드시* `bool`이어야 합니다. 만약 `bool`이 아닐 경우 어떤 일이 일어나는지는 다음의 코드를 실행하면 알 수 있을 겁니다:\n\n```rust\n\nfn main() {\n    let number = 3;\n\n    if number {\n        println!(\"number was three\");\n    }\n}\n\n```\n\n`if`의 조건이 `3`으로 산출되고, Rust는 에러를 발생시킵니다.\n\n```text\n\nerror[E0308]: mismatched types\n --> src/main.rs:4:8\n  |\n4 |     if number {\n  |        ^^^^^^ expected bool, found integral variable\n  |\n  = note: expected type `bool`\n             found type `{integer}`\n\n```\n\n이 에러가 나타내는 것은 Rust가 `bool`을 기대하였으나 정수형이 왔다는 겁니다. Rust는 boolean 타입이 아닌 것을 boolean 타입으로 자동 변환하지 않습니다. Ruby나 Javascript와는 다르죠. 우리는 반드시 명시적으로 `boolean`을 `if`의 조건으로 사용해야 합니다. 만약 우리가 `if`표현식의 코드 블록을 숫자가 `0`이 아닐 시에 실행하고 싶다면, 다음처럼, 우리는 `if`표현식을 변경할 수 있습니다.\n\n```rust\n\nfn main() {\n    let number = 3;\n\n    if number != 0 {\n        println!(\"number was something other than zero\");\n    }\n}\n\n```\n\n이번 코드를 실행시키면 `number was something other than zero`가 출력 될 겁니다.\n\n### `else if`와 다수 조건\n\n우리는 `if`와 `else` 사이에 `else if`식을 추가 결합하여 다양한 조건을 다룰 수 있습니다. 예제를 보시죠:\n\n```rust\n\nfn main() {\n    let number = 6;\n\n    if number % 4 == 0 {\n        println!(\"number is divisible by 4\");\n    } else if number % 3 == 0 {\n        println!(\"number is divisible by 3\");\n    } else if number % 2 == 0 {\n        println!(\"number is divisible by 2\");\n    } else {\n        println!(\"number is not divisible by 4, 3, or 2\");\n    }\n}\n\n```\n\n이번 프로그램은 분기할 수 있는 네 개의 경로를 갖습니다. 이를 수행하면, 다음과 같은 결과를 얻게 될 겁니다:\n\n```text\n\n$ cargo run\n   Compiling branches v0.1.0 (file:///projects/branches)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/branches`\nnumber is divisible by 3\n\n```\n\n이 프로그램이 실행될 때, `if`식을 차례대로 검사하고 검사 조건이 참일 때의 첫 번째 본문을 실행합니다. 주목할 점은 6은 2로 나누어 떨어짐에도 불구하고 `number is divisible by 2`이 출력되지 않는데, `else`의 블럭에 위치한 `number is not divisible by 4, 3, or 2`도 마찬가지입니다. 이렇게 되는 이유는 Rust가 첫 번째로 조건이 참이 되는 블록만 찾아 실행하고, 한번 찾게 되면 나머지는 검사하지 않기 때문입니다.\n\n너무 많은 `else if`식의 사용은 당신의 코드를 이해하기 어렵게 하므로, 둘 이상일 경우 코드를 리팩토링하게 될 수도 있습니다. \n\n### `let`구문에서 `if` 사용하기\n\n`if`가 표현식이기 때문에, 항목 1에서 처럼, 우리는 이를 `let` 구문의 우측에 사용할 수 있죠.\n\n```rust\n\nfn main() {\n    let condition = true;\n    let number = if condition {\n        5\n    } else {\n        6\n    };\n\n    println!(\"The value of number is: {}\", number);\n}\n\n```\n\nListing 1: `if` 표현식의 결과값을 변수에 대입하기\n\n변수 `number`에는 `if`식에서 산출된 값이 bound되게 됩니다. 어떤 일이 일어날지 코드를 실행해보죠:\n\n```text\n\n$ cargo run\n   Compiling branches v0.1.0 (file:///projects/branches)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.31 secs\n     Running `target/debug/branches`\nThe value of number is: 5\n\n```\n\n기억하세요! 코드 블록은 그들의 마지막에 위치한 표현식을 산출하며 숫자는 그 자체로 표현식이라는 것을요. 이 경우 전체 `if`식의 값은 실행되는 코드 블럭에 따라 다릅니다. 그렇기에 `if`식에 속한 각 갈래의 결과는 반드시 같은 타입이여야 합니다. 항목 1에서 `if`갈래와 `else`갈래는 모두 `i32` 정수형을 결과 값으로 가집니다. 하지만 만약 다음 예제처럼 유형이 다르면 어떻게 될까요?\n\n```rust\n\nfn main() {\n    let condition = true;\n\n    let number = if condition {\n        5\n    } else {\n        \"six\"\n    };\n\n    println!(\"The value of number is: {}\", number);\n}\n\n```\n\n우리가 이번 코드를 실행시키려고 하면 에러를 얻게 됩니다. `if`와 `else` 갈래의 값 타입이 호환되지 않고, Rust는 정확히 프로그램의 어느 지점에 문제가 있는지 보여줍니다.\n\n```text\n\nerror[E0308]: if and else have incompatible types\n --> src/main.rs:4:18\n  |\n4 |       let number = if condition {\n  |  __________________^\n5 | |         5\n6 | |     } else {\n7 | |         \"six\"\n8 | |     };\n  | |_____^ expected integral variable, found reference\n  |\n  = note: expected type `{integer}`\n             found type `&str`\n\n```\n\n`if` 블록이 정수형을 산출하는 식이고 `else` 블록은 문자열을 산출하는 식입니다. 이런 경우가 성립하지 않는 이유는 변수가 가질 수 있는 타입이 오직 하나이기 때문입니다. Rust는 컴파일 시에 `number` 변수의 타입이 뭔지 확실히! 정의해야 합니다. 그래야 `number`가 사용되는 모든 곳에서 유효한지 검증할 수 있으니까요. Rust는 `number`의 타입을 실행 시에 정의되도록 할 수 없습니다. 컴파일러가 모든 변수의 다양한 타입을 추적해서 알아내야 한다면 컴파일러는 보다 복잡해지고 보증할 수 있는 것은 적어지게 됩니다.\n\n### 반복문과 반복\n\n코드 블록을 한 번 이상 수행하는 것은 자주 유용합니다. 반복 작업을 위해서, Rust는 몇 가지 *반복문*을 제공합니다. 반복문은 반복문 시작부터 끝까지 수행하고 다시 처음부터 수행합니다. 반복문을 실험해보기 위해 *loops*으로 명명된 새 프로젝트를 작성해 봅시다.\n\nRust가 제공하는 세 가지 반복문: `loop`, `while`, 그리고 `for`을 모두 사용해 봅시다.\n\n### `loop`와 함께 코드의 반복 수행\n\n`loop` keyword는 Rust에게 그만두라고 명시하여 알려주기 전까지 코드 블럭을 반복 수행합니다. 예제로, 우리의 *loops*디렉토리에 *src/main.rs*를 다음처럼 변경하세요:\n\n```rust\n\nfn main() {\n    loop {\n        println!(\"again!\");\n    }\n}\n\n```\n\n이 프로그램을 실행시키면, 우리는 프로그램을 강제 정지하기 전까지 `again!`이 반복 출력되는 것을 보게 됩니다. 대부분의 터미널은 단축키 ctrl-C를 통해서 무한루프에 빠진 프로그램을 정지시키는 기능을 지원합니다. 한번 시도해 보세요:\n\n```text\n\n$ cargo run\n   Compiling loops v0.1.0 (file:///projects/loops)\n     Running `target/debug/loops`\nagain!\nagain!\nagain!\nagain!\n^Cagain!\n\n```\n\n기호 `^C`는 우리가 ctrl-C를 눌렀을 때의 위치입니다. 코드가 정지 신호를 받은 시점에 따라 `^C` 이후에 `again!`이 출력될 수도 아닐 수도 있습니다.\n\n다행스럽게도, Rust는 보다 안정적으로 루프에서 벗어날 수 있는 방법을 제공합니다. 우리는 `break` keyword 를 위치시켜 프로그램이 언제 루프를 멈춰야 하는지 알려줄 수 있습니다. \n\n### `while`와 함께하는 조건부 반복\n\n반복문 내에서 조건을 산출하는 것은 자주 유용합니다. 조건이 참인 동안 반복문을 수행합니다. 조건이 참이 아니게 된 경우에 `break`을 호출하여 반복을 정지시킵니다. 이런 패턴의 반복문을 구현하자면 `loop`, `if`, `else`, 그리고 `break`를 혼합해야 합니다; 원한다면 이렇게 사용해도 됩니다.\n\n하지만, 이런 패턴은 매우 보편적이기 때문에 이와 동일한 구조자가 Rust에는 내장되어 있으며, 이를 `while` 반복문이라 부릅니다. 다음의 예제를 통해 `while`을 사용해 봅시다: 프로그램은 세 번 반복되고, 반복 때마다 카운트 다운됩니다. 마침내 반복이 끝나면 다른 메시지를 출력하고 종료됩니다:\n\n```rust\n\nfn main() {\n    let mut number = 3;\n\n    while number != 0 {\n        println!(\"{}!\", number);\n\n        number = number - 1;\n    }\n\n    println!(\"LIFTOFF!!!\");\n}\n\n```\n\n이 구조자는 loop, if, else 및 break를 사용하는 경우 필요한 많은 중첩을 제거하며, 더 깔끔합니다. 조건이 true인 동안 코드가 실행되고; 그렇지 않으면 루프에서 벗어납니다.\n\n### `[for`와 함께하는 콜렉션 반복하기]\n\n우리는 `while` 구조자를 통해 배열과 같은, 콜렉션의 각 요소에 걸쳐 반복 수행 할 수 있습니다. 예를 들어서, Listing 2을 살펴봅시다:\n\n```rust\n\nfn main() {\n    let a = [10, 20, 30, 40, 50];\n    let mut index = 0;\n\n    while index < 5 {\n        println!(\"the value is: {}\", a[index]);\n\n        index = index + 1;\n    }\n}\n\n```\n\nListing 2: `while` 반복문을 사용해 콜렉션의 각 요소들을 순회하기\n\n여기서, 코드는 배열의 요소에 걸쳐 카운트를 증가시킵니다. 이 색인은 `0`에서 시작하고, 배열의 마지막 순서까지 반복됩니다 (즉, `index < 5`가 참이 아닐 때까지). 이 코드를 수행하면 배열의 모든 요소가 출력되게 됩니다.\n\n```text\n\n$ cargo run\n   Compiling loops v0.1.0 (file:///projects/loops)\n    Finished dev [unoptimized + debuginfo] target(s) in 0.32 secs\n     Running `target/debug/loops`\nthe value is: 10\nthe value is: 20\nthe value is: 30\nthe value is: 40\nthe value is: 50\n\n```\n\n예상했던 대로, 5개인 배열 모든 값이 터미널에 표시됩니다. `index` 값이 `5`에 오는 시점에, 그러니까 배열의 6번째 값에 접근하기 전에 반복은 중지되어야 합니다.\n\n그러나 이런 방식은 에러가 발생하기 쉽습니다; 우리가 정확한 길이의 색인을 사용하지 못하면 프로그램은 패닉을 발생합니다. 또한 느린데, 이유는 컴파일러가 실행 간에 반복문을 통해 반복될 때마다 요소에 대한 조건 검사를 수행하는 런타임 코드를 추가하기 때문입니다.\n\n보다 효율적인 대안으로, 우리는 `for` 반복문을 사용하여 콜렉션의 각 요소에 대한 코드를 수행할 수 있습니다. `for` 반복문은 다음 Listing 3과 같습니다:\n\n```rust\n\nfn main() {\n    let a = [10, 20, 30, 40, 50];\n\n    for element in a.iter() {\n        println!(\"the value is: {}\", element);\n    }\n}\n\n```\n\nListing 3: `for` 반복문을 사용해 콜렉션의 각 요소를 순회하기\n\n우리가 이 코드를 수행하면, 항목 2와 같은 결과를 볼 수 있습니다. 더 중요한 것은, 우리는 이제 코드의 안전성을 높이고 배열의 끝을 넘어가거나 충분한 길이를 지정하지 못해 일부 아이템이 누락되어 발생할 수있는 버그의 가능성을 제거했습니다.\n\n예를 들어, 코드 2의 코드에서 a 배열에서 항목을 제거 했지만 조건을 `while index < 4`로 업데이트하지 않으면 코드는 패닉을 발생합니다. for 반복문을 사용하면, 당신이 배열의 수를 변경한 경우에도 다른 코드를 변경해야 할 필요가 없습니다. (역주 : 당신은 살면서 변경한 배열의 수를 기억하고 있는가?)\n\n`for`반복문이 안전하고 간결하기 때문에 이들은 가장 보편적으로 사용되는 반복문 구조자입니다. 항목 2에서처럼 `while`반복문을 사용하여 특정 횟수만큼 코드를 반복하려는 경우에도, 대부분의 Rust 사용자들은 `for`반복문 을 사용하고자 할 것 입니다. 이런 사용을 위해 Rust에서 기본 라이브러리로 제공하는 `Range`를 사용하게 됩니다. `Range`는 한 숫자에서 다른 숫자 전까지 모든 숫자를 차례로 생성합니다.\n\n여기 `for`반복문과 아직 설명하지 않은 range를 역순하는 `rev`메소드를 사용하는 카운트다운 프로그램이 있습니다:\n\n```rust\n\nfn main() {\n    for number in (1..4).rev() {\n        println!(\"{}!\", number);\n    }\n    println!(\"LIFTOFF!!!\");\n}\n\n```\n\n꽤 괜찮은 코드인것 같죠?\n\n## 결론\n\n해냈어요! 무지 긴 장이었어: 우리는 변수, 스칼라, `if`식과 반복문까지 배웠어요! 혹시 이번 장에서 나온 내용을 연습해보고 싶으면 다음을 수행하는 프로그램을 만들어 보세요.\n\n- 화씨와 섭씨를 상호 변환.\n- n번째 피보나치 수열 생성.\n- 크리스마스 캐롤 “The Twelve Days of Christmas”의 가사를 반복문을 활용해 출력.','2022-09-05 13:00:53.558000','제어문',14),(15,'패턴은 러스트 코드 곳곳에 튀어나옵니다. 아마 모르는 사이 이미 아주 많이 쓰고 있었을 겁니다! 이번 절에선 패턴을 사용할 수 있는 모든 코드상의 장소에 대한 레퍼런스를 제공합니다.\n\n### `match` 갈래\n\n패턴은 `match`표현의 각 갈래에 사용됩니다. `match`표현은 `match` 키워드, 대응 시킬 값, 갈래들로 이루어지고, 각 갈래는 갈래를 나타내는 패턴, 해당 패턴에 값이 대응 될 때 실행할 표현으로 구성됩니다. 결국 다음과 같은 구조를 가집니다:\n\n```text\n\nmatch 값 {\n    패턴 => 표현,\n    패턴 => 표현,\n    패턴 => 표현,\n}\n\n```\n\n`match` 표현을 사용하기 위해 지켜야할 사항이 있습니다. `match` 표현에 대응 시킬 값이 가질 수 있는 모든 경우의 수를 *빠짐 없이* 표현해야 합니다. 이 조건을 보장하는 하나의 방법은 `match`의 마지막 갈래에 모든 경우에 대응되는 패턴을 이용하는 것입니다. 예를 들자면 아무 값에나 대응될 변수명 하나를 놓는 패턴이죠. 이 경우 주어진 그 어떠한 값도 해당 변수에 묶이게 되어 실패할 수 없게 되고, 즉 가능한 모든 경우를 표현한게 됩니다.\n\n`_`라는 특별한 패턴은 아무 값에나 대응되지만 그 어떠한 변수에도 묶이지 않습니다. 그래서 `match`의 마지막 갈래에 종종 쓰입니다. `_`패턴은 명시 하지 않은 값들을 무시할 때 유용합니다. 이 특별한 패턴은 뒤의 \"패턴에서 값 무시하기\" 절에서 더 자세하게 다룰 것입니다.\n\n### `if let` 조건 표현\n\n 주로 갈래가 하나 밖에 없는 `match` 표현을 더 짧게 표현하는 방법으로 사용됐습니다. 추가적으로 `if let`은 `else`절을 가질 수 있습니다. 예상 하셨듯 `if let`의 패턴에 값이 대응되지 않을 때 실행됩니다.\n\n예제 1은 `if let`, `else if`, `else if let` 표현을 섞어서 사용할 수 있음을 알려주는 코드입니다. 이들을 이용 하면 여러 패턴에 하나의 값밖에 대응시키지 못 하는 `match` 표현보다 더 유연하게 표현 가능합니다. 또 연속된 `if let`, `else if`, `else if let`의 각 조건이 꼭 연관될 필요도 없습니다.\n\n예제 1의 코드는 배경 색이 어떤 색이 될지 정하기 위해 여러개의 조건을 연이어 체크하는 것을 보여줍니다. 이번 예제에서는 실제 프로그램이 받을 지도 모르는 유저의 입력 값들이 하드코딩된 변수들을 이용합니다.\n\n유저가 좋아하는 색을 지정할 경우 그 색이 배경 색이 됩니다. 만일 오늘이 화요일이라면 배경은 녹색이 됩니다. 만일 유저가 나이를 스트링으로 입력했고, 이를 성공적으로 숫자로 파싱해낼 수 있다면 숫자 값에 따라 보라나 주황으로 배경 색이 정해집니다. 위의 그 어떤 조건에도 맞지 않을 경우 배경은 파란색이 됩니다:\n\n```rust\n\nfn main() {\n    let favorite_color: Option<&str> = None;\n    let is_tuesday = false;\n    let age: Result<u8, _> = \"34\".parse();\n\n    if let Some(color) = favorite_color {\n        println!(\"Using your favorite color, {}, as the background\", color);\n    } else if is_tuesday {\n        println!(\"Tuesday is green day!\");\n    } else if let Ok(age) = age {\n        if age > 30 {\n            println!(\"Using purple as the background color\");\n        } else {\n            println!(\"Using orange as the background color\");\n        }\n    } else {\n        println!(\"Using blue as the background color\");\n    }\n}\n\n```\n\n예제 1: `if let`, `else if`, `else if let`, `else`의 조합\n\n이런 조건절 구조는 복잡한 요구사항도 대응할 수 있게 해줍니다. 주어진 하드코딩된 값들로 예제코드를 실행할 경우 `Using purple as the background color`를 출력 할 것입니다.\n\n보시다시피 `if let`표현은 `match`의 각 갈래가 그랬듯 변수를 가리는 변수를 새로이 등장 시킬 수 있습니다. `if let Ok(age) = age`는 `Ok`에서 값을 추출한 새로운 `age`변수가 전의 `age`를 가리게 됩니다. 이는 `if age > 30`을 조건절 밑의 새로운 스코프에서 사용 해야 함을 의미합니다. 우리의 새로운 `age`는 새로운 중괄호가 나타나 새로운 스코프가 시작하기 전까지 유효하지 않으므로 위의 조건절 밑의 스코프 안에서 사용해야 합니다. `if let Ok(age) = age && age > 30`처럼 두 조건을 합쳐서 하나의 절에서 사용 할 수 없습니다.\n\n`if let`표현의 단점은 `match`표현과 다르게 컴파일러가 해당 구문이 모든 경우를 다뤘는지 판단하지 않는다는 점입니다. 예제의 마지막 `else`절을 빼먹어서 처리 되지 않는 경우가 생기더라도 컴파일러가 이를 찾아내지 않고 이에 따라 발생 할 수 있는 논리 버그를 사전에 경고해주지 않습니다.\n\n### `while let` 조건 루프\n\n`if let`과 구조적으로 비슷하게 생긴 `while let` 조건 루프는 주어진 값이 패턴에 계속 대응 되는한 실행 되는 `while` 루프입니다. 예제 2는 vector를 스택처럼 이용해 push된 역순으로 값을 출력하는 `while let` 조건 루프입니다.\n\n```rust\n\nlet mut stack = Vec::new();\n\nstack.push(1);\nstack.push(2);\nstack.push(3);\n\nwhile let Some(top) = stack.pop() {\n    println!(\"{}\", top);\n}\n\n```\n\n예제 2: `while let`을 이용해 `stack.pop()`이 `Some`을 반환하는 한 값을 출력\n\n이 예제는 3, 2, 1을 출력할 것입니다. `pop`메소드는 vector의 마지막 값을 꺼내서 `Some(value)`를 반환합니다. 만일 vector가 비었을 경우 `None`을 반환합니다. 코드의 `while`루프는 `pop`이 `Some`을 반환 할 동안 실행됩니다. `None`이 반환되는 경우에 더 이상 패턴에 맞지 않으므로 멈춥니다. `while let` 표현으로 스택의 모든 값들을 간편하게 꺼낼 수 있습니다.\n\n### `for` 루프\n\n `for` 루프가 러스트에서 가장 흔하게 쓰이는 반복문 구문입니다. 다만 그 `for` 루프들에서 사용하는 패턴에 대해선 아직 다루지 않았습니다. `for` 루프의 패턴은 `for` 키워드 바로 다음에 오는 값입니다. 즉 `for x in y`에서 `x`가 패턴입니다.\n\n예제 3은 `for`에서 패턴을 이용해 튜플을 분해하여 튜플을 `for` 루프의 일부로써 사용하는 것을 보여줍니다.\n\n```rust\n\nlet v = vec![\'a\', \'b\', \'c\'];\n\nfor (index, value) in v.iter().enumerate() {\n    println!(\"{} is at index {}\", value, index);\n}\n\n```\n\n예제 3: 튜플을 분해해기 위해 `for` 루프에서 패턴 사용\n\n예제의 출력결과는 다음과 같습니다.\n\n```text\n\na is at index 0\nb is at index 1\nc is at index 2\n\n```\n\n`enumerate` 메소드는 해당 반복자를 자신의 값과 값의 index를 포함한 튜플들을 순회하도록 바꿔 줍니다. 그래서 `enumerate`의 첫 호출은 `(0, \'a\')`를 반환합니다. 이 반환된 튜플은 `(index, value)` 패턴에 대응 되면 `index`는 `0`, `value`는 `\'a\'`값을 갖게 합니다. 이들의 값은 출력의 첫 줄에 등장하게 됩니다.\n\n### `let` 구문\n\n이번 장 전까지 `match`나 `if let`에서만 직접적으로 패턴의 사용을 언급했습니다. 하지만 이미 여러 곳에서 패턴을 사용하고 있었습니다. 대표적으로 `let`구문이 있습니다. `let`을 이용한 변수 대입을 예로 들어 봅시다:\n\n```rust\n\nlet x = 5;\n\n```\n\n이미 수백번은 봤을 `let`입니다. 하지만 아셨을지 모르겠지만 사실 이 구문에는 패턴이 쓰이고 있습니다! `let` 구문을 더 형식에 맞춰 나타내면 다음과 같습니다:\n\n```rust\n\nlet PATTERN = EXPRESSION;\n\n```\n\n`let x = 5;`처럼 `PATTERN`자리에 변수명이 들어가는 경우, 그 변수명 자체가 하나의 무지하게 단순한 패턴의 한 형태입니다. 러스트는 `EXPRESSION`을 `PATTERN`에 비교하고 거기서 발견한 이름들에 그 `EXPRESSION`을 대입합니다. `let x = 5;` 예제에서 `x`라는 패턴은 \"이 패턴에 대응 되는 값을 변수 `x`에 대입하는\" 패턴입니다. 이 경우 `x`가 패턴의 전부이므로 \"아무 값을 통으로 `x`에 대입한다\"는 의미를 갖게 됩니다.\n\n`let`의 좀 더 \"패턴 매칭\"스러운 면모를 보기 위해 예제 4를 봅시다. 이 예제는 튜플을 분해하는 패턴을 사용하고 있습니다.\n\n```rust\n\nlet (x, y, z) = (1, 2, 3);\n\n```\n\n예제 4: 패턴을 이용해 튜플을 분해하며 세개의 변수를 생성\n\n이 코드는 튜플을 하나의 패턴에 대응시키고 있습니다. 러스트는 튜플 `(1, 2, 3)`을 `(x, y, z)`에 비교하고 튜플이 해당 패턴에 대응된다는 것을 알아 냅니다. 그래서 러스트는 `1`을 `x`에, `2`를 `y`에, `3`을 `z`에 각각 묶습니다. 이 튜플예제를 3개의 변수 대입 패턴을 하나의 패턴으로 묶은 것으로 생각하셔도 좋습니다.\n\n만약 패턴의 원소의 수가 주어진 튜플의 원소의 수와 다를 경우, 둘의 타입이 서로 달라 대응에 실패하고 컴파일 에러가 발생하게 됩니다. 예제5는 원소가 3개인 튜플을 원소가 2개인 패턴에 대응시키려고 하고 있습니다. 물론 실패합니다:\n\n```rust\n\nlet (x, y) = (1, 2, 3);\n\n```\n\n예제 5: 대응시키려는 튜플과 원소의 개수가 맞지 않는 패턴의 사용\n\n컴파일을 시도할 경우 다음과 같은 타입에러가 발생합니다:\n\n```text\n\nerror[E0308]: mismatched types\n --> src/main.rs:2:9\n  |\n2 |     let (x, y) = (1, 2, 3);\n  |         ^^^^^^ expected a tuple with 3 elements, found one with 2 elements\n  |\n  = note: expected type `({integer}, {integer}, {integer})`\n             found type `(_, _)`\n\n```\n\n튜플의 원소중 하나, 혹은 여럿을 무시하고 싶을 경우 \"패턴에서 값 무시하기\"에서 자세하게 다룰 `_`나 `..`를 사용할 수 있습니다. 반대로 문제가 패턴 쪽의 변수가 너무 많아서 생겼다면 패턴의 변수 일부를 없에는 것으로 튜플의 원소의 수와 패턴의 변수 원소의 수를 맞추어 둘의 타입을 맞춰주면 됩니다.\n\n### 함수의 매개변수\n\n함수의 매개변수들도 물론 패턴입니다. 예제 6은 `i32`타입의 매개변수 `x`를 가지는 함수 `foo`를 정의 하는 코드입니다. 이제는 익숙한 코드라 생각합니다.\n\n```rust\n\nfn foo(x: i32) {\n    // code goes here\n}\n\n```\n\n예제 6: 함수 선언의 매개변수는 패턴을 사용\n\n예상대로 `x` 부분은 패턴입니다! `let`에서도 그랬듯, 함수에 인자를 넘기는 과정에서 튜플을 패턴에 대응시킬 수 있습니다. 예제 7은 함수에 튜플을 넘기면서 그 값들을 분해해서 사용하는 코드입니다.\n\n```rust\n\nfn print_coordinates(&(x, y): &(i32, i32)) {\n    println!(\"Current location: ({}, {})\", x, y);\n}\n\nfn main() {\n    let point = (3, 5);\n    print_coordinates(&point);\n}\n\n```\n\n예제 7: 튜플을 분해하는 매개변수를 가진 함수\n\n이 코드는 `Current location: (3, 5)`를 출력합니다. 값 `&(3, 5)`는 패턴 `&(x, y)`에 대응되므로 `x`는 `3`, `y`는 `5`의 값을 갖게 됩니다.\n\n패턴은 함수의 매개변수에서 사용한 방법 그대로 클로져의 매개변수에서도 사용할 수 있습니다. \n\n지금까지 다양한 패턴의 사용법을 보았습니다. 하지만 패턴은 사용하는 장소마다 다른 방식으로 작동합니다. 몇 장소에서는 패턴은 *반증 불가(irrefutable)* 해야 합니다. 이는 패턴이 어떠한 값이든 대응해야 한다는 뜻입니다. 그외의 경우엔 *반증 가능(refutable)* 해도 됩니다.','2022-09-05 13:04:36.208000','제어문 심화',15),(16,'러스트는 `match`라고 불리는 극도로 강력한 흐름 제어 연산자를 가지고 있는데 이는 우리에게 일련의 패턴에 대해 어떤 값을 비교한 뒤 어떤 패턴에 매치되었는지를 바탕으로 코드를 수행하도록 해줍니다. 패턴은 리터럴 값, 변수명, 와일드카드, 그리고 많은 다른 것들로 구성될 수 있습니다. `match`의 힘은 패턴의 표현성으로부터 오며 컴파일러는 모든 가능한 경우가 다루어지는지를 검사합니다.\n\n`match` 표현식을 동전 분류기와 비슷한 종류로 생각해보세요: 동전들은 다양한 크기의 구멍들이 있는 트랙으로 미끄러져 내려가고, 각 동전은 그것에 맞는 첫 번째 구멍을 만났을 때 떨어집니다. 동일한 방식으로, 값들은 `match` 내의 각 패턴을 통과하고, 해당 값에 “맞는” 첫 번째 패턴에서, 그 값은 실행 중에 사용될 연관된 코드 블록 안으로 떨어질 것입니다.\n\n우리가 방금 동전들을 언급했으니, `match`를 이용한 예제로 동전들을 이용해봅시다! Listing 1에서 보는 바와 같이, 우리는 익명의 미국 동전을 입력받아서, 동전 계수기와 동일한 방식으로 그 동전이 어떤 것이고 센트로 해당 값을 반환하는 함수를 작성할 수 있습니다.\n\n```rust\n\nenum Coin {\n    Penny,\n    Nickel,\n    Dime,\n    Quarter,\n}\n\nfn value_in_cents(coin: Coin) -> u32 {\n    match coin {\n        Coin::Penny => 1,\n        Coin::Nickel => 5,\n        Coin::Dime => 10,\n        Coin::Quarter => 25,\n    }\n}\n\n```\n\nListing 1: 열거형과 열거형의 variant를 패턴으로서 사용하는 `match` 표현식\n\n`value_in_cents` 함수 내의 `match`를 쪼개 봅시다. 먼저, `match` 키워드 뒤에 표현식을 써줬는데, 위의 경우에는 `coin` 값입니다. 이는 `if`를 사용한 표현식과 매우 유사하지만, 큰 차이점이 있습니다: `if`를 사용하는 경우, 해당 표현식은 부울린 값을 반환할 필요가 있습니다. 여기서는 어떤 타입이든 가능합니다. 위 예제에서 `coin`의 타입은 Listing 1에서 정의했던 `Coin` 열거형입니다.\n\n다음은 `match` 갈래(arm)들입니다. 하나의 갈래는 두 부분을 갖고 있습니다: 패턴과 어떤 코드로 되어 있죠. 여기서의 첫 번째 갈래는 값 `Coin::Penny`로 되어있는 패턴을 가지고 있고 그 후에 패턴과 실행되는 코드를 구분해주는 `=>` 연산자가 있습니다. 위의 경우에서 코드는 그냥 값 `1`입니다. 각 갈래는 그다음 갈래와 쉼표로 구분됩니다.\n\n`match` 표현식이 실행될 때, 결과 값을 각 갈래의 패턴에 대해서 순차적으로 비교합니다. 만일 어떤 패턴이 그 값과 매치되면, 그 패턴과 연관된 코드가 실행됩니다. 만일 그 패턴이 값과 매치되지 않는다면, 동전 분류기와 비슷하게 다음 갈래로 실행을 계속합니다.\n\n각 갈래와 연관된 코드는 표현식이고, 이 매칭 갈래에서의 표현식의 결과 값은 전체 `match` 표현식에 대해 반환되는 값입니다.\n\n각 갈래가 그냥 값을 리턴하는 Listing 1에서처럼 매치 갈래의 코드가 짧다면, 중괄호는 보통 사용하지 않습니다. 만일 매치 갈래 내에서 여러 줄의 코드를 실행시키고 싶다면, 중괄호를 이용할 수 있습니다. 예를 들어, 아래의 코드는 `Coin::Penny`와 함께 메소드가 호출될 때마다 “Lucky penny!”를 출력하지만 여전히 해당 블록의 마지막 값인 `1`을 반환할 것입니다:\n\n```rust\n\nfn value_in_cents(coin: Coin) -> u32 {\n    match coin {\n        Coin::Penny => {\n            println!(\"Lucky penny!\");\n            1\n        },\n        Coin::Nickel => 5,\n        Coin::Dime => 10,\n        Coin::Quarter => 25,\n    }\n}\n\n```\n\n### 값들을 바인딩하는 패턴들\n\n매치 갈래의 또 다른 유용한 기능은 패턴과 매치된 값들의 부분을 바인딩할 수 있다는 것입니다. 이것이 열거형 variant로부터 어떤 값들을 추출할 수 있는 방법입니다.\n\n한 가지 예로서, 우리의 열거형 variant 중 하나를 내부에 값을 들고 있도록 바꿔봅시다. 1999년부터 2008년까지, 미국은 각 50개 주마다 한쪽 면의 디자인이 다른 쿼터 동전을 주조했습니다. 다른 동전들은 주의 디자인을 갖지 않고, 따라서 오직 쿼터 동전들만 이 특별 값을 갖습니다. 우리는 이 정보를 `Quarter` variant 내에 `UsState` 값을 포함하도록 우리의 `enum`을 변경함으로써 추가할 수 있는데, 이는 Listing 2에서 한 바와 같습니다:\n\n```rust\n\n#[derive(Debug)] // So we can inspect the state in a minute\nenum UsState {\n    Alabama,\n    Alaska,\n    // ... etc\n}\n\nenum Coin {\n    Penny,\n    Nickel,\n    Dime,\n    Quarter(UsState),\n}\n\n```\n\nListing 2: `Quarter` variant가 `UsSate` 값 또한 들고 있는 `Coin` 열거형\n\n우리의 친구가 모든 50개 주 쿼터 동전을 모으기를 시도하는 중이라고 상상해봅시다. 동전의 종류에 따라 동전을 분류하는 동안, 우리는 또한 각 쿼터 동전에 연관된 주의 이름을 외쳐서, 만일 그것이 우리 친구가 가지고 있지 않은 것이라면, 그 친구는 자기 컬렉션에 그 동전을 추가할 수 있겠지요.\n\n이 코드를 위한 매치 표현식 내에서는 variant `Coin::Quarter`의 값과 매치되는 패턴에 `state`라는 이름의 변수를 추가합니다. `Coin::Quarter`이 매치될 때, `state` 변수는 그 쿼터 동전의 주에 대한 값에 바인드 될 것입니다. 그러면 우리는 다음과 같이 해당 갈래에서의 코드 내에서 `state`를 사용할 수 있습니다:\n\n```rust\n\nfn value_in_cents(coin: Coin) -> u32 {\n    match coin {\n        Coin::Penny => 1,\n        Coin::Nickel => 5,\n        Coin::Dime => 10,\n        Coin::Quarter(state) => {\n            println!(\"State quarter from {:?}!\", state);\n            25\n        },\n    }\n}\n\n```\n\n만일 우리가 `value_in_cents(Coin::Quarter(UsState::Alaska))`를 호출했다면, `coin`은 `Coin::Quarter(UsState::Alaska)`가 될 테지요. 각각의 매치 갈래들과 이 값을 비교할 때, `Coin::Quarter(state)`에 도달할 때까지 아무것도 매치되지 않습니다. 이 시점에서, `state`에 대한 바인딩은 값 `UsState::Alaska`가 될 것입니다. 그러면 이 바인딩을 `println!` 표현식 내에서 사용할 수 있고, 따라서 `Quarter`에 대한 `Coin` 열거형 variant로부터 내부의 주에 대한 값을 얻었습니다.\n\n### `Option<T>`를 이용하는 매칭\n\n이전 절에서 `Option<T>`을 사용할 때 `Some` 케이스로부터 내부의 `T` 값을 얻을 필요가 있었습니다; 우리는 `Coin` 열거형을 가지고 했던 것처럼 `match`를 이용하여 `Option<T>`를 다룰 수 있습니다! 동전들을 비교하는 대신, `Option<T>`의 variant를 비교할 것이지만, `match` 표현식이 동작하는 방법은 동일하게 남아있습니다.\n\n`Option<i32>`를 파라미터로 받아서, 내부에 값이 있으면, 그 값에 1을 더하는 함수를 작성하고 싶다고 칩시다. 만일 내부에 값이 없으면, 이 함수는 `None` 값을 반환하고 다른 어떤 연산도 수행하는 시도를 하지 않아야 합니다.\n\n`match`에 감사하게도, 이 함수는 매우 작성하기 쉽고, Listing 3와 같이 보일 것입니다:\n\n```rust\n\nfn plus_one(x: Option<i32>) -> Option<i32> {\n    match x {\n        None => None,\n        Some(i) => Some(i + 1),\n    }\n}\n\nlet five = Some(5);\nlet six = plus_one(five);\nlet none = plus_one(None);\n\n```\n\nListing 3: `Option<i32>` 상에서 `match`를 이용하는 함수\n\n### `Some(T)` 매칭 하기\n\n`plus_one`의 첫 번째 실행을 좀 더 자세히 시험해봅시다. `plus_one(five)`가 호출될 때, `plus_one`의 본체 내의 변수 `x`는 값 `Some(5)`를 갖게 될 것입니다. 그런 다음 각각의 매치 갈래에 대하여 이 값을 비교합니다.\n\n```rust\n\nNone => None,\n\n```\n\n`Some(5)` 값은 패턴 `None`과 매칭 되지 않으므로, 다음 갈래로 계속 갑니다.\n\n```rust\n\nSome(i) => Some(i + 1),\n\n```\n\n`Some(5)`가 `Some(i)`랑 매칭 되나요? 예, 바로 그렇습니다! 동일한 variant를 갖고 있습니다. `Some` 내부에 담긴 값은 `i`에 바인드 되므로, `i`는 값 `5`를 갖습니다. 그런 다음 매치 갈래 내의 코드가 실행되므로, `i`의 값에 1을 더한 다음 최종적으로 `6`을 담은 새로운 `Some` 값을 생성합니다.\n\n### `None` 매칭 하기\n\n이제 `x`가 `None`인 Listing 3에서의 `plus_one`의 두 번째 호출을 살펴봅시다. `match` 안으로 들어와서 첫 번째 갈래와 비교합니다.\n\n```rust\n\nNone => None,\n\n```\n\n매칭 되었군요! 더할 값은 없으므로, 프로그램은 멈추고 `=>`의 우측 편에 있는 `None` 값을 반환합니다. 첫 번째 갈래에 매칭 되었으므로, 다른 갈래와는 비교하지 않습니다.\n\n`match`와 열거형을 조합하는 것은 다양한 경우에 유용합니다. 여러분은 러스트 코드 내에서 이러한 패턴을 많이 보게 될 것입니다: 열거형에 대한 `match`, 내부의 데이터에 변수 바인딩, 그런 다음 그에 대한 수행 코드 말이지요. 처음에는 약간 까다롭지만, 여러분이 일단 익숙해지면, 이를 모든 언어에서 쓸 수 있게 되기를 바랄 것입니다. 이것은 꾸준히 사용자들이 가장 좋아하는 기능입니다.\n\n### 매치는 하나도 빠뜨리지 않습니다\n\n우리가 논의할 필요가 있는 `match`의 다른 관점이 있습니다. `plus_one` 함수의 아래 버전을 고려해 보세요:\n\n```rust\n\nfn plus_one(x: Option<i32>) -> Option<i32> {\n    match x {\n        Some(i) => Some(i + 1),\n    }\n}\n\n```\n\n여기서는 `None` 케이스를 다루지 않았고, 따라서 이 코드는 버그를 일으킬 것입니다. 다행히도, 이는 러스트가 어떻게 잡는지 알고 있는 버그입니다. 이 코드를 컴파일하고자 시도하면, 아래와 같은 에러를 얻게 됩니다:\n\n```\n\nerror[E0004]: non-exhaustive patterns: `None` not covered\n -->\n  |\n6 |         match x {\n  |               ^ pattern `None` not covered\n\n```\n\n러스트는 우리가 다루지 않은 모든 가능한 경우를 알고 있고, 심지어 우리가 어떤 패턴을 잊어먹었는지도 알고 있습니다! 러스트에서 매치는 *하나도 빠뜨리지 않습니다(exhaustive):* 코드가 유효해지기 위해서는 모든 마지막 가능성까지 샅샅이 다루어야 합니다. 특히 `Option<T>`의 경우, 즉 러스트가 우리로 하여금 `None` 케이스를 명시적으로 다루는 일을 잊는 것을 방지하는 경우에는, Null 일지도 모를 값을 가지고 있음을 가정하여, 앞서 논의했던 수십억 달러짜리 실수를 하는 일을 방지해줍니다.\n\n### `_` 변경자(placeholder)\n\n러스트는 또한 우리가 모든 가능한 값을 나열하고 싶지 않을 경우에 사용할 수 있는 패턴을 가지고 있습니다. 예를 들어, `u8`은 0에서부터 255까지 유효한 값을 가질 수 있습니다. 만일 우리가 1, 3, 5, 그리고 7 값에 대해서만 신경 쓰고자 한다면, 나머지 0, 2, 4, 6, 8, 그리고 9부터 255까지를 모두 나열하고 싶진 않을 겁니다. 다행히도, 그럴 필요 없습니다: 대신 특별 패턴인 `_`를 이용할 수 있습니다.\n\n```rust\n\nlet some_u8_value = 0u8;\nmatch some_u8_value {\n    1 => println!(\"one\"),\n    3 => println!(\"three\"),\n    5 => println!(\"five\"),\n    7 => println!(\"seven\"),\n    _ => (),\n}\n\n```\n\n`_` 패턴은 어떠한 값과도 매칭 될 것입니다. 우리의 다른 갈래 뒤에 이를 집어넣음으로써, `_`는 그전에 명시하지 않은 모든 가능한 경우에 대해 매칭 될 것입니다. `()`는 단지 단위 값이므로, `_` 케이스에서는 어떤 일도 일어나지 않을 것입니다. 결과적으로, 우리가 `_` 변경자 이전에 나열하지 않은 모든 가능한 값들에 대해서는 아무것도 하고 싶지 않다는 것을 말해줄 수 있습니다.\n\n하지만 `match` 표현식은 우리가 단 *한 가지* 경우에 대해 고려하는 상황에서는 다소 장황할 수 있습니다. 이러한 상황을 위하여, 러스트는 `if let`을 제공합니다.','2022-09-05 13:06:13.553000','match',16),(17,'`if let` 문법은 `if`와 `let`을 조합하여 하나의 패턴만 매칭 시키고 나머지 경우는 무시하는 값을 다루는 덜 수다스러운 방법을 제공합니다. 어떤 `Option<u8>` 값을 매칭 하지만 그 값이 3일 경우에만 코드를 실행시키고 싶어 하는 Listing 1에서의 프로그램을 고려해 보세요:\n\n```rust\n\nlet some_u8_value = Some(0u8);\nmatch some_u8_value {\n    Some(3) => println!(\"three\"),\n    _ => (),\n}\n\n```\n\nListing 1: 어떤 값이 `Some(3)` 일 때에만 코드를 실행하도록 하는 `match`\n\n우리는 `Some(3)`에 매칭 되는 경우에만 뭔가를 하지만 다른 `Some<u8>` 값 혹은 `None` 값인 경우에는 아무것도 하지 않고 싶습니다. 이러한 `match` 표현식을 만족시키기 위해, `_ => ()`을 단 하나의 variant를 처리한 다음에 추가해야 하는데, 이는 추가하기에 너무 많은 보일러 플레이트 코드입니다.\n\n그 대신, `if let`을 이용하여 이 코드를 더 짧게 쓸 수 있습니다. 아래의 코드는 Listing 1에서의 `match`와 동일하게 동작합니다:\n\n```rust\n\nif let Some(3) = some_u8_value {\n    println!(\"three\");\n}\n\n```\n\n`if let`은 `=`로 구분된 패턴과 표현식을 입력받습니다. 이는 `match`와 동일한 방식으로 작동하는데, 여기서 표현식은 `match`에 주어지는 것이고 패턴은 이 `match`의 첫 번째 갈래와 같습니다.\n\n`if let`을 이용하는 것은 여러분이 덜 타이핑하고, 덜 들여 쓰기 하고, 보일러 플레이트 코드를 덜 쓰게 된다는 뜻입니다. 하지만, `match`가 강제했던 하나도 빠짐없는 검사를 잃게 되었습니다. `match`와 `if let` 사이에서 선택하는 것은 여러분의 특정 상황에서 여러분이 하고 있는 것에 따라, 그리고 간결함을 얻는 것이 전수 조사를 잃는 것에 대한 적절한 거래인지에 따라 달린 문제입니다.\n\n바꿔 말하면, 여러분은 `if let`를 어떤 값이 하나 패턴에 매칭 되었을 때 코드를 실행하고 다른 값들에 대해서는 무시하는 `match` 문을 위한 문법적 설탕(syntax sugar)으로 생각할 수 있습니다.\n\n`if let`과 함께 `else`를 포함시킬 수 있습니다. `else` 뒤에 나오는 코드 블록은 `match` 표현식에서 `_` 케이스 뒤에 나오는 코드 블록과 동일합니다. match 장에 나왔던 `Quarter` variant가 `UsState` 값도 들고 있었던 `Coin` 열거형 정의부를 상기해 보세요. 만일 우리가 쿼터가 아닌 모든 동전을 세고 싶은 동시에 쿼터 동전일 경우 또한 알려주고 싶었다면, 아래와 같이 `match`문을 쓸 수 있었을 겁니다:\n\n```rust\n\nlet mut count = 0;\nmatch coin {\n    Coin::Quarter(state) => println!(\"State quarter from {:?}!\", state),\n    _ => count += 1,\n}\n\n```\n\n혹은 아래와 같이 `if let`과 `else` 표현식을 이용할 수도 있겠지요:\n\n```rust\n\nlet mut count = 0;\nif let Coin::Quarter(state) = coin {\n    println!(\"State quarter from {:?}!\", state);\n} else {\n    count += 1;\n}\n\n```\n\n만일 여러분의 프로그램이 `match`로 표현하기에는 너무 수다스러운 로직을 가지고 있는 경우에 놓여 있다면, 여러분의 러스트 도구 상자에는 또한 `if let`이 있음을 기억하세요.\n\n## 정리\n\n지금까지 우리는 열거한 값들의 집합 중에서 하나가 될 수 있는 커스텀 타입을 만들기 위해서 열거형을 사용하는 방법을 다뤄보았습니다. 우리는 표준 라이브러리의 `Option<T>` 타입이 에러를 방지하기 위해 어떤 식으로 타입 시스템을 이용하도록 도움을 주는지 알아보았습니다. 열거형 값들이 내부에 데이터를 가지고 있을 때는, `match`나 `if let`을 이용하여 그 값들을 추출하고 사용할 수 있는데, 둘 중 어느 것을 이용할지는 여러분이 다루고 싶어 하는 경우가 얼마나 많은지에 따라 달라집니다.\n\n여러분의 러스트 프로그램은 이제 구조체와 열거형을 이용해 여러분의 영역 내의 개념을 표현할 수 있습니다. 여러분의 API 내에서 사용할 커스텀 타입을 생성하는 것은 타입 안전성을 보장합니다: 컴파일러는 여러분의 특정 함수들이 예상하는 특정 타입의 값만 갖도록 만들어줄 것입니다.\n\n사용하기 직관적이고 여러분의 사용자가 필요로 할 것만 정확히 노출된 잘 조직화된 API를 여러분의 사용들에게 제공하기 위해서, 이제 러스트의 모듈로 넘어갑시다.','2022-09-05 13:06:58.109000','if let',17),(18,'함수 시그니처나 구조체에서와 같은 방식으로, 우리가 일반적으로 타입을 쓰는 곳에다 제네릭을 이용하는 것은 여러 다른 종류의 구체적인 데이터 타입에 대해 사용할 수 있는 정의를 생성하도록 해줍니다. 제네릭을 이용하여 함수, 구조체, 열거형, 그리고 메소드를 정의하는 방법을 살펴본 뒤, 이 절의 끝에서 제네릭을 이용한 코드의 성능에 대해 논의하겠습니다.\n\n### 함수 정의 내에서 제네릭 데이터 타입을 이용하기\n\n우리는 함수의 시그니처 내에서 파라미터의 데이터 타입과 반환 값이 올 자리에 제네릭을 사용하는 함수를 정의할 수 있습니다. 이러한 방식으로 작성된 코드는 더 유연해지고 우리 함수를 호출하는 쪽에서 더 많은 기능을 제공할 수 있는 한편, 코드 중복을 야기하지도 않습니다.\n\n우리의 `largest` 함수로 계속 진행하면, Listing 10-4는 슬라이스 내에서 가장 큰 값을 찾는 동일한 기능을 제공하는 두 함수를 보여주고 있습니다. 첫 번째 함수는 Listing 10-3에서 추출한 슬라이스에서 가장 큰 `i32`를 찾는 함수입니다. 두 번째 함수는 슬라이스에서 가장 큰 `char`를 찾습니다:\n\nFilename: src/main.rs\n\n```rust\n\nfn largest_i32(list: &[i32]) -> i32 {\n    let mut largest = list[0];\n\n    for &item in list.iter() {\n        if item > largest {\n            largest = item;\n        }\n    }\n\n    largest\n}\n\nfn largest_char(list: &[char]) -> char {\n    let mut largest = list[0];\n\n    for &item in list.iter() {\n        if item > largest {\n            largest = item;\n        }\n    }\n\n    largest\n}\n\nfn main() {\n    let numbers = vec![34, 50, 25, 100, 65];\n\n    let result = largest_i32(&numbers);\n    println!(\"The largest number is {}\", result);\n\n    let chars = vec![\'y\', \'m\', \'a\', \'q\'];\n\n    let result = largest_char(&chars);\n    println!(\"The largest char is {}\", result);\n}\n\n```\n\nListing 10-4: 이름과 시그니처만 다른 두 함수들\n\n여기서 함수 `largest_i32`와 `largest_char`는 정확히 똑같은 본체를 가지고 있으므로, 만일 우리가 이 두 함수를 하나로 바꿔서 중복을 제거할 수 있다면 좋을 것입니다. 운 좋게도, 제네릭 타입 파라미터를 도입해서 그렇게 할 수 있습니다!\n\n우리가 정의하고자 하는 함수의 시그니처 내에 있는 타입들을 파라미터화 하기 위해서, 타입 파라미터를 위한 이름을 만들 필요가 있는데, 이는 값 파라미터들의 이름을 함수에 제공하는 방법과 유사합니다. 우리는 `T`라는 이름을 선택할 겁니다. 어떤 식별자(identifier)든지 타입 파라미터의 이름으로 사용될 수 있지만, 러스트의 타입 이름에 대한 관례가 낙타 표기법(CamelCase)이기 때문에 `T`를 사용하려고 합니다. 제네릭 타입 파라미터의 이름은 또한 관례상 짧은 경향이 있는데, 종종 그냥 한 글자로 되어 있습니다. \"type\"을 줄인 것으로서, `T`가 대부분의 러스트 프로그래머의 기본 선택입니다.\n\n함수의 본체에 파라미터를 이용할 때는, 시그니처 내에 그 파라미터를 선언하여 해당 이름이 함수 본체 내에서 무엇을 의미하는지 컴파일러가 할 수 있도록 합니다. 비슷하게, 함수 시그니처 내에서 타입 파라미터 이름을 사용할 때는, 사용 전에 그 타입 파라미터 이름을 선언해야 합니다. 타입 이름 선언은 함수의 이름과 파라미터 리스트 사이에 꺾쇠괄호를 쓰고 그 안에 넣습니다.\n\n우리가 정의하고자 하는 제네릭 `largest` 함수의 함수 시그니처는 아래와 같이 생겼습니다:\n\n```rust\n\nfn largest<T>(list: &[T]) -> T {\n\n```\n\n이를 다음과 같이 읽습니다: 함수 `largest`는 어떤 타입 `T`을 이용한 제네릭입니다. 이것은 `list`라는 이름을 가진 하나의 파라미터를 가지고 있고, `list`의 타입은 `T` 타입 값들의 슬라이스입니다. `largest` 함수는 동일한 타입 `T` 값을 반환할 것입니다.\n\nListing 10-5는 함수 시그니처 내에 제네릭 데이터 타입을 이용한 통합된 형태의 `largest` 함수 정의를 보여주며, 또한 `i32` 값들의 슬라이스 혹은 `char` 값들의 슬라이스를 가지고 어떻게 `largest`를 호출할 수 있을지를 보여줍니다. 이 코드가 아직 컴파일되지 않는다는 점을 주의하세요!\n\nFilename: src/main.rs\n\n```rust\n\nfn largest<T>(list: &[T]) -> T {\n    let mut largest = list[0];\n\n    for &item in list.iter() {\n        if item > largest {\n            largest = item;\n        }\n    }\n\n    largest\n}\n\nfn main() {\n    let numbers = vec![34, 50, 25, 100, 65];\n\n    let result = largest(&numbers);\n    println!(\"The largest number is {}\", result);\n\n    let chars = vec![\'y\', \'m\', \'a\', \'q\'];\n\n    let result = largest(&chars);\n    println!(\"The largest char is {}\", result);\n}\n\n```\n\nListing 10-5: 제네릭 타입 파라미터를 이용하지만 아직 컴파일되지 않는 `largest` 함수의 정의\n\n이 코드를 지금 컴파일하고자 시도하면, 다음과 같은 에러를 얻게 될 것입니다:\n\n```\n\nerror[E0369]: binary operation `>` cannot be applied to type `T`\n  |\n5 |         if item > largest {\n  |            ^^^^\n  |\nnote: an implementation of `std::cmp::PartialOrd` might be missing for `T`\n\n```\n\n위 노트는 `std::cmp::PartialOrd`를 언급하는데, 이는 *트레잇(trait)* 입니다. 트레잇에 대해서는 다음 절에서 살펴볼 것이지만, 간략하게 설명하자면, 이 에러가 말하고 있는 것은 `T`가 될 수 있는 모든 가능한 타입에 대해서 동작하지 않으리라는 것입니다: 함수 본체 내에서 `T` 타입의 값을 비교하고자 하기 때문에, 어떻게 순서대로 정렬하는지 알고 있는 타입만 사용할 수 있는 것입니다. 표준 라이브러리는 어떤 타입에 대해 비교 연산이 가능하도록 구현할 수 있는 트레잇인 `std::cmp::PartialOrd`을 정의해뒀습니다. 다음 절에서 트레잇, 그리고 어떤 제네릭 타입이 특정 트레잇을 갖도록 명시하는 방법을 알아보기 위해 돌아올 것이지만, 이 예제는 잠시 옆으로 치워두고 제네릭 타입 파라미터를 이용할 수 있는 다른 곳을 먼저 돌아봅시다.\n\n### 구조체 정의 내에서 제네릭 데이터 타입 사용하기\n\n우리는 또한 하나 혹은 그 이상의 구조체 필드 내에 제네릭 타입 파라미터를 사용하여 구조체를 정의할 수 있습니다. Listing 10-6은 임의의 타입으로 된 `x`와 `y` 좌표값을 가질 수 있는 `Point` 구조체의 정의 및 사용법을 보여주고 있습니다:\n\nFilename: src/main.rs\n\n```rust\n\nstruct Point<T> {\n    x: T,\n    y: T,\n}\n\nfn main() {\n    let integer = Point { x: 5, y: 10 };\n    let float = Point { x: 1.0, y: 4.0 };\n}\n\n```\n\nListing 10-6: `T` 타입의 값 `x`와 `y`를 갖는 `Point` 구조체\n\n문법은 함수 정의 내에서의 제네릭을 사용하는 것과 유사합니다. 먼저, 구조체 이름 바로 뒤에 꺾쇠괄호를 쓰고 그 안에 타입 파라미터의 이름을 선언해야 합니다. 그러면 구조체 정의부 내에서 구체적인 데이터 타입을 명시하는 곳에 제네릭 타입을 이용할 수 있습니다.\n\n`Point`의 정의 내에서 단 하나의 제네릭 타입을 사용했기 때문에, `Point` 구조체는 어떤 타입 `T`를 이용한 제네릭이고 `x`와 `y`가 이게 결국 무엇이 되든 간에 *둘 다* 동일한 타입을 가지고 있다고 말할 수 있음을 주목하세요. 만일 Listing 10-7에서와 같이 다른 타입의 값을 갖는 `Point`의 인스턴스를 만들고자 한다면, 컴파일이 되지 않을 것입니다:\n\nFilename: src/main.rs\n\n```rust\n\nstruct Point<T> {\n    x: T,\n    y: T,\n}\n\nfn main() {\n    let wont_work = Point { x: 5, y: 4.0 };\n}\n\n```\n\nListing 10-7: `x`와 `y` 필드는 둘 모두 동일한 제네릭 데이터 타입 `T`를 가지고 있기 때문에 동일한 타입이어야 합니다\n\n이 코드를 컴파일하고자 하면, 다음과 같은 에러를 얻게 될 것입니다:\n\n```\n\nerror[E0308]: mismatched types\n -->\n  |\n7 |     let wont_work = Point { x: 5, y: 4.0 };\n  |                                      ^^^ expected integral variable, found\n  floating-point variable\n  |\n  = note: expected type `{integer}`\n  = note:    found type `{float}`\n\n```\n\n`x`에 정수 5를 대입할 때, 컴파일러는 이 `Point`의 인스턴스에 대해 제네릭 타입 `T`가 정수일 것이고 알게 됩니다. 그다음 `y`에 대해 4.0을 지정했는데, 이 `y`는 `x`와 동일한 타입을 갖도록 정의되었으므로, 타입 불일치 에러를 얻게 됩니다.\n\n만일 `x`와 `y`가 서로 다른 타입을 가지지만 해당 타입들이 여전히 제네릭인 `Point` 구조체를 정의하길 원한다면, 여러 개의 제네릭 타입 파라미터를 이용할 수 있습니다. Listing 10-8에서는 `Point`의 정의를 `T`와 `U`를 이용한 제네릭이 되도록 변경했습니다. 필드 `x`의 타입은 `T`이고, 필드 `y`의 타입은 `U`입니다:\n\nFilename: src/main.rs\n\n```rust\n\nstruct Point<T, U> {\n    x: T,\n    y: U,\n}\n\nfn main() {\n    let both_integer = Point { x: 5, y: 10 };\n    let both_float = Point { x: 1.0, y: 4.0 };\n    let integer_and_float = Point { x: 5, y: 4.0 };\n}\n\n```\n\nListing 10-8: 두 타입을 이용한 제네릭이어서 `x`와 `y`가 다른 타입의 값일 수도 있는 `Point`\n\n이제 위와 같은 모든 `Point` 인스턴스가 허용됩니다! 정의 부분에 여러분이 원하는 만큼 많은 수의 제네릭 타입 파라미터를 이용할 수 있지만, 몇몇 개보다 더 많이 이용하는 것은 읽고 이해하는 것을 어렵게 만듭니다. 여러분이 많은 수의 제네릭 타입을 필요로 하는 지점에 다다랐다면, 이는 아마도 여러분의 코드가 좀 더 작은 조각들로 나뉘는 재구조화가 필요할지도 모른다는 징조입니다.\n\n### 열거형 정의 내에서 제네릭 데이터 타입 사용하기\n\n구조체와 유사하게, 열거형도 그 variant 내에서 제네릭 데이터 타입을 갖도록 정의될 수 있습니다. 6장에서 표준 라이브러리가 제공하는 `Option<T>` 열거형을 이용해봤는데, 이제는 그 정의를 좀 더 잘 이해할 수 있겠지요. 다시 한번 봅시다:\n\n```rust\n\nenum Option<T> {\n    Some(T),\n    None,\n}\n\n```\n\n달리 말하면, `Option<T>`는 `T` 타입에 제네릭인 열거형입니다. 이것은 두 개의 variant를 가지고 있습니다: 타입 `T` 값 하나를 들고 있는 `Some`, 그리고 어떠한 값도 들고 있지 않는 `None` variant 입니다. 표준 라이브러리는 구체적인 타입을 가진 이 열거형에 대한 값의 생성을 지원하기 위해서 딱 이 한 가지 정의만 가지고 있으면 됩니다. \"옵션 값\"의 아이디어는 하나의 명시적인 타입에 비해 더 추상화된 개념이고, 러스트는 이 추상화 개념을 수많은 중복 없이 표현할 수 있도록 해줍니다.\n\n열거형은 또한 여러 개의 제네릭 타입을 이용할 수 있습니다. 우리가 9장에서 사용해본 `Result` 열거형의 정의가 한 가지 예입니다:\n\n```rust\n\nenum Result<T, E> {\n    Ok(T),\n    Err(E),\n}\n\n```\n\n`Result` 열거형은 `T`와 `E`, 두 개의 타입을 이용한 제네릭입니다. `Result`는 두 개의 variant를 가지고 있습니다: 타입 `T`의 값을 들고 있는 `Ok`, 그리고 타입 `E`의 값을 들고 있는 `Err`입니다. 이 정의는 성공하거나 (그래서 어떤 `T` 값을 반환하거나) 혹은 실패하는 (그래서 `E` 타입으로 된 에러를 반환하는) 연산이 필요한 어디에서든 편리하게 `Result` 열거형을 이용하도록 해줍니다. Listing 9-2에 우리가 파일을 열 때를 상기해보세요: 이 경우, 파일이 성공적으로 열렸을 때는 `T`에 `std::fs::File` 타입의 값이 채워지고 파일을 여는데 문제가 생겼을 때는 `E`에 `std::io::Error` 타입으로 된 값이 채워졌습니다.\n\n여러분의 코드에서 단지 들고 있는 값의 타입만 다른 여러 개의 구조체나 열거형이 있는 상황을 인지했다면, 우리가 함수 정의에서 제네릭 타입을 대신 도입하여 사용했던 것과 똑같은 절차를 통해 그러한 중복을 제거할 수 있습니다.\n\n### 메소드 정의 내에서 제네릭 데이터 타입 사용하기\n\n5장에서 했던 것과 유사하게, 정의부에 제네릭 타입을 갖는 구조체와 열거형 상의 메소드를 구현할 수도 있습니다. Listing 10-9는 우리가 Listing 10-6에서 정의했던 `Point<T>` 구조체를 보여주고 있습니다. 그러고 나서 필드 `x`의 값에 대한 참조자를 반환하는 `x`라는 이름의 메소드를 `Point<T>` 상에 정의했습니다:\n\nFilename: src/main.rs\n\n```rust\n\nstruct Point<T> {\n    x: T,\n    y: T,\n}\n\nimpl<T> Point<T> {\n    fn x(&self) -> &T {\n        &self.x\n    }\n}\n\nfn main() {\n    let p = Point { x: 5, y: 10 };\n\n    println!(\"p.x = {}\", p.x());\n}\n\n```\n\nListing 10-9: `T` 타입의 `x` 필드에 대한 참조자를 반환하는 `Point<T>` 구조체 상에 `x`라는 이름의 메소드 정의\n\n`impl` 바로 뒤에 `T`를 정의해야만 타입 `Point<T>` 메소드를 구현하는 중에 이를 사용할 수 있음을 주목하세요.\n\n구조체 정의 내에서의 제네릭 타입 파라미터는 여러분이 구조체의 메소드 시그니처 내에서 사용하고 싶어하는 제네릭 타입 파라미터와 항상 같지 않습니다. Listing 10-10에서는 Listing 10-8에서의 `Point<T, U>` 구조체 상에 `mixup` 이라는 메소드를 정의했습니다. 이 메소드는 또다른 `Point`를 파라미터로 갖는데, 이는 우리가 호출하는 `mixup` 상의 `self`의 `Point`와 다른 타입을 가지고 있을 수도 있습니다. 이 메소드는 새로운 `Point`를 생성하는데 `self` `Point`로부터 (`T` 타입인) `x` 값을 가져오고, 파라미터로 넘겨받은 `Point`로부터 (`W` 타입인) `y` 값을 가져온 것입니다:\n\nFilename: src/main.rs\n\n```rust\n\nstruct Point<T, U> {\n    x: T,\n    y: U,\n}\n\nimpl<T, U> Point<T, U> {\n    fn mixup<V, W>(self, other: Point<V, W>) -> Point<T, W> {\n        Point {\n            x: self.x,\n            y: other.y,\n        }\n    }\n}\n\nfn main() {\n    let p1 = Point { x: 5, y: 10.4 };\n    let p2 = Point { x: \"Hello\", y: \'c\'};\n\n    let p3 = p1.mixup(p2);\n\n    println!(\"p3.x = {}, p3.y = {}\", p3.x, p3.y);\n}\n\n```\n\nListing 10-10: 구조체 정의에서와는 다른 제네릭 타입을 사용하는 메소드\n\n`main`에서, 우리는 (`5` 값을 갖는) `x`에 대해 `i32`를, (`10.4` 값을 갖는) `y`에 대해 `f64`를 사용하는 `Point`를 정의했습니다. `p2`는 (`\"Hello\"` 값을 갖는) `x`에 대해 스트링 슬라이스를, (`c` 값을 갖는) `y`에 대해 `char`를 사용하는 `Point`입니다. `p1`상에서 인자로 `p2`를 넘기는 `mixup` 호출은 `p3`을 반환하는데, 이는 `x`가 `p1`으로부터 오기 때문에 `x`는 `i32` 타입을 갖게 될 것입니다. 또한 `y`는 `p2`로부터 오기 때문에 `p3`은 `y`에 대해 `char` 타입을 가지게 될 것입니다. `println!`은 `p3.x = 5, p3.y = c`를 출력하겠지요.\n\n제네릭 파라미터 `T`와 `U`는 `impl` 뒤에 선언되었는데, 이는 구조체 정의와 함께 사용되기 때문임을 주목하세요. 제네릭 파라미터 `V`와 `W`는 `fn mixup` 뒤에 선언되었는데, 이는 이들이 오직 해당 메소드에 대해서만 관련이 있기 때문입니다.\n\n### 제네릭을 이용한 코드의 성능\n\n여러분이 이 절을 읽으면서 제네릭 타입 파라미터를 이용한 런타임 비용이 있는지 궁금해하고 있을런지도 모르겠습니다. 좋은 소식을 알려드리죠: 러스트가 제네릭을 구현한 방식이 의미하는 바는 여러분이 제네릭 파라미터 대신 구체적인 타입을 명시했을 때와 비교해 전혀 느려지지 않을 것이란 점입니다!\n\n러스트는 컴파일 타임에 제네릭을 사용하는 코드에 대해 *단형성화(monomorphization)* 를 수행함으로써 이러한 성능을 이루어 냈습니다. 단형성화란 제네릭 코드를 실제로 채워질 구체적인 타입으로 된 특정 코드로 바꾸는 과정을 말합니다.\n\n컴파일러가 하는 일은 Listing 10-5에서 우리가 제네릭 함수를 만들 때 수행한 단계들을 반대로 한 것입니다. 컴파일러는 제네릭 코드가 호출되는 모든 곳을 살펴보고 제네릭 코드가 호출될 때 사용된 구체적인 타입에 대한 코드를 생성합니다.\n\n표준 라이브러리의 `Option` 열거형을 사용하는 예제를 통해 알아봅시다:\n\n```rust\n\nlet integer = Some(5);\nlet float = Some(5.0);\n\n```\n\n러스트가 이 코드를 컴파일할 때, 단형성화를 수행할 것입니다. 컴파일러는 `Option`에 넘겨진 값들을 읽고 두 종류의 `Option<T>`를 가지고 있다는 사실을 알게 됩니다: 하나는 `i32`이고 나머지 하나는 `f64` 이지요. 그리하여 컴파일러는 제네릭 정의를 명시적인 것들로 교체함으로써 `Option<T>`에 대한 제네릭 정의를 `Option_i32`와 `Option_f64`로 확장시킬 것입니다.\n\n컴파일러가 생성한 우리의 단형성화된 버전의 코드는 아래와 같이 보이게 되는데, 컴파일러에 의해 생성된 구체화된 정의로 교체된 제네릭 `Option`이 사용되었습니다:\n\nFilename: src/main.rs\n\n```rust\n\nenum Option_i32 {\n    Some(i32),\n    None,\n}\n\nenum Option_f64 {\n    Some(f64),\n    None,\n}\n\nfn main() {\n    let integer = Option_i32::Some(5);\n    let float = Option_f64::Some(5.0);\n}\n\n```\n\n우리는 제네릭을 사용하여 중복 없는 코드를 작성할 수 있고, 러스트는 이를 각 인스턴스에 대해 구체적인 타입을 갖는 코드로 컴파일할 것입니다. 이는 우리가 제네릭을 사용하는 데에 어떠한 런타임 비용도 없음을 의미합니다; 코드가 실행될 때, 손으로 각각 특정 정의를 중복시킨 것과 같이 실행될 것입니다. 단형성화의 과정은 러스트의 제네릭이 런타임에 극도로 효율적 이도록 만들어 주는 것입니다.','2022-09-05 13:08:29.563000','제네릭 데이터 타입',18);
