   let mut v = vec![50, 60, 70];\n    ________ {\n        *i *= 50;\n        println!(\"{}\", i);\n    }\n}\n출력 값\n2500\n3000\n3500',25),(63,2,'1. str','2.  &str','3. String','4. &String',1,'해당 코드에서 변수 my_name가 나타내는 타입은?\nfn main() {\n    let my_name = \"Gil Dong\";\n     \n    println!(\"Hi, I\'m {}\", my_name); \n\n}',26),(64,-2,'1. “Rust”.to_string()','2. String::from(”Rust”)','3. String::new(”Rust”)','4. “Rust”.from_string()',2,'&str 에서 String으로 변경할 때 사용하는 함수는? (정답 2개)',26),(65,2,'1. blabla.replace(”Rust”)','2. blabla.contains(”Rust”)','3. blabla.contain(”Rust”)','4. blabla.replaces(”Rust”)',3,'다음 코드에서 “Rust”가 들어있는지 여부를 파악하려고 할 때, 사용하는 코드는?\nfn main() {\n    let blabla= \"We\'ve been working hard to make a tutorial site where you can learn Rust quickly and easily.\";\n     \n    println!(\"{}\", ? ); \n\n}',26),(66,1,'1. insert()','2. push()','3. add()','4. put()',1,'해쉬맵은 생성후, _______함수를 통해 값을 넣는다.',27),(67,4,'1. {\"Red\": 20}','2. 20','3. None(20)','4. Some(20)',2,' 해당 코드에서 해쉬맵에서 값 접근할 때 get()함수를 썼을 때, 정상 작동시 반환되는 값은?\nuse std::collections::HashMap;\nfn main() {\n    let mut scores = HashMap::new();\n    scores.insert(String::from(\"Red\"), 20);\n\n    let score = scores.get(\"Red\");\n    println!(\"{:?}\", score);\n}',27),(68,3,'1. 람다 함수(lambda function)','2. 단순 함수(simple function)','3. 해쉬 함수(hashing function) ','4. 체이닝(chaining)',3,'해쉬맵 HashMap<K, V> 타입은 K 타입의 키에 V 타입의 값을 매핑한 것을 저장합니다. 이 매핑은 ____________ 을 통해 동작합니다.',27),(69,2,'1. BTreeMap(Binary Tree Map:바이너리 트리 맵)','2. HashSet(해시셋)','3. BTreeSet(바이너리 트리 셋)','4. BinaryHeap(바이너리 힙)',1,'1. 다음 특징을 가진 컬렉션 타입은 어느 것 인가요?\nKey를 가지고 있습니다. 즉, Value값이 없습니다.\nKey가 존재하는지 존재하지 않는지 알고 싶을 때 사용합니다.\n해당 요소는 Eq및 Hash특성을 구현해야 합니다.',28),(70,4,'1. 러스트의 각각의 값은 해당값의 오너(owner)라고 불리우는 변수를 갖고 있습니다.','2. 한번에 딱 하나의 오너만 존재할 수 있습니다.','3. 오너가 스코프 밖으로 벗어나는 때, 값은 버려집니다(dropped).','4. 할당된 메모리가 연결된 변수의 경우는 메모리가 해제되지 않습니다.',1,'소유권 규칙 세트에 해당하는 내용으로 옳지 않은 것은?',29),(71,3,'1. 숫자 ⇒ 이동/ 문자열, 벡터 또는 기타 ⇒ 복사','2. 숫자 ⇒ 이동/ 문자열, 벡터 또는 기타 ⇒ 복제','3. 숫자 ⇒ 복사 / 문자열, 벡터 또는 기타 ⇒ 이동','4. 숫자 ⇒ 복사 / 문자열, 벡터 또는 기타 ⇒ 복제',2,'데이터타입에 따른 소유권의 방식이 올바르게 짝지어진 것은?',29),(72,1,'1. clone()','2.  copy()','3. reproduce()','4. serve()',3,'형식이 이동되기 전에 명시적으로 형식을 복사하는 것으로 복제라고 부릅니다. 복제를 하기 위해서 사용되는 함수는?',29),(73,2,'1. @','2. &','3. %','4. *',1,'다음 코드에서 오류가 나지 않기 위해서 라인 2의 빈칸 부분에 들어가야할 것으로 옳은 것은?\nlet food = String::from(\"good\");\nlet food _reference = __food ;\nprintln!(\"Food : {food}\");',30),(74,1,'1. return_str()함수의 호출이 끝나면, 지역 변수인 country_ 가 사라지는데, 그러면 country_ref는 자연스럽게 사라진 것을 참조하고 있게 되어 오류가 발생','2. 라인 3에서 country_ref 에서 country_를 참조할때는 *을 사용해야 하기 때문','3. main 함수에서 country 변수의 데이터타입을 명시적으로 밝히지 않아서','4. &str 타입은 참조를 할 수가 없어서 String을 사용해야함',2,'다음 코드에서 오류가 발생한 이유는 분석한 결과로 옳은 것은?\nfn return_str() -> &str{\n	let country_ = String::from(\"대한민국\");\n	let country_ref = &country_;\n	country_ref //경고\n}\nfn main(){\n	let country = return_str();\n}',30),(75,4,'1. **mut','2. *mut','3. &&mut','4. &mut',3,'데이터를 변경가능한 참조를 사용하고 싶을 때 사용하는 것은?',30),(76,1,'1. &country로 참조를 사용하여 함수로 소유권이 넘어가지 않았기 때문에','2. main()함수에서 “대한민국”.to_string으로  &str에서 String으로 타입변환을 해줘서  ','3. 같은 스코프 내에서는 country는 계속 존재하므로 여러번 사용해도 된다.','4. print_country 함수 내부에서 변수를 출력할떄 직접 {} 안에 넣어서 출력하기 때문에',1,'다음 코드에서 country변수를 여러 번 print하는데에도 오류가 나지 않는 이유를 적절히 설명한 것은?',32),(77,3,'1. &let','2. let','3. &mut','4. mut',2,'다음 코드에서 change함수에서 값을 변경하기 위해 빈칸에 사용해야하는 키워드는?\nfn main() {\n    let mut greeting = String::from(\"hello\");\n    change(_____ greeting);\n}\n\nfn change(text:_____ String) {\n    text.push_str(\", world\");\n}',32),(78,4,'1. 정수(integers), 부동소수점(floats)','2. 정수(integers), 부울형(booleans)','3. 문자(char), 부울형(booleans)','4. 문자(char), 문자열(String)',1,'복사 타입(Copy type)에 해당하는 데이터 타입이 아닌 것이 포함된 보기는?',33),(79,4,'1. 따로 선언해서 만들어줘야하기 때문에 만들기 어렵습니다.','2. 컴파일러에게 타입의 사이즈를 알려줘야 합니다.','3. 복사 타입을 사용할 때, 소유권을 고려하여 사용해야 합니다.','4. 소유권과 관계없이 사용할 수 있습니다. ',2,'복사 타입에 대한 설명으로 알맞은 것은?',33),(80,1,'1. clone()','2. repeat()','3. duplicate()','4. again()',3,'복제 타입을 사용하기 위해서 사용하는 함수는?',33),(81,1,'1. 라이프타임(lifetimes)','2. 제네릭(generic)','3. 트레잇(Trait)','4. 테스팅(Testing)',1,'빈칸에 알맞은 말은?\n구조체가 소유권이 없는 데이터의 참조를 저장할수는 있지만,    빈칸 의 사용을 전제로 합니다. ',34),(82,4,'1. &str대신 char[]을 사용한다.','2. &str대신 char을 사용한다.','3. &str대신 Unicode를 사용한다.','4. &str대신 String을 사용한다.',2,'&str을 사용한 구조체의 오류를 고치는 방법은?',34),(83,4,'1. 제네릭은 임의로 타입을 지정하는 것입니다.','2. 제네릭을 사용하면 더 유연한 코드를 작성할 수 있는 동시에, 코드 중복도 할 수 있습니다.','3. 관례상 T를 제네릭 타입 이름으로 사용합니다. ','4. 제네릭을 사용하면 다양한 타입을 지원해야하기 떄문에 코드의 성능이 떨어집니다.',1,'Generics(제네릭)과 관련된 내용으로 옳지 않은 것은?',35),(84,2,'1. return_number(number: i8) -> i8','2. return_number<T>(number: T) -> T','3. return_number(number: <T>) -> <T>','4. return_number(number: T) -> T',2,'return_number(number: i32) -> i32 해당 함수에 사용되는 타입을 제네릭으로 바꾼것으로 옳은 것은?',35),(85,1,'1. print_number<T> → print_number<T:std::fmt::Debug>','2. \"Here is your number: {:?}\" → \"Here is your number: {}\" ','3. print_number<T> → print_number<T:std::fmt::PartialOrd>','4. print_number<T> → print_number<T:std::fmt::Display>',3,'해당 코드의 오류를 수정하기 위해서 해야할 작업은?\nfn print_number<T>(number: T) {\n    println!(\"Here is your number: {:?}\", number); // ⚠️\n}\n\nfn main() {\n    print_number(5);\n}',35),(86,2,'1. 추가적으로 더해주는 부분을 Option을 통해서 설정한다.','2. 있을 지도 모르고, 없을 수도 있는 값에 적용하는데 심각한 에러를 방지하기 위해서 사용한다.','3. Some(T)과 None을 둘 중 하나를 선택하기 위해서 사용한다.','4. 코드를 더 복잡하게 만들기 위해서 사용한다.',1,'Option을 왜 사용하는가?',36),(87,3,'1. get()','2. detail()','3. unwrap()','4. wrap()',2,'Option의 Some(T)에서 내부에 들어있는 값을 이용하기 위한 함수는 무엇인가?',36),(88,4,'1. Option은 다른 언어의 null과 비슷한 역할을 합니다. rust에는 null이 없는 대신 옵션이 존재합니다.','2. unwrap()을 사용할 때, None이 결과로 나오면 에러가 나기 때문에 안됩니다.','3. .is_some() 옵션의 some인지 확인하는 함수입니다. ','4. unwrap()을 사용해서 에러가 나는 경우에는 에러가 난 이유도 컴파일러에서 제공합니다.',3,'Option과 관련된 설명으로 옳지 않은 것은?',36),(89,1,'1. Ok(T), Err(E)','2. Pass(T), Fail(E)','3. Success(T), Fail(E)','4. Pass(T), NonPass(E)',1,'Result(결과)의 내부 구조로 알맞은 것은?',37),(90,4,'1. is_ok() 는 result가 Ok 인지 판별합니다.','2. is_err() 는 result가 Err 인지 판별합니다.','3. Result<T, E>에서 T는 제너릭, E는 에러를 나타냅니다.','4. result를 사용하면 에러에 빠지는 것을 경고로 바꾸어 줍니다.',2,'Result(결과)에 관련된 설명으로 틀린 것은?',37),(92,1,'1. ⇒','2. →','3. ==','4. :',1,'match구문에서 각각 조건을 나타내는 기호는?',39),(93,3,'1. It\'s not very nice today','2. It\'s a nice day','3. It\'s cloudy and warm','4. It\'s cloudy and something',2,'다음 코드의 결과값은?\nfn main() {\n	let sky = \"cloudy\";\n	let temperature = \"warm\";\n	\n	match (sky, temperature) {\n		(\"cloudy\", \"cold\") => println!(\"It\'s not very nice today\"),\n		(\"clear\", \"warm\") => println!(\"It\'s a nice day\"),\n		(\"cloudy\", \"warm\" ) => println!(\"It\'s cloudy and warm\"),\n		(\"cloudy\", _) => println!(\"It\'s cloudy and something\"),\n		_ => println!(\"Not sure what the weather is.\")\n	}\n}',39),(94,3,'1. 임시변수이름 #','2. 임시변수이름 $','3. 임시변수이름 @','4. 임시변수이름 &',3,'match구문에서 입력 받은 값을 출력해야 할 때 사용하는 기호는?',39);
